INSERT INTO `dp_gonggao` (`not_id`,`not_name`,`not_title`,`not_content`,`not_order`,`not_show`,`not_addtime`,`not_updatetime`,`not_adduser`,`not_url`) VALUES
('4','拣豆网上线啦！','拣豆网上线啦！','<p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">“拣豆网”是上海简豆网络科技有限公司为汽车车身冲压模具设计类服务量身打造的专业化平台，是优秀工程师的汇聚地，可以为买方提供优质的、专业的、性价比更高的设计服务，是您身边的模具设计专家！</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>威客</strong></span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">威客是指那些通过互联网把自己的智慧、知识、能力、经验转换成实际收益的人，他们在互联网上通过解决科学，技术，工作，生活，学习中的问题从而让知识、智慧、经验、技能体现经济价值。威客的概念是在2002年被提出的，经过10多年的发展，目前已经被很多行业所接受。</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>模具行业的威客</strong></span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">威客的形式其实在模具行业早就存在了，模具设计工程师在任职期间利用闲暇时间，通过熟人介绍，以个人名义承接少量的设计工作，赚取工资以外的收入，我们俗称为“私活”；个人工作室也是普遍存在的。</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">由于模具是技术密集型的产品，对于设计的要求非常高，所以目前的“私活”的买卖方双方都是相互比较熟悉的，即买方非常熟悉工程师的能力，如果买方不熟悉或不清楚工程师实际能力的情况，买方是不会轻易的将设计任务委托给该名工程师的；但有些时候，由于资源有限又迫于项目时间的压力，仓促发包的情况也是存在的。而对于工程师来说，鉴于各种原因，目前的情况是，有足够能力的工程师缺少展示自己或者与买方的沟通渠道，而且工程师对于买方也会存在一些疑虑，比如是否能够如期的收到钱是普遍关心的问题之一。</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>“拣豆网”--您身边的模具设计专家</strong><br/><br/></span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">鉴于目前存在的上述的信息不对称的情况，拣豆网为有能力、有梦想的工程师提供一个可以展示自己能力的平台，同时不必担心隐私外露而影响目前的工作，为买方提供更多的优质工程师资源，响应更加及时、充分。</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">为保证双方的权益，拣豆网将会对买卖双方进行实名认证，并对工程师的技术能力进行初步的评估，对于虚报个人能力者，拣豆网将拒绝其注册认证；为了使工程师更安心积极的开展工作，买方需要将相应的费用委托拣豆网进行托管，当工程师完成任务并得到买方认可后，拣豆网将根据付款指令付款给工程师，确保买方的资金安全和工程师的利益不受损害。</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">拣豆网的经营团队在总结10多年模具行业从业经验的基础上，将图纸设计的进度管理和质量管理纳入到拣豆网中，目的是确保准时、准确的为买方提供服务。</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0); line-height: 1.75em;\">拣豆网希望成为您身边的模具设计专家，同时也为工程师提供一个更广阔的展示空间。<br/></span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">更多资讯请访问拣豆网官方网站：www.jeendon.com</span></p>','1','1','1487128761','2017','','');
INSERT INTO `dp_gonggao` (`not_id`,`not_name`,`not_title`,`not_content`,`not_order`,`not_show`,`not_addtime`,`not_updatetime`,`not_adduser`,`not_url`) VALUES
('5','汽车冲压模具设计工程师招募令','汽车冲压模具设计工程师招募令','<p style=\"line-height: 1.75em;\"><img src=\"http://www.jeendon.com/attachement/image/admin/2017/02/15/f/2/b/2/58a3cdce797db.jpg\" width=\"100%\" alt=\"f/2/b/2/58a3cdce797db.jpg\"/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">15年前我们错过了阿里巴巴，10年前我们错过了淘宝。8年前我们错过了QQ。6年前我们错过了微博。4年前我们错过了微信。现在，你还要错过吗？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">我们常说时间面前人人平等，后来才发现被骗了好多年。有的人大学四年可以修3个学位，有的人英语四级四年考3次不过；有的人一天投入工作16个小时，一年连升两级；有的人入职一年还弄不明白怎么做PPT。同样的时间，成就天壤之别。请问，业余时间你还在摆弄你的手机吗？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">这年头，作为一个汽车行业的模具设计工程师是如此的苦逼！工作环境差，强度大，天天被领导追进度，最关键是还挣不到钱。想自己开个设计工作室风险太大，想利用自己的业余时间干点事情又担心钱收不回来。身为设计工程师的你，是否觉得总是空有一身本领而无机遇施展呢？&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">Duang！现在机会来了——“拣豆网”是上海简豆网络科技有限公司为汽车冲压模具设计类服务量身打造的专业化服务平台，是优秀工程师的汇聚地，可以为买方提供优质的、专业的、性价比更高的设计服务。“拣豆网”为有能力、有梦想的工程师提供一个可以展示自己能力的平台。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">加入我们的六大理由：</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1，&nbsp; 资金保障，每个任务发布需求方都会事先托管设计费用，由平台担保，达到付款条件由平台直接付款，无需担心收款问题。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2，&nbsp; 海量任务，你可以利用业余时间赚钱，数钱数到手抽筋。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3，&nbsp; 安全可靠，无需担心个人信息泄露造成不必要的麻烦。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">4，&nbsp; 灵活便捷，只要你有电脑，有比别人更好的大脑，随时随地都可以画图挣钱！</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">5，&nbsp; 价格你自己说了算，根据市场和自身的时间你自己来灵活报价。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">6，&nbsp; 你将拥有自己的团队，如果你有足够的经验和能力，你就可以拥有自己的团队，专职经营自己的事业。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">要求：&nbsp;</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、可以根据客户需求提供客户所需的图纸及其他文件。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、能够与客户就技术及图纸质量、进度等问题进行沟通，如果你不能和客户进行沟通，那就加入一个团队吧。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;<br/></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">即刻登录</span><a href=\"http://www.jeendon.xn--com%21-d75f14k8scpve598b/\" _src=\"http://www.jeendon.com加入我们吧！\" style=\"color: rgb(0, 0, 0); text-decoration: underline;\"><span style=\"color: rgb(0, 0, 0);\">www.jeendon.com加入我们吧！</span></a></p><p style=\"line-height: 1.75em;\"><img src=\"http://www.jeendon.com/attachement/image/admin/2017/02/15/4/b/9/e/58a3cde8d3dd8.jpg\" width=\"100%\" alt=\"4/b/9/e/58a3cde8d3dd8.jpg\"/></p>','1','1','1487130179','2017','','');
