('96','拣豆网上线啦！','拣豆网上线啦！','/attachement/image/admin/2017/02/15/d/1/8/1/58a3c8d720417.jpg','<p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">“拣豆网”是上海简豆网络科技有限公司为汽车车身冲压模具设计类服务量身打造的专业化平台，是优秀工程师的汇聚地，可以为买方提供优质的、专业的、性价比更高的设计服务，是您身边的模具设计专家！</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>威客</strong></span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">威客是指那些通过互联网把自己的智慧、知识、能力、经验转换成实际收益的人，他们在互联网上通过解决科学，技术，工作，生活，学习中的问题从而让知识、智慧、经验、技能体现经济价值。威客的概念是在2002年被提出的，经过10多年的发展，目前已经被很多行业所接受。</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>模具行业的威客</strong></span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">威客的形式其实在模具行业早就存在了，模具设计工程师在任职期间利用闲暇时间，通过熟人介绍，以个人名义承接少量的设计工作，赚取工资以外的收入，我们俗称为“私活”；个人工作室也是普遍存在的。</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">由于模具是技术密集型的产品，对于设计的要求非常高，所以目前的“私活”的买卖方双方都是相互比较熟悉的，即买方非常熟悉工程师的能力，如果买方不熟悉或不清楚工程师实际能力的情况，买方是不会轻易的将设计任务委托给该名工程师的；但有些时候，由于资源有限又迫于项目时间的压力，仓促发包的情况也是存在的。而对于工程师来说，鉴于各种原因，目前的情况是，有足够能力的工程师缺少展示自己或者与买方的沟通渠道，而且工程师对于买方也会存在一些疑虑，比如是否能够如期的收到钱是普遍关心的问题之一。</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>“拣豆网”--您身边的模具设计专家</strong><br/><br/></span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">鉴于目前存在的上述的信息不对称的情况，拣豆网为有能力、有梦想的工程师提供一个可以展示自己能力的平台，同时不必担心隐私外露而影响目前的工作，为买方提供更多的优质工程师资源，响应更加及时、充分。</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">为保证双方的权益，拣豆网将会对买卖双方进行实名认证，并对工程师的技术能力进行初步的评估，对于虚报个人能力者，拣豆网将拒绝其注册认证；为了使工程师更安心积极的开展工作，买方需要将相应的费用委托到拣豆网进行托管，当工程师完成任务并得到买方认可后，拣豆网将根据付款指令付款给工程师，确保买方的资金安全和工程师的利益不受损害。</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">拣豆网的经营团队在总结10多年模具行业从业经验的基础上，将图纸设计的进度管理和质量管理纳入到拣豆网中，目的是确保准时、准确的为买方提供服务。</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><br/></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">拣豆网希望成为您身边的模具设计专家，同时也为工程师提供一个更广阔的展示空间。</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"white-space: normal; line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">更多资讯请访问拣豆网官方网站：www.jeendon.com</span></p>','15','2','0','','1487128680','1488075872','1487128822','96');
INSERT INTO `dp_news` (`news_id`,`news_name`,`news_title`,`news_pic`,`news_content`,`news_column`,`news_department_audit`,`news_add_user`,`news_review_user`,`news_addtime`,`news_updatetime`,`news_reviewtime`,`news_eye`) VALUES
('97','2017年1月销量Top10车企榜单出炉 上汽大众卫冕！','2017年1月销量Top10车企榜单出炉 上汽大众卫冕！','/attachement/image/admin/2017/02/15/f/1/5/9/58a3ca0b91433.jpg','<p style=\"line-height: 1.75em;\"><span style=\"line-height: 1.75em; color: rgb(0, 0, 0);\">此前，许多业界专家已预测过2017年首月汽车市场不容乐观，购置税优惠政策的改变、春节假期以及2016年透支销量等因素而影响汽车的销量。</span><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">中国汽车流通协会2月6日发布的汽车经销商库存预警指数报告，显示2017年1月库存预警指数为61.5%，比上月上升18.6个百分点，库存预警指数位于警戒线以上。汽车市场经历了“黑色一月份”之后，至此，各厂家都有着怎样的表现呢？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">今天（2017年2月9日），全国乘联会（CPCA）发布2017年1月乘用车市场分析报告，报告指出17年1月的批发数达217万辆，同比负增长-0.8%，环比下降16.7%。狭义车零售207万辆，同比去年1月下滑9.3%，环比下降23.5%。这也印证此前的说法，同时，这也是时隔11个月之后，自2016年2月份以来的首次销量同比下滑。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">同时，该报告也公布了2017年1月份狭义乘用车生厂商销量排行榜前十名：「 第1名：上汽大众 213,706辆；第2名：一汽大众 198,079辆；第3名：上汽通用 179,775辆；第4名：上通五菱 137,579辆；第5名：长安汽车 123,823辆；第6名：吉利汽车 102,706辆；第7名：东风日产 92,939辆；第8名：长城汽车 82,058辆；第9名：北京现代 800,17辆；第10名：长安福特 696,04辆。」</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第一名：上汽大众</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">根据数据显示，上汽大众2017首月乘用车批发数为213,706辆，卫冕国内乘用车市场销量冠军。这也不奇怪，上汽大众在2016全年销量业绩当中唯一实现破200万辆的车企。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1月份销量中，大众品牌销售17.9万辆，“中国特供车”朗逸单月销售破5万辆，加之产品布局不断完善，途观L、辉昂等车型的投入，还有将要上市的中大型SUV辉昂，上汽大众销量将会有所改变。其中斯柯达品牌1月销售34,809辆，同比增长13.2%。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第二名：一汽大众</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">一汽大众1月份乘用车批发数为198,079辆。一汽大众在2016全年销售190.4万辆，今年则制定目标为200万辆，如今仅1月就完成近20万辆的成绩。按照这样的态势，是否能成为国内第二家突破200万辆的车企呢？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1月销量中，大众品牌共销售新车14.7万辆，奥迪品牌则贡献了5.1万辆。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第三名：上汽通用</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">上汽通用1月份乘用车批发数交出179,775辆的成绩，较16年12月份则减少了32514辆。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">旗下凯迪拉克品牌逆势而上，产品线日趋完善，争先抢占豪华车市场份额。目前，凯迪拉克已经在规划推出一款小型和紧凑型SUV，预计比XT5更大的中大型SUV XT7也将在今年发布。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">雪佛兰的销量暂时还不得而知，但是该品牌2016年的销量来看，市场不断在萎缩，预计1月销量为下滑趋势。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第四名：上汽通用五菱</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">上汽通用五菱较12月份排名下降了一位，1月份乘用车批发数据为137,579辆，销量有所下滑。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">据统计，除了新车型外，每款车型都有不同程度的下滑。主力销量车型五菱宏光系列下滑16%，并且宝骏560和730分别同比下滑48%和25%。销量业绩的持续下滑对于企业的影响较大，希望五菱能在后找到市场的突破点，减缓销量下滑带来的影响。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第五名：长安汽车</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">长安汽车1月份乘用车批发销量为123,823辆。长安汽车保持稳定增速，1月同比增长10.5%。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第六名：吉利汽车</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">吉利汽车1月份批发数为102,706辆。吉利连续3个月月销超10万，1月销量同比增长71%，吉利在2017年定下的目标为100万辆，仅1月份就完成全年目标的10%。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">吉利在轿车和SUV市场上持续发力，1月份七款主销车型中六款销量过万，博瑞车型销售4042辆，同比下降33%。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第七名：东风日产</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">东风日产1月份批发销量为92,939辆。销量保持增长的势头，其中2016年占据轿车销量排行榜第二名的轩逸车型占比达34.4%。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第八名：长城汽车</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">长城汽车1月批发数为82,058辆，被吉利超越，位居自主品牌第三的位置。其中SUV车型销量为81533辆，与去年同期相比增长9.9%。2017年长城汽车定下125万辆的销售目标，仅1月销量数据来看，有点悬。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第九名：北京现代</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">北京现代1月份批发数为80,017辆，下滑幅度较大，由去年12月第四名的位置跌至第九名。其中，朗动、全新途胜、名图和领动销量过万。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第十名：长安福特</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">长安福特汽车1月份批发数为69,604辆，长安福特排名也较12月下降一个名次。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><br/></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">来源：汽车行业关注</span></p><p><br/></p>','16','2','0','','1487128920','1487130830','1487130207','69');
INSERT INTO `dp_news` (`news_id`,`news_name`,`news_title`,`news_pic`,`news_content`,`news_column`,`news_department_audit`,`news_add_user`,`news_review_user`,`news_addtime`,`news_updatetime`,`news_reviewtime`,`news_eye`) VALUES
('98','冲压模具五大问题及其解决方案','冲压模具五大问题及其解决方案','/attachement/image/admin/2017/02/15/6/6/5/e/58a3ca47aa883.jpg','<p style=\"line-height: 1.75em;\"><span style=\"line-height: 1.75em; color: rgb(0, 0, 0);\">冲床就是一台冲压式压力机。在国民生产中，冲压工艺由于比较传统机械加工来说有节约材料和能源，效率高，对操作者技术要求不高及通过各种模具应用可以做出机械加工所无法达到的产品这些优点，因而它的用途越来越广泛。</span><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">一、凸模磨损太快 主要原因</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、模具间隙偏小，一般建汉模具总间隙为材料板厚的20%，25%。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、凸凹模具的对中性不好，包括模座和模具导向组件及转塔镶套精度不足等原因造成模具对巾件不好。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3、凸模温度过高，主要是由于同一模具连续长时间冲压造成冲头过热。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">4、模具刃磨方法不当，造成模具退火，磨损加剧。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">5、局部的单边冲切，如步冲、冲角或剪切时，铝合金门窗配件侧向力会使冲头偏向一边，该边的间隙减小，造成模具磨损严重，如果机床模具安装精度不高，严重的会使冲头偏过上模，造成凸模和凹模损坏。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">二、模具带料问题</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">模具带料会造成废料反弹，其相关因素：</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、模具刃口的锋利程度，刃几的圆角越大，越容易造成废料反弹。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、模具的入模量，机床每个上位的入模量是一定的，模具人模量小，容易造成废料反弹。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3、模具的间隙是台合理，如果模具间隙不合适，容易造成废料反弹。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">4、被加工板材表而是否存在较多的油物。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">5、弹簧疲劳损坏。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">防止模具带料的方法：</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、使用专用的防带料凹模。铝合金门窗配件</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、模具经常刃磨保持锋利，并退磁处理。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3、增大凹模间隙。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">4、采用斜刃n模具代替平刃口模具。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">5、模具安装退料器。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">6、合理增大模具的入模量。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">7、检查模具弹簧或卸料套的疲劳强度。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">三、模具对中性问题</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">模具在使用巾容易发生冲芯各侧位置的磨损量不同，有的部分有较大划痕，磨损较快，这种情况在细窄的长方模具上特别明显。该问题主要原因：</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、机床转塔设计或加工精度不足．主要是上下转盘昀模具安装座的对中性不好。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、模具的设计或加上精度不能满足要求。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3、模具凸模的导套精度不够。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">4、模具间隙选择不合适。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">5、模具安装座或模具导套由于长期使用磨损造成对中性不好。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">为防止模具磨损不一致，应：</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、定期采用对中芯棒对机床转塔和安装座进行对中性检查调整。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、及时更换模具导套并选用合适间隙的凸凹模具。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3、采用全导程模具。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">4、加强操作人员的责任心，发现后及时查找原因，避免造成更大损失。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">四、特殊成形模具使用</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">为满足生产需要，经常需要使用成形模具或特殊模具，主要有桥形模具、百叶窗模具、沉孔形模具、翻孔攻螺纹模具、凸台模具、拉伸模具、组合式模具等，使用特殊或成形模具町以人人提高生产效率，但足成形模具价格较高，通常是普通模具的4-5倍。为避免失误，应注意和遵循以下原则：</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、模具安装时进行方向检查，确保模具凸凹模安装方向一致。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、根据要求正确调整模具的冲压深度，每次调整最好不超过0.15mm。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3、使用较低的冲切速度。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">4、板材要平整无变形或翘起。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">5、成形加工俯置应尽最远离夹钳。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">6、成形模具使用时应避免向下成形操作：</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">7、冲压时按照先普通模具冲压，最后使用成形模具。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">五、模具弹簧疲劳损坏</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">冲床模具使用中容易忽视的一个问题，铝合金门窗配件就足模具弹簧的使用寿命，模具弹簧也需要定期进行保养或更换，但是国内许多用户对设备和模具能进行保养，却往往忽视了模具弹簧的保养，甚至有的用户弹簧多年就没有更换过，同工位或模具经常出现损坏或冲压带料，却无法查找到原因，后来更换模具弹簧后，问题得到彻底解决。对于不同的冲床设备和模具，其模具弹簧类型也有所不同。如果保养不当，容易产生模具带料并可能损坏模具或导套，造成不必要的损失。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">来源：模具论坛</span></p><p><br/></p>','16','2','0','','1487129100','1487130802','1487130206','54');
