style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">40 REF 尺寸为40,参考值</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">2.5&quot; BSP 2.5” 圆锥管螺纹</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">2.5&quot; BSPT HEXAGON 2.5” 六角圆锥管螺纹(即对丝)</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">30x2.5 FLAT BAR 30X2.5 扁钢</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">TYP 2 POSNS 2处</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">11 TOTAL COILS APROX.9 WORKING COILS APROX.RIGHT HAND WOUND ONLY,END COILS SQUARE TO TOUCH.</span></p><p><span style=\"color: rgb(0, 0, 0);\">总圈数约11圈；工作圈数约9圈；右旋；弹簧的端部磨平以便于接触.(此为弹簧技术说明)</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">FEMALE: 内扣(母扣)</span></p><p><span style=\"color: rgb(0, 0, 0);\">MALE: 外扣(公扣)</span></p><p><span style=\"color: rgb(0, 0, 0);\">偏心轴 eccentric shaft</span></p><p><span style=\"color: rgb(0, 0, 0);\">销轴 PIN</span></p><p><span style=\"color: rgb(0, 0, 0);\">开口销 COTTER PIN</span></p><p><span style=\"color: rgb(0, 0, 0);\">螺杆 screw</span></p><p><span style=\"color: rgb(0, 0, 0);\">紧定螺钉 SET SCREW</span></p><p><span style=\"color: rgb(0, 0, 0);\">圆螺母 ROUND NUT</span></p><p><span style=\"color: rgb(0, 0, 0);\">内六角螺钉 SOCKET HEAD CAP SCREW</span></p><p><span style=\"color: rgb(0, 0, 0);\">六角螺钉 HEX HD SETSCREW</span></p><p><span style=\"color: rgb(0, 0, 0);\">六角螺栓 HEX HD BOLT</span></p><p><span style=\"color: rgb(0, 0, 0);\">挡圈 closing ring</span></p><p><span style=\"color: rgb(0, 0, 0);\">弹性挡圈 circlip</span></p><p><span style=\"color: rgb(0, 0, 0);\">轴承隔套 distance sleeve of axletree</span></p><p><span style=\"color: rgb(0, 0, 0);\">轴承 axletree</span></p><p><span style=\"color: rgb(0, 0, 0);\">深沟球轴承 DEEP GROOVE BALL BEARING</span></p><p><span style=\"color: rgb(0, 0, 0);\">无扣长 non-buckle longth</span></p><p><span style=\"color: rgb(0, 0, 0);\">弹簧 SPRING</span></p><p><span style=\"color: rgb(0, 0, 0);\">吊环螺钉 LIFTING EYE BOLT</span></p><p><span style=\"color: rgb(0, 0, 0);\">开槽盘头螺钉 SLOTTED PAN HEAD SCREW</span></p><p><span style=\"color: rgb(0, 0, 0);\">圆锥滚子轴承 TAPERED ROLLER BEARING</span></p><p><span style=\"color: rgb(0, 0, 0);\">推力球轴承THRUST BALL BEARING</span></p><p><span style=\"color: rgb(0, 0, 0);\">平键 FLAT KEY</span></p><p><span style=\"color: rgb(0, 0, 0);\">弹簧垫圈 SINGLE COIL SPRING WASHER</span></p><p><span style=\"color: rgb(0, 0, 0);\">平垫圈 FLAT WASHER</span></p><p><span style=\"color: rgb(0, 0, 0);\">螺母 FULL NYLOCK NUT</span></p><p><span style=\"color: rgb(0, 0, 0);\">圆螺母 ROUND NUT</span></p><p><span style=\"color: rgb(0, 0, 0);\">REMOVE ALL BURRS AND SHARP EDGES 所有尖角/棱角倒角并去毛刺</span></p><p><span style=\"color: rgb(0, 0, 0);\">40 REF 为测量的参考尺寸</span></p><p><span style=\"color: rgb(0, 0, 0);\">OD 1/4’ outside dimension 1/4&quot;的缩写 外径直1/4’-------&gt;应该为：外径值1/4&quot;</span></p><p><span style=\"color: rgb(0, 0, 0);\">75 CRS 尺75 材质为冷轧钢板 -------&gt;应该为：尺寸75 材质为冷轧钢板</span></p><p><span style=\"color: rgb(0, 0, 0);\">ACCESS Accessory 附件<br/></span></p><p><span style=\"color: rgb(0, 0, 0);\">ADJ Adjustable,Adjust 调整</span></p><p><span style=\"color: rgb(0, 0, 0);\">ADPT Adapter 使适应</span></p><p><span style=\"color: rgb(0, 0, 0);\">ADV Advance 提前</span></p><p><span style=\"color: rgb(0, 0, 0);\">AL Aluminum 铝</span></p><p><span style=\"color: rgb(0, 0, 0);\">ALLOW Allowance 允许</span></p><p><span style=\"color: rgb(0, 0, 0);\">LT Alternate 改变</span></p><p><span style=\"color: rgb(0, 0, 0);\">ALY Alloy 合金<br/></span></p><p><span style=\"color: rgb(0, 0, 0);\">AMT Amout 数量</span></p><p><span style=\"color: rgb(0, 0, 0);\">ANL Anneal 锻炼</span></p><p><span style=\"color: rgb(0, 0, 0);\">ANSL Amer Natl Stds Institute</span></p><p><span style=\"color: rgb(0, 0, 0);\">APPROX Approximate 大约 ASME Amer Society of Mech Engrs</span></p><p><span style=\"color: rgb(0, 0, 0);\">ASSEM Assemble 装配</span></p><p><span style=\"color: rgb(0, 0, 0);\">ASSY Assembly 装配</span></p><p><span style=\"color: rgb(0, 0, 0);\">AUTH Authorized 授权的</span></p><p><span style=\"color: rgb(0, 0, 0);\">AUTO Automatic 自动的</span></p><p><span style=\"color: rgb(0, 0, 0);\">AUX Auxiliary 辅助的</span></p><p><span style=\"color: rgb(0, 0, 0);\">AVG Average 平均</span></p><p><span style=\"color: rgb(0, 0, 0);\">AWG American Wire Gauge</span></p><p><span style=\"color: rgb(0, 0, 0);\">BC Bolt Circle 螺栓圆周</span></p><p><span style=\"color: rgb(0, 0, 0);\">BET Between 之间</span></p><p><span style=\"color: rgb(0, 0, 0);\">BEV Bevel 斜角</span></p><p><span style=\"color: rgb(0, 0, 0);\">BHN Brinell Hardness Number 布氏硬度值</span></p><p><span style=\"color: rgb(0, 0, 0);\">BLK Blank ,Block 空白</span></p><p><span style=\"color: rgb(0, 0, 0);\">B/NM Bill of Material 材料费</span></p><p><span style=\"color: rgb(0, 0, 0);\">BOT Bottom 底部</span></p><p><span style=\"color: rgb(0, 0, 0);\">BP or B/P Blueprint 蓝图</span></p><p><span style=\"color: rgb(0, 0, 0);\">BRG Bearing 轴承</span></p><p><span style=\"color: rgb(0, 0, 0);\">BRK Break 破裂</span></p><p><span style=\"color: rgb(0, 0, 0);\">BRKT Bracket 支架</span></p><p><span style=\"color: rgb(0, 0, 0);\">BRO Broach 钻孔</span></p><p><span style=\"color: rgb(0, 0, 0);\">BRS Brass 黄铜</span></p><p><span style=\"color: rgb(0, 0, 0);\">BRZ Bronze 青铜</span></p><p><span style=\"color: rgb(0, 0, 0);\">B＆S Brown＆Shape 棕色＆形状</span></p><p><span style=\"color: rgb(0, 0, 0);\">BSC Basic 基本的</span></p><p><span style=\"color: rgb(0, 0, 0);\">BUSH Bushing 套管</span></p><p><span style=\"color: rgb(0, 0, 0);\">BWG Birmingham Wire Gauge</span></p><p><span style=\"color: rgb(0, 0, 0);\">CTO&nbsp; C Center-to-Center 中心到中心</span></p><p><span style=\"color: rgb(0, 0, 0);\">CAD&nbsp; Computer Aided Design 电脑辅助设计</span></p><p><span style=\"color: rgb(0, 0, 0);\">CAM Computer-Aided Mfg</span></p><p><span style=\"color: rgb(0, 0, 0);\">CAP Capacity 容量</span></p><p><span style=\"color: rgb(0, 0, 0);\">CAP SCR Cap Screw 螺帽</span></p><p><span style=\"color: rgb(0, 0, 0);\">CARB Carburize 使渗碳</span></p><p><span style=\"color: rgb(0, 0, 0);\">CBORE Counterbore 扩孔</span></p><p><span style=\"color: rgb(0, 0, 0);\">CCW Counter Clockwise 逆时针</span></p><p><span style=\"color: rgb(0, 0, 0);\">CDRILL Counerdrill CDS Cold-Drawn Steel</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><strong><span style=\"color: rgb(0, 0, 0);\">看英文图纸的一些资料</span></strong></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">英文工程图纸的右下边是标题栏（相当于我们的标题栏和部分技术要求），其中有图纸名称（TILE）设计者（DRAWN）审查者（CHECKED）材料（MATERIAL）日期（DATE）比例（SCALE）热处理（HEAT TREATMENT）和其它一些要求，如：</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">1)TOLERANCES UNLESS OTHERWISE SPECIFIAL 未注公差</span></p><p><span style=\"color: rgb(0, 0, 0);\">2)DIMS IN mm UNLESS STATED 如不做特殊要求以毫米为单位</span></p><p><span style=\"color: rgb(0, 0, 0);\">3)ANGULAR TOLERANCE±1° 角度公差±1°</span></p><p><span style=\"color: rgb(0, 0, 0);\">4)DIMS TOLERANCE±0.1 未注尺寸公差±0.1</span></p><p><span style=\"color: rgb(0, 0, 0);\">5)SURFACE FINISH 3.2 UNLESS STATED 未注粗糙度3.2</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><strong><span style=\"color: rgb(0, 0, 0);\">常见尺寸的标注及要求</span></strong></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">2.1孔（HOLE）如：</span></p><p><span style=\"color: rgb(0, 0, 0);\">（1）毛坯孔：3&quot;DIA+1CORE 芯子 3&quot;0+1;</span></p><p><span style=\"color: rgb(0, 0, 0);\">（2）加工孔：1&quot;DIA1&quot;;</span></p><p><span style=\"color: rgb(0, 0, 0);\">（3）锪孔：锪孔(注C＇BORE=COUNTER BORE锪底面孔);</span></p><p><span style=\"color: rgb(0, 0, 0);\">（4）铰孔：1&quot;/4 DIA REAM铰孔1&quot;/4;</span></p><p><span style=\"color: rgb(0, 0, 0);\">（5）螺纹孔的标注一般要表示出螺纹的直径，每英寸牙数（螺矩）螺纹种类精度等级钻深攻深，方向等</span></p><p><span style=\"color: rgb(0, 0, 0);\">如：&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">例1.6 HOLES EQUI-SPACED ON 5&quot;DIA (6孔均布在5&quot;圆周上（EQUI-SPACED=EQUALLY SPACED均布） DRILL 1&quot;DIA THRO＇ 钻1&quot;通孔（THRO＇=THROUGH通） C/SINK22×6DEEP 沉孔22×6</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">例2.TAP 7&quot;/8-14 UNF-3B THRO＇攻统一标准细牙螺纹，每英寸14牙，精度等级3B级</span></p><p><span style=\"color: rgb(0, 0, 0);\">（注UNF=UNIFIED FINE THREAD美国标准细牙螺纹）</span></p><p><span style=\"color: rgb(0, 0, 0);\">1&quot;DRILL 1&quot;/4-20 UNC-3 THD7&quot;/8 DEEP 4HOLES NOT BREAK THRO 钻1&quot;孔，攻1&quot;/4美国粗牙螺纹，每英寸20牙，攻深7&quot;/8,4孔不准钻通（UNC=UCIFIED COARSE THREAD 美国标准粗牙螺纹）</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">1&quot;-14NS-2THRO 攻美国固定特种螺纹M1&quot;,每英寸牙数14,精度等级为二级 （注NS=NATIONAL SPECIAL THREAD:美国固定特种标准）</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">2.2倒角（CHAMFER）</span></p><p><span style=\"color: rgb(0, 0, 0);\">例1/8×45°BEV 倒角1/8×45°（注BEV=BEVEI，斜面）</span></p><p><span style=\"color: rgb(0, 0, 0);\">1.5×45°CHAM 倒角1.5×45°(注CHAM=CHAMFER倒角)</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">2.3方(SQUARE)</span></p><p><span style=\"color: rgb(0, 0, 0);\">例5&quot;SQUARE5&quot;×5&quot;方</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">2.4剖视（SECTION）</span></p><p><span style=\"color: rgb(0, 0, 0);\">例SECTION A-AA-A剖面</span></p><p><span style=\"color: rgb(0, 0, 0);\">2.5圆角半径</span></p><p><span style=\"color: rgb(0, 0, 0);\">例1&quot;RR1&quot;</span></p><p><span style=\"color: rgb(0, 0, 0);\">RADIUS MUST BE SMOOTH AND BLEND INTO FACE</span></p><p><span style=\"color: rgb(0, 0, 0);\">圆弧必须光滑且与平面相切</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">2.6加工余量</span></p><p><span style=\"color: rgb(0, 0, 0);\">例DOTTED LINES INDICATED MAX FINISH 1&quot;/8，虚线表示最大加工余量1&quot;/8</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">2.7零件标记例</span></p><p><span style=\"color: rgb(0, 0, 0);\">USE 5&quot;/16 RAISED HAIRLINE LET-TERS MARKING ON ONE SIDE OF BODY用突起高为5&quot;/16的细实线字母在本体一侧打标记</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">关于铸锻件的技术要求</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">例1.FORGING MUST BE ANNEALED TO BE BELOW 203 BRINELL HARDNESS 锻件必须退火处理，布氏硬度&lt;203</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">例2.NORMALIZE TO 163-207BHNMUST BE FREE OF SCALE &amp; RUST锻件正火处理，布氏硬度163-207,锻件表面不得有氧化皮和锈蚀</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">例3.FORGING TO BE SHOT OR SAND BLASTED锻件需经喷丸或喷砂处理</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">例4.UNLESS OTHERWISE SPECIFIED DRAFT ANGLES 7°未注明锻造拔模斜度7°</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">例5.CAST TO BE FREE OF EXCESSIVE FLASH 铸件不得有过多的毛边</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">例6.DRAFT ANGLE 2° UNLESS OTHER-WISE SPECIFIED 未注明铸造拔模斜度2°</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">总之，看英文机械工程图纸并不是高不可攀，只要坚持常看，熟记部分单词即可。</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">来源：模具人杂志</span></p>','16','2','1','','1487129220','','1487130204','85');
INSERT INTO `dp_news` (`news_id`,`news_name`,`news_title`,`news_pic`,`news_content`,`news_column`,`news_department_audit`,`news_add_user`,`news_review_user`,`news_addtime`,`news_updatetime`,`news_reviewtime`,`news_eye`) VALUES
('100','粗糙度为什么是0.8、1.6、3.2、6.3、12.5微米？','粗糙度为什么是0.8、1.6、3.2、6.3、12.5微米？','/attachement/image/admin/2017/02/15/2/9/a/2/58a3cb60384ed.jpg','<p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><strong><span style=\"line-height: 1.75em;\">前言</span></strong></span><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">你可知道粗糙度为什么是0.8、1.6、3.2、6.3、12.5微米吗?</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">你可知道粗糙度为什么是0.8, 1.6, 3.2, 6.3, 12.5?</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">你可知道油缸缸径为什么是63, 80, 100, 125?</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">你可知道油缸压力为什么是6.3, 16, 25, 31.5?</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">你可知道螺纹规格为什么是6, 8, 10, 12, 14, 16?</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">你可知道机械设计手册上无数的表格，所有产品样本上的参数表，都是怎么来的?</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">一切都来源于伟大的优先数系。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">法国工程师雷诺看到热气球上的钢丝绳规格繁多，他就想了一个办法，将10开5次方，得到一个数1.6，然后辗转相乘，得出5个优先数如下:</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1.0、1.6、2.5、4.0、6.3。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">这是一个等比数列，后数为前数的1.6倍，那么10以下的钢丝绳一下子只有5种，10到100的钢丝绳也只有5种，即10, 16, 25, 40, 63。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">但是这样分法太稀疏，雷先生就再接再厉，将10开10次方，得出R10优先数系如下：1.0、1.25、1.6、2.0、2.5、3.15、4.0、5.0、6.3、8.0。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">公比为1.25，于是10以内的钢丝绳只有10种，10到100的也只有10种，这就比较合理了。这时肯定有人说，这个数列，前面的数字好像相差不大。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">如1.0和1.25，简直没差别嘛，平常我就四舍五入了，但6.3和8.0间隔就大了，这样合理吗？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">合理不合理，我们打个比方。比如说自然数1、2、3、4、5、6、7、8、9，看起来很顺溜，我们用这个数列来发工资，给张三发1000，给李四发2000，两人皆心服。突然通货膨胀，给张三发8000，给李四发9000。以前李四工资是张三的2倍，现在变成1.12倍。你说李四能愿意吗？他可是主管哪，给他发16000还差不多，张三是不会埋怨说主管比他多8000的。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">这个自然界的事物，有两种比较方法，就是“相对”与“绝对”！优先数系是相对的。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">有人说他的产品规格有10吨，20吨，30吨，40吨的，现在看来就不合理了吧？如果你取两倍的话，应该是10吨，20吨，40吨，80吨，或者保住头尾，也应该是10吨，16吨，25吨，40吨，公比为1.6才合理。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">这就是“标准化”，论坛上常常看到有人说“标准化”，实际他们说的是“标准件”，所做的工作只是将整机的标准件整理一下，就叫标准化了，实际不是这样的。真正的标准化，你要把你的产品的所有参数按优先数系形成序列化，再把所有的零部件的功能参数及尺寸，用优先数系来序列化才对。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">自然数是无穷的，但在机械设计师眼里，世界上只有10个数，它就是R10优先数。并且，这10个数相乘，相除，乘方，开方，结果还在这10个数里，何其奇妙！当你设计的时候，不知道尺寸该选择多大为好时，就在这10个数里选，你说何其方便！</span></p><p style=\"line-height: 1.75em;\"><img src=\"/attachement/image/admin/2017/02/15/5/3/e/e/58a3cbebdf3c5.jpg\" width=\"100%\" alt=\"5/3/e/e/58a3cbebdf3c5.jpg\"/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">两个优先数，比如4和2，其序号分别为N24和N12，它们相乘，将其序号相加，其结果等于N36即8便是；</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">相除，序号相减，等于N12即2便是；</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2的立方，将其序号N12乘以3得N36即8便是；</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">4的开方，将其序号N24除以2得N12即2便是如果求2的四次方呢？N12*4=N48，这里没有，怎么办？上面的列表，没有写上一个数，就是10，它的序号是N40，凡是序号大于40的，只看大于40的部分，比如N48就看N8，即1.6，然后乘以10得16就对了。如果序号是N88呢，看N8得1.6，然后乘以100得160便是，因为100的序号是N80,1000的序号是N120，依此类推，做机械设计，一辈子用这20个数就足矣。但有时需用到R40数系，有40个数，就更完善了，若不够，还有R80系。我已将R40数系倒背如流，应付一般计算根本不用计算器。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">简单来说算40径的45钢的抗扭能力，其扭转系数是0.5*π*R^3，扭应力选屈服点360的一半即180MPa，圆周率选3.15，左右手捏小数点，心算加减序号，一会就出来。有人说你不加安全系数吗？说吧，是取1.25，还是1.5，还是2啊？呵呵。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">黄金分割0.618，也即1.618，这里也有1.6。平方根数列，就是根号1，根号2，根号3，很容易求出吧？（3的序号是N19）</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">π的平方等于多少？等于10。你算压杆稳定的时候就方便了吧？圆杆扭转系数约为0.1*D^3，现在你可以口算扭转系数了吧？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">为什么大螺丝从M36直接跳到M40？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">为什么齿轮的传动比有个6.3或者7.1？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">为什么槽钢有个市场上很少见的12.6号？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">为什么外协厂打电话来说140的方管没有，而有120和160的？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">因为R5数系比R20数系优先。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">为什么标准件的参数有个第一序列，第二序列？一般来说第一序列就是R5序列。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0); line-height: 1.75em;\">为什么Inventor的螺孔列表有个M11.2？现在你知道它不是胡诌出来的数吧？</span><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">还有钢板厚度，型钢型号，齿轮模数，一切标准件，一切工业品样本上的功能参数，尺寸参数，标准公差表，等等等等，它们的来源，此刻在我们的心中慢慢清晰起来。可以说，我们已经理解了半部机械设计手册，以及那些还没做出来的工业品。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">那么，我们在设计产品的时候，就可以同时设计出一系列了，而不是设计完之后再进行所谓的“标准化”；更进一步，如果产品注定要序列化，那么我们甚至可以在对实际工况不甚了解的情况下设计产品，因为优先数系已将所有型号包括其中了。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">优先数系的应用，上面列出的，可谓沧海一粟，无尽的应用等着我们自己去开发。背诵优先数系吧，这可是一劳永逸的活儿。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">来源：模具论坛</span></p>','16','2','0','','1487129340','1487130765','1487130202','67');
INSERT INTO `dp_news` (`news_id`,`news_name`,`news_title`,`news_pic`,`news_content`,`news_column`,`news_department_audit`,`news_add_user`,`news_review_user`,`news_addtime`,`news_updatetime`,`news_reviewtime`,`news_eye`) VALUES
('101','汽车变速器-壳体、轴、齿轮，加工工艺大全','汽车变速器-壳体、轴、齿轮，加工工艺大全','/attachement/image/admin/2017/02/15/8/6/9/9/58a3cc2c07335.jpg','<p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: 宋体;\">目前，多数汽车变速器搭载的是手动变速器，匹配发动机排量为</span>0.8<span style=\"font-family: 宋体;\">～</span>1.8L<span style=\"font-family: 宋体;\">，搭载于经济型轿车上。随着近年的发展，逐步往自动变速器发展。变速器主要涉及核心零件轴及齿轮、壳体的生产、总成装配、试验检测等过程在公司内进行。</span><br/></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">01 <span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">齿轮、轴类零件</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1. <span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">齿轮加工工艺流程</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"font-family: 宋体; color: rgb(0, 0, 0);\">根据不同结构要求，齿轮零件加工主要工艺流程采用的是锻造制坯→正火→精车加工→插齿→倒尖角→滚齿→剃齿→（焊接）→热处理→磨加工→对啮修整。</span></p><p style=\"line-height: 1.75em;\"><span style=\"font-family: 宋体; color: rgb(0, 0, 0);\">热后齿部一般不再加工，除了主减从齿或顾客要求磨齿的零件。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2. <span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">轴类工艺流程</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"font-family: 宋体; color: rgb(0, 0, 0);\">输入轴：锻造制坯→正火→精车加工→搓齿→钻孔→插齿→倒尖角→滚齿→剃齿→热处理→磨加工→对啮修整。</span></p><p style=\"line-height: 1.75em;\"><span style=\"font-family: 宋体; color: rgb(0, 0, 0);\">输出轴：锻造制坯→正火→精车加工→搓齿滚齿→剃齿→热处理→磨加工→对啮修整。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3. <span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">具体工艺流程</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">（</span>1<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">）锻造制坯</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"font-family: 宋体; color: rgb(0, 0, 0);\">热模锻是汽车齿轮件广泛使用的毛坯锻造工艺。以前较广泛采用的是热锻和冷挤压的毛坯，近年来，楔横轧技术在轴类加工上得到了大量推广。这项技术特别适合为比较复杂的阶梯轴类制坯，它不仅精度较高、后序加工余量小而且生产效率高。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">（</span>2<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">）正火</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"font-family: 宋体; color: rgb(0, 0, 0);\">这一工艺的目的是获得适合后序齿轮切削加工的硬度和为最终热处理做组织准备，以有效地减少热处理变形。一般的正火由于受人员、设备和环境的影响比较大，使得工件冷却速度和冷却的均匀性难以控制，造成硬度散差大，金相组织不均匀，直接影响机加工和最终热处理；使得热变形大而无规律，零件质量无法控制，对刀具的磨损也较大，尤其对搓齿这种受力大的工序更是明显。为此，采用等温正火工艺。实践证明，采用这种等温正火有效地改变了一般正火的弊端，产品质量稳定可靠。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">（</span>3<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">）精车加工</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">为了满足高精度齿轮加工的定位要求</span>.<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">齿坯的精车加工全部采用数控车床</span>.<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">齿轮先进行内孔和定位端面的加工，然后另一端面及外径加工同步完成。既保证了内孔与定位端面的垂直度要求，又保证了大批量齿坯生产的尺寸离散小。从而提高了齿坯精度，确保了后序齿轮的加工质量。另外，数控车床加工的高效率还大大减少了设备数量，经济性好。</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"font-family: 宋体; color: rgb(0, 0, 0);\">轴类零件加工的定位基准和装夹主要有以下三种方式：</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1.<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">）以工件的中心孔定位：在轴的加工中，零件各外圆表面、端面的同轴度，端面对旋转轴线的垂直度是其相互位置精度的主要项目，这些表面的设计基准一般都是轴的中心线，若用两中心孔定位，符合基准重合的原则。</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"font-family: 宋体; color: rgb(0, 0, 0);\">中心孔不仅是车削时的定为基准，也是其他加工工序的定位基准和检验基准，又符合基准统一原则。当采用两中心孔定位时，还能够最大限度地在一次装夹中加工出多个外圆和端面。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">）以外圆和中心孔作为定位基准（一夹一顶）：用两中心孔定位虽然定心精度高，但刚性差，尤其是加工较重的工件时不够稳固，切削用量也不能太大。粗加工时，为了提高零件的刚度，可采用轴的外圆表面和一中心孔作为定位基准来加工。这种定位方法能承受较大的切削力矩，是轴类零件最常见的一种定位方法。</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">）以两外圆表面作为定位基准：在加工空心轴的内孔时，（例如：机床上莫氏锥度的内孔加工），不能采用中心孔作为定位基准，可用轴的两外圆表面作为定位基准。当工件是机床主轴时，常以两支撑轴颈（装配基准）为定位基准，可保证锥孔相对支撑轴颈的同轴度要求，消除基准不重合而引起的误差。</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">（</span>4<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">）搓</span>/<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">滚</span>/<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">插齿</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">加工齿部所用设备仍大量采用普通滚齿机和插齿机，虽然调整维护方便，但生产效率较低，若完成较大产能需要多机同时生产。随着涂层技术的发展，滚刀、插刀刃磨后的再次涂镀可方便地进行。经过涂镀的刀具能够明显地提高耐用度，一般能提高</span>90%<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">以上，有效地减少了换刀次数和刃磨时间，效益显著。</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">对于花键的加工，为解决插齿效率低的问题，可以采用搓齿进行加工，效率大大提高，加工一档花键需要</span> 10<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">～</span>30s<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">的时间。加工的插齿设备主要有德国</span>Gleason-Pfauter<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">插齿机、南京</span>YS5120CNC<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">等，滚齿设备主要有日本</span>KASHIFUJI <span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">数控滚齿机、重庆</span>YS3118<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">五轴数控滚齿机、</span>YKX3132 <span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">数控滚齿机等，滚齿设备主要有德国</span>EXCELLO<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">搓齿机和日本</span>KASHIFUJI<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">搓齿机等。</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">（</span>5<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">）剃齿</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"font-family: 宋体; color: rgb(0, 0, 0);\">径向剃齿技术以其效率高，设计齿形、齿向的修形要求易于实现的优势被广泛应用于大批量汽车齿轮生产中。齿形、齿向对汽车的噪声影响是较大的，通过对其修形和反扭曲修正可降低变速器的传动噪声。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">（</span>6<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">）热处理</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">汽车齿轮要求渗碳淬火</span>.<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">以保证其设计要求的良好机械性能。对于热后不再进行磨齿加工的产品，稳定可靠的热处理设备是必不可缺的。</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">（</span>7<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">）磨加工</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">金属磨削的实质是工件被磨削的金属表层，在无数磨粒瞬间的挤压，摩擦作用下生产变形，而后转为磨屑，并形成光洁表示的过程。主要是对经过热处理的齿轮内孔。端面、轴的外径等部分的精加工，以提高尺寸精度和形位精度。齿轮加工采用节圆夹具定位夹紧，能有效保证齿部与安装基准的加工精度，获得满意的产品质量。磨削精度通常达到</span> IT6<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">～</span>IT7 <span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">公差等级，表面粗糙度可达</span>Ra1.25<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">～</span>0.16um<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">。主要的磨加工设备有德国</span>BUDERUS<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">、意大利</span> MORARA<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">、瑞士</span>STUDER<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">、北京数控磨床等。</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">（</span>8<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">）磨齿</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">采用磨齿加工的齿轮具有低传动噪音、高传动效率和长使用寿命的优点。现在，随着磨齿机的效率的逐渐提高，砂轮性能也更好，高额成本得以大幅下降。由此，磨齿加工已开始大规模应用于汽车齿轮加工中，而且已达到普遍应用的程度。而且由于磨齿加工能去掉热处理畸变，因此许多齿轮箱均使用磨削齿轮，以更好地控制传动空程和噪音。磨齿加工工艺在整个齿轮行业中已基本成熟并在快速增长。主要的磨齿加工设备有美国</span>Gleason-245TWG<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">、德国</span>KAPP300X <span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">等。</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">（</span>9<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">）对啮修整</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"font-family: 宋体; color: rgb(0, 0, 0);\">这是变速驱动桥齿轮装配前对齿部进行磕碰毛刺的检查清理，以消除它们在装配后引起的噪声异响。通过单对啮合听声音或在综合检查仪上观察啮合偏差来完成。也多采用的是自动对啮仪来检查毛刺、中心距、跳动。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">02</span></p><p style=\"line-height: 1.75em;\"><span style=\"font-family: 宋体; color: rgb(0, 0, 0);\">壳体类零件</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1. <span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">工艺流程</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">箱体类工件具有以下几个特点：一是加工内容多，需频繁更换机床、刀具；二是加工精度要求高，采用普通机床加工质量难以保证，且由工艺流程长，周转次数多，生产效率难以提高；三是形状复杂，且大部分为薄壁壳体，工件刚度差，较难装夹。以离合器壳体为例，一般具有轴承孔、倒档轴孔及二个大平面、定位销孔和合箱螺孔等，加工尺寸上百个，精度高的一般都在</span>IT6-IT9 <span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">级，表面粗糙度为</span>Ra0.8<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">～</span>3.2um<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">，平面度、平行度为</span> 0.05<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">～</span>0.1mm,<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">垂直度</span>0.01<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">～</span>0.02mm<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">，同轴度、位置度</span> 0.05mm <span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">等。一般工艺流程是铣结合面→加工工艺孔和连接孔→粗镗轴承孔→精镗轴承孔和定位销孔→清洗→泄漏试验检测。</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2. <span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">加工设备</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">壳体类零件的加工设备主要分为两大类：组合机床和加工中心。传统的壳体加工生产线往往由组合机床构成的，为了加工一个零件需要</span>20<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">多道工序，大量的加工设备只是为了保证有限的产品种类，这种情况适合于单一品种大批量的壳体生产。针对目前汽车市场需求的逐渐多样化和产品更新换代的特点，组合机床生产线已经不能满足要求，取而代之的将是以加工中心为主的柔性生产线。加工中心有加工精度高、加工范围广以及一次装夹能完成多面加工的特性，已被大量采用。加工中心分为立式和卧式两种。立式加工中心适宜加工内容集中在同一个方向上的零件，卧式加工中心适合加工内容在不同方向上的零件，特别是需围转加工且同轴度较高的零件，两者的加工费用基本在</span> 1<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">：</span>2 <span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">左右。</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3. <span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">控制方法</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">夹具方面：变速器壳体的加工工序以采用“立式加工中心加工。</span>10#<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">工序</span>+<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">立式式加工中心加工</span> 20#<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">工序</span>+<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">卧式加工中心加工</span> 30#<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">工序”为例，需要三套加工中心夹具，其中</span> 10#<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">采用毛坯定位和支撑，</span>20#<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">、</span>30#<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">一般采用一面两销定位。压铸铝壳体的加工余量不大，一般为</span> 0.8<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">～</span>1.2mm<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">，在夹具设计过程中首先要考虑定位的准确性，其次是夹紧的位置必须是支撑的对应位置，避免工件的夹紧变形，还要考虑刀具干涉、操作灵活、多件一夹、快速切换等因素。</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">刀具方面：在汽车零部件制造成本中，刀具成本占总成本的</span>3%<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">～</span>5%<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">，但是能够通过提高加工效率来达到影响总成本的</span>20%<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">～</span>30%<span style=\"color: rgb(0, 0, 0); font-family: 宋体;\">。模块式结构的复合刀具具有精度较高，刀柄可重复使用，库存量少等特点，被广泛采用，它可以大幅度缩短加工时间，提高劳动效率。因此，在精度要求不高、标准刀具能够达到比较好的加工效果时尽量采用标准刀具，降低库存，提高互换性。同时，对于大批量生产的零件，精度要求又高的零件采用先进的非非标复合刀具更能提高加工精度和生产效率。</span></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"font-family: 宋体; color: rgb(0, 0, 0);\">来源：模具论坛</span></p>','16','2','1','','1487129580','','1487130200','62');
INSERT INTO `dp_news` (`news_id`,`news_name`,`news_title`,`news_pic`,`news_content`,`news_column`,`news_department_audit`,`news_add_user`,`news_review_user`,`news_addtime`,`news_updatetime`,`news_reviewtime`,`news_eye`) VALUES
('102','软铝料冲压要注意哪些方面？','软铝料冲压要注意哪些方面？','/attachement/image/admin/2017/02/15/a/6/3/3/58a3cc74e811a.jpg','<p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">铝料较软，价格昂贵，容易断裂以及部分铝合金产品还需后续加工，如拉丝﹑阳极处理等，在在冲压生产时极易产生顶伤﹑压伤﹑刮伤﹑变形。<br/></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">在模具制造方面要特别注意以下几点：</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、在不影响工程数的情况下冲孔尽量排在后面。对于冲孔数量较多的产品，可考虑即使多做一个工程，也要将冲孔排在后面。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、铝料较软且模具较容易堵料，故在设计模具放间隙时宜放双边料厚10%的间隙，刀口直深位以2mm较为合适，锥度以0.8-1°为合适。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3、折弯成型时，因铝料在折弯时容易产生铝屑，会造成点伤﹑压痕，铝原材需贴PE膜，在滚轮及电镀的情况下，成型块以抛光镀硬铬为佳。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">4、对于需阳极后加工的冲压件，如有压平﹑推平工序180°，产品不可完全压合，完全压合会产生吐酸现象，需留0.2-0.3mm的缝，以便酸液顺利及时流出，故在此工序上必须做限位块并标定模高于模具上。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">5、因铝料较脆，容易开裂，特别是在反折边的情况下，故尽量不要做压线，即使要做，也要将压线做宽一点，打浅一点。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">6、所有铝件刀口都要求用慢走丝线割，以防毛刺及落料不顺现象，铝件容易产生高温，故冲子硬度要求60°以上，至少用SKD11材质以上，不可有D2等差质冲子。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">在冲压生产时要做到以下几点：</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、要想将铝件冲压做好，降低不良率，首先要做好5S，特别是清洁，含模具﹑冲床台面，流水线及包装材料必须做到无尖锐杂物，无脏物定期清晰整顿，模具上下都必须清理干净，无杂物。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、发现产品毛刺较大必须及时送模具维修并跟催至结果。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3、铝件较易发热，并积压在一起变硬，故在冲孔下料时需在材料上涂点压扳油（即可散热，又可顺利疏通落料）再冲压。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">4、冲孔较多的产品需做到打一下清理模具表面一下，做到模具﹑产品永保干净无杂物，减少顶伤，发现顶伤必须将模具顶伤问题点找出并解决才可继续生产。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">5、推平模具推块会产生铝屑，故推块每天生产完都必须清洗推块下面的铝屑。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">（1）、冲子在冲孔时极易将铝屑带入脱板内，而产生高温将冲子磨损甚至软化，故生产3-7天必须定期清洗冲子或将冲孔刀口光磨，实在不幸需及时更换。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">（2）、对于180°折弯压平产品，必须没10-30片将折边撕开PE膜观看有无破裂，因铝料在出料时会有成分不均现象，特别对于更换厂家冲压材料时需做严格首件检查。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">来源：模具论坛</span></p><p><br/></p>','16','2','1','','1487129700','','1487130198','61');
INSERT INTO `dp_news` (`news_id`,`news_name`,`news_title`,`news_pic`,`news_content`,`news_column`,`news_department_audit`,`news_add_user`,`news_review_user`,`news_addtime`,`news_updatetime`,`news_reviewtime`,`news_eye`) VALUES
('103','88条模具设计常用基本知识','88条模具设计常用基本知识','/attachement/image/admin/2017/02/15/f/f/b/2/58a3ccdb3b0a2.JPG','<p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、常用塑胶工程材料及收缩率？<br/></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">ABS:0.5%(超不碎胶)</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">pc:0.5%（防弹玻璃胶）</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">PMMa:0.5%：（有机玻璃）</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">pe:2%聚乙烯</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">PS:0.5%(聚苯乙稀)</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">pp:2%(百折软胶)</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">PA：2%（尼龙）</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">PVC：2%（聚氯乙烯）</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">POM:2%(塞钢)</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">ABS+PC：0.4%</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">PC+ABS ：0.5%</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">工程材料：&nbsp; ABS&nbsp;&nbsp; PC&nbsp; PE&nbsp; POM&nbsp;&nbsp; PMMA&nbsp; PP&nbsp; PPO&nbsp; PS&nbsp; PET </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、模具分为那几大系统？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 浇注→顶出→冷却→成型→排气 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3、在做模具设计过程中应注意哪些问题？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">（1）壁厚应尽量均匀一致，脱模斜度要足够大。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">（2）过渡部分应逐步，圆滑过渡、防止有尖角。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">（3）浇口。流道尽可能宽大，粗短，且应根据收缩冷凝过程设置浇口位置，必要时应加冷料井。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">（4）模具表面应光洁，粗糙度低（最好低0.8）</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">（5）排气孔，槽必须足够，以及时排出空气和熔体中的气体。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">（6）除PET外，壁厚不要太薄，一般不得小于1mm.</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">4、塑胶件常出现的瘕疵？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 缺胶→披风→气泡→缩水→熔接痕→黑点→条纹→翘起→分层→脱皮 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">5、常用的塑胶模具钢材？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">45#&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S50c&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 718&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 738&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 718H</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">738H&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; P20&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2316&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 8407&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; H13</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">NAK80&nbsp;&nbsp;&nbsp; NAK55&nbsp;&nbsp;&nbsp;&nbsp; S136&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; S136H&nbsp;&nbsp;&nbsp;&nbsp; SKD61 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">6、高镜面抛光用哪种纲材？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 常用高硬热处理钢材，例如：SKD61、8407、S136 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">7、模架有那些结构？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 面板→A板→B板→方铁→导柱→顶针板→顶针固定板→底板 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">8、分型面的基本形式有哪些？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp; 平直→倾斜→曲面→垂直→弧面 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">9、在UG中如何相互隐藏？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; ctrL+B或ctrL+shift+B </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">10、模具加工机械设备有哪些？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 电脑锣→车床→铣床→磨床→钻床 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">11、什么是2D，什么是3D？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; D的英文是：Dimension(线度、维)的字头，2D是指二维平面，3D是指三维空间，在模具部分，2D通常是指平面图即CAD图，3D通常指立体图。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">12、pro/e的默认精度是多少？UG默认精度是多少？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; pro/e默认精度为：0.0012MM，UG默认精度为：0.0254MM。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">13、全球模架生产四强企业？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 德国：HASCO&nbsp; 日本：FUTABA（双叶）美国：DME&nbsp; 中国：LKM（龙记） </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">14、CAD的默认字高是多少？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; CAD默认字高为是：2.5MM。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">15、什么是碰穿，什么是插穿？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 与PL面平行的公母模贴合面叫碰穿面，与PL面不平行的公母模贴合面叫插面。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">16、条和丝的关系</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 条和丝都是长度单位，条为台湾用语，1条=0.01MM，丝为香港用语，1丝=0.01MM，所以1条=1丝。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">17、 枕位是什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 外壳类塑件的边缘常开有缺口，用于安装各类配件，此处形成的枕壮分型部分称为枕位。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">18、火山口是什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; BOOS柱根部减胶部分反映在模具上的类型于火山爆发后的形状叫做模具火山口。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">19、呵指是什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 呵指的是模仁，香港习惯用语。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">20、什么是老虎口？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 老虎口又称为：管位，即用来限位的部分。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">21、什么叫排位？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 模具上的产品布局称为排位。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">22、什么叫胶位？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 模具上的产品的空穴称为：胶位。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">23、什么叫骨位？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 产品上的筋称为：骨位</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">24、什么叫柱位？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 产品上的BOSS的柱称为：柱位。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">25、什么叫虚位？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 模具上的间隙称为：虚位。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">26、什么叫扣位？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 产品上连接用的钩称为：扣位。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">27、什么叫火花纹？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 电火花加工后留下的纹称为火花纹。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">28、什么PL面？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; PL面又称：分型面、啪拉面，是指模具在闭合时前模和后模相接触的部分。 模具达人微信：mujudaren</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">29、电脑锣是什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 数控铣床和加工中心 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">30、铜工是什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 电火花通常采用易于加工的铜料做放电电极，称为铜工，也称电极，铜工一般分为：粗工、粗幼工、幼工、幼工又称精工。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">31、火花位通常是多少？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 放电过程中，铜工和钢料之间的放电间隙称为火花位，粗工火花一般在10到50条，幼工火花位一般在5到15条。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">32、料位是什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 塑胶产品的避厚，也称肉厚。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">33、原身留是什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 原身留是相对与割镶件而言，原身留是指一整块钢材为加工胚料，加工的时候一起加工出来。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">34、熔接痕是什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 两股塑胶相遇所形成的线称为熔接痕。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">35、喷流是什么?</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 塑胶从进胶口进入型腔后形成弯曲折叠似蛇的流痕称为喷流。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">36、LKM指是什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; LKM是指龙记模胚，常用的模胚有：LKM、富得巴、明利、环胜、昌辉、德胜。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">37、DME是指什么，HASCO是指什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; DME和LKM都是标准件的标准，DME是美制的，HASCO是欧制的。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">38、什么叫倒扣？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 产品中前后模无法直接脱模的部分成为倒扣。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">39、什么叫防呆？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 防呆是一种习惯用语，就是防止出现一种非常简单的错误，防止发呆！例如：一镶件在天地侧都做有相同大小的挂台，现场装配的时候很可能会把天地侧装反，但是他在镶件的一侧做挂台，这时，如果天地侧反着装就装不进去了，想装错都不可能，这种防止出现发呆而产生错误的动作成为发呆。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">40、什么叫啤机？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 啤机是地方习惯用语，也就是我们常说的注塑机，成型机。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">41、什么叫止口？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 止口就是夹口美术线，又称遮丑线。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">42、什么叫飞模？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 飞模就是配模或者标模。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">43、什么叫光刀？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; CNC精加工的动作称为光刀，也就是在开粗的基础上加工到位。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">44、什么叫开框？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 在模胚上加工放模仁的位置的动作称为开框。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">45、什么叫晒字？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 晒字就是放在菲林再那去加字体的加工字体。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">46、什么叫反呵？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 将正常情况下的前后模料位倒过来开模的方法称为反呵。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">47、什么叫浮呵？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 局部有倒扣的地方采用小镶件弹出的出模方法称为浮呵。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">48、什么叫吃前模？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 开模时，产品留在前模称为吃前模。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">49、什么叫顶白？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 顶出时所需模力较大，顶针不够力，使产品局部被顶坏，从产品正面看，有明显的白色为顶白，又叫顶高水口。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">50、什么叫烘印。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 潜水时入水点在制点外观面上留下的痕迹称为烘印。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">51、什么叫码仔？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 码仔属于装夹工具，一种三角形斜面开口位槽的垫块。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">52、什么叫过切？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 过切是指过量切削，也就是加工工件时把不需要加工的部分也加工了，过削是不好的。 模具达人微信：mujudaren</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">53、校杯是什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 前模弹出开模内行位。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">54、牙嗒是什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 攻丝.攻螺纹称为牙嗒。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">55、何时需做双色模具？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 当一个产品包含两种不同的材质或同一材质不同的颜色时，设计双色模具成型。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">56、工厂的模具设计流程是什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 客户提供产品图→分析产品→确认塑料品种→确认模具材质→转工程图→乘缩水作镜相→完善组立图→订模胚→订模仁料→拔模→3D 分模→确定流道/浇口方式→参照排位图进行结构设计→拆镶件→更正 3D→工程出图《包括：模仁/镶件/模胚/散件》→做 BOM 表→校对审核</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">57、脱模有几种方式？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 顺脱和强脱&nbsp;&nbsp; 模具达人微信：mujudaren</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">58、进胶方式有哪些？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 直接进胶→搭接进胶→侧胶→环行进胶→薄片进胶→潜伏式→点进胶→牛角式进胶→扇形进胶。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">59、流道有那些形式？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 有圆形流道→半圆形流道→T形流道→正六角形流道。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">60、模具设计人员的常备手册与书籍？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 钢材书籍、塑料书籍、模具标准件书籍。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">61、弹簧的作用是什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 外用出现时产生反弹力 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">62、模具为什么要拔模？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 防止产品脱模时被拉伤 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">63、螺丝的作用及配合长度的确定？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 主要起紧固定作用，配合长度一般取螺丝直径的1.5到2倍。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">64、滑块的斜度一般取多大，斜导柱的斜度一般取多大？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 滑块的斜度一般取：20度，斜导柱的斜度一般取18度。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">65、冷料井的作用？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 冷料井的作用是：储存先进入模具的那一小部分温度比较低的塑胶料。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">66、定位环的作用？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 定位环的作用是：保证模具和注射机之间保持正确的相对位置。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">67、配合的相对位置？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 配合主要分为三类：间隙配合、过渡配合、过盈配合。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">68、镶件的作用是什么?</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 方便加工、防止积碳、利于抛光、节省材料、帮助排气、便于更换、缩小加工机台。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">69、硬度的指标有那几种？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 硬度表示材料抵抗硬物体压入其表面的能力，常用的硬度指标有布氏硬度，洛氏硬度和维氏硬度。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">70、曲面能否拔模？组能否拔模？面组能否替换？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 曲面不可以拔模，组面可以拔模，面组可以替换。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">71、第一角法与第三角法的区别？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">①、凡将物体置放第一象限内，以{视点}（观察者）→（物体）→（投影面）关系而投影视图的画法，即称为第一角法，亦称第一象限法。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">②、凡将物体置放第三象限内，以{视点}（观察者）→（投影面）→（物体）关系而投影视图的画法，即称为第三角法，亦称第三象限法。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">注：第一角画法和第三角画法的区别是视图放置的文章。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第一角画法：左视图放右边，右视图放左边，上视图放下面，依此类推…</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第三角画法：左视图放左边，右视图放右边，上视图放上面，依此类推…&nbsp;&nbsp; 模具达人微信：mujudaren</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">72、运水有那几种方式？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 运水常用的有：直通式、环绕式、水塔式、螺旋式。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">73、三视图的基本原则是什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 三视图的基本原则是：长对正、高平齐、宽相等。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">74、注射机分为那几类？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 按外形分有；立式的、卧式的。按注塑量分为：超小型注塑机、小型注塑机、中型注塑机、大型注塑机、超大型注塑机。也就是注射量从几毫克到几十千克不等，按合模力分为：几吨到几千吨不等。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">75、锁模力和撑模力之间有何关系？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 注塑机的锁模力要大于撑模力，否则模具会模内压力撑开。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">76、公母模的定位方式有哪些？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 前后模的定位方式有两类：一是：模板定位，二是：模仁定位。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">77、常用塑胶的合适壁厚是多少？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; ABS的合适壁厚为：1.8—3mm,PC的合适壁厚为：2—3.5mm,POM的合适壁厚为：1.5—2.5mm，NoryL合适的壁厚为：2—3.5mm</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">78、什么叫溢边值？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 溢边值是指塑胶产品是在多大的间隙下会溢出来，（也就是跑毛边）的一个数值，ABS的溢边值为：0.04mm,pc的溢边值为：0.06mm,pA的溢边值为：0.015mm，POM的合适壁厚为：0.04mm,PBT+15%GR的溢边值为：0.03mm,PBT+30%的溢边值为：002mm,PMMA的溢边值为:0.065mm,PVC的溢边值为：0.07mm,AS的溢边值为：0.05mm,ps的溢边值为:0.05mm,pp的溢边值为:0.03mm,PE的溢边值为:0.02mm. </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">79、标准的图框是多大？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 常用的图框有：A0、A1、A2、A3、A4，A0的图框的尺寸为：1189mx841m,A1的图框的尺寸为：841mx594mm,A2的图框的尺寸为：594mmx420mm,A3的图框的尺寸为：420mmx297mm,A4的图框的尺寸为：297mmx210mm</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">80、模具大小的规划？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 每个公司的规划模具大小的标准都不一样，但是常见的标准划分如下：15—30系类模胚的模具列为小模，30—50系类模胚的模具列为中模，50以上模胚的模具列为大模。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">81、什么叫弹性变形？什么叫塑性变形？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 物体在外力的作用下发生变形，当外力消失后，物体可以恢复到变形前的变形称为弹性变形，当外力消失后，物体无法恢复到变形前的变形称为塑性变形。&nbsp; 模具达人微信：mujudaren</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">82、模胚常用什么材质？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 模胚常用王牌钢（香港叫法），王牌也就是中炭钢、45钢。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">83、CAD绘图工作模型空间和布局空间中有何区别？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 模型空间是针对图形实体的空间，布局空间是针对图纸布局的空间。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">84、运水的作用是什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 运水的作用就是：控制模仁的温度。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">85、模具是什么？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 在工业生产中，用各种压力机和装在压力机上的专用工具，通过压力把金属或非金属材料制出所需形状的零件或制品，这种专用工具统称为模具。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">86、模具的分类？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 模具一般可分为塑胶模具及非塑胶模具，非塑胶模具有：铸造模、锻造模、冲压模、压铸模、塑胶模具根据生产工艺和生产产品的不同又分为：注射成型模、吹气模、压缩成型模、转移成型模、挤压成型模、热成型模、旋转成型模，根据浇注系统型制的不同可将模具分为三类：大水口模具、细水口模具、热流道模具。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">87、什么叫浇注系统？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 从注射机嘴到型腔为止的塑胶流动通道称为浇注系统，浇注系统包括：主流道、分流道、浇口和冷料井。 </span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">88、什么叫逆向工程？</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;&nbsp; 逆向工程是由高速三维激光扫描机对已有的样品或模型进行准确、高速的扫描，得到其三维轮廓数据、配合反求软件进行曲向重构、并对重构的曲面进行在线精度分析、评价构造效果、最终生成IGES或STL数据,据次就能进行快速成型或CNC数控加工。</span></p><p><br/></p><p><span style=\"color: rgb(0, 0, 0);\">来源：模具达人</span></p>','16','2','0','','1487129700','1487130703','1487130195','41');
INSERT INTO `dp_news` (`news_id`,`news_name`,`news_title`,`news_pic`,`news_content`,`news_column`,`news_department_audit`,`news_add_user`,`news_review_user`,`news_addtime`,`news_updatetime`,`news_reviewtime`,`news_eye`) VALUES
('104','汽车冲压模具设计工程师招募令','汽车冲压模具设计工程师招募令','/attachement/image/admin/2017/02/15/3/6/3/6/58a3cd7d0d7bf.jpg','<p style=\"line-height: 1.5em; text-align: center;\"><span style=\"color: rgb(0, 0, 0);\"><img src=\"/attachement/image/admin/2017/02/15/f/2/b/2/58a3cdce797db.jpg\" width=\"100%\" alt=\"f/2/b/2/58a3cdce797db.jpg\"/></span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">15年前我们错过了阿里巴巴，10年前我们错过了淘宝。8年前我们错过了QQ。6年前我们错过了微博。4年前我们错过了微信。现在，你还要错过吗？</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">我们常说时间面前人人平等，后来才发现被骗了好多年。有的人大学四年可以修3个学位，有的人英语四级四年考3次不过；有的人一天投入工作16个小时，一年连升两级；有的人入职一年还弄不明白怎么做PPT。同样的时间，成就天壤之别。请问，业余时间你还在摆弄你的手机吗？</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">这年头，作为一个汽车行业的模具设计工程师是如此的苦逼！工作环境差，强度大，天天被领导追进度，最关键是还挣不到钱。想自己开个设计工作室风险太大，想利用自己的业余时间干点事情又担心钱收不回来。身为设计工程师的你，是否觉得总是空有一身本领而无机遇施展呢？&nbsp;</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">Duang！现在机会来了——“拣豆网”是上海简豆网络科技有限公司为汽车冲压模具设计类服务量身打造的专业化服务平台，是优秀工程师的汇聚地，可以为买方提供优质的、专业的、性价比更高的设计服务。“拣豆网”为有能力、有梦想的工程师提供一个可以展示自己能力的平台。</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">加入我们的六大理由：</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">1，&nbsp; 资金保障，每个任务发布需求方都会事先托管设计费用，由平台担保，达到付款条件由平台直接付款，无需担心收款问题。</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">2，&nbsp; 海量任务，你可以利用业余时间赚钱，数钱数到手抽筋。</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">3，&nbsp; 安全可靠，无需担心个人信息泄露造成不必要的麻烦。</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">4，&nbsp; 灵活便捷，只要你有电脑，有比别人更好的大脑，随时随地都可以画图挣钱！</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">5，&nbsp; 价格你自己说了算，根据市场和自身的时间你自己来灵活报价。</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">6，&nbsp; 你将拥有自己的团队，如果你有足够的经验和能力，你就可以拥有自己的团队，专职经营自己的事业。</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">要求：&nbsp;</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\"><br/></span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">1、可以根据客户需求提供客户所需的图纸及其他文件。</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\"><br/></span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">2、能够与客户就技术及图纸质量、进度等问题进行沟通，如果你不能和客户进行沟通，那就加入一个团队吧。</span></p><p style=\"line-height: 1.5em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(0, 0, 0);\">即刻登录</span><a href=\"http://www.jeendon.com加入我们吧！\" _src=\"http://www.jeendon.com加入我们吧！\" style=\"text-decoration: underline; color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0);\">www.jeendon.com加入我们吧！</span></a></p><p style=\"line-height: 1.5em; text-align: center;\"><img src=\"/attachement/image/admin/2017/02/15/4/b/9/e/58a3cde8d3dd8.jpg\" width=\"100%\" alt=\"4/b/9/e/58a3cde8d3dd8.jpg\"/></p><p><br/></p>','15','2','0','','1487129880','1490058403','1487130189','38');
INSERT INTO `dp_news` (`news_id`,`news_name`,`news_title`,`news_pic`,`news_content`,`news_column`,`news_department_audit`,`news_add_user`,`news_review_user`,`news_addtime`,`news_updatetime`,`news_reviewtime`,`news_eye`) VALUES
('105','全球六大模具领先国家（地区）各自领先的地方是哪些？','全球六大模具领先国家（地区）各自领先的地方是哪些？','/attachement/image/admin/2017/02/17/8/6/2/a/58a65278281d5.jpg','<p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">近十几年来中国的模具制造技术有了质的飞跃，模具行业从小到大，迅速崛起，成为世界模具制造大国，我们可以把这个阶段叫做中国模具的第一次腾飞。随着中国汽车工业的发展，自主品牌向中高端进军，新能源汽车兴起，市场给我们提出了新的需求，要求我们从低端模具迈向高端模具，从模具大国迈向模具强国，实现中国模具的第二次腾飞。如何实现从低到高、从大到强的转变，如何实现中国模具的第二次飞跃，是值得每个中国模具厂、每个中国模具人思考的问题。<br/></span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">目前，中国、美国、日本、德国、韩国、意大利这六大模具制造国的模具产值占居全球的绝对地位，中国的模具产值是世界之最。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><strong><span style=\"color: rgb(0, 0, 0);\">美国、日本、德国等发达国家的模具制造业在生产经营方面具有以下特点：&nbsp;</span></strong></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">（1）人员精简，欧美日模具企业大多数规模不大，员工人数超过百人的较少，模具企业人数一般都在20～50人。企业各类人员的配置十分精简，一专多能，一人多职，企业内部看不到闲人。&nbsp;</span></p><p><br/></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">（2）采用专业化，产品定位准。大多数模具厂都是围绕汽车、电子等产业对各类模具的需求，确定自己的产品定位和市场定位。为了在市场竞争中求生存、求发展，每个模具厂家都有自己的优势技术和产品，并都采取专业化的生产方式。欧美日大多数模具企业既有一批长期合作的模具用户，在大型模具公司周围又有一批模具生产协作厂家。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">（3）先进的管理信息系统，实现集成化管理。欧美的模具企业，特别是规模较大的模具企业，基本上实现了计算机管理。从生产计划、工艺制定，到质检、库存、统计等，普遍使用了计算机，公司内各部门可通过计算机网络共享信息。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">（4）工艺管理先进，标准化程度高。与国内模具厂大多采取以钳工为主或钳工包干的生产组织模式不同，欧美的模具生产厂家是靠先进的工艺设备和工艺路线确保零件精度和生产进度。欧美模具企业的先进技术和先进管理，使其生产的大型、精密、复杂模具，对促进汽车、电子、通讯、家电等产业的发展起了极其重要的作用，也给模具企业带来了良好的经济效益。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><strong><span style=\"color: rgb(0, 0, 0);\">美国模具行业</span></strong></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">美国现有约7000家模具企业，15人以下占60%，15-50人占30%。由于工业化的高度发展，美国模具业早已成为成熟的高技术产业，处于世界前列。美国模具专业化分工很明确，每个模具厂都有自己的优势产品，基本都是专攻一路。以美国Synergis模具厂为例，他们就是专门做底盘副车架类模具，做级进模和多工位模具。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">美国福特汽车模具工厂加工的侧围模具，制造周期只用8周。这在我们来看简直是奇迹，但他们做到了。模具前期的工艺、设计不在模具厂，在研发部门，模具厂只负责从泡沫模型开始的制造过程。由于前期工作做得好，加工中很少改动，这就给模具制造节省了不少时间。模具厂加工出泡沫型送铸造，铸件回来开始数控加工，由于是多工作台自动转换，24小时不停机，加工效率非常高。而且由于前期工作如回弹、变形等考虑得比较细致，再加上精算技术，所以加工出来的模具直接上压机调试，首件合格率就可以达到85-90%，由此可见美国专业化加工技术之高。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">据资料统计，2014年美国模具人均产值约127万人民币。&nbsp;</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><strong><span style=\"color: rgb(0, 0, 0);\">日本模具行业</span></strong></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">据日本通产省工业统计，日本共有模具生产厂约10000家，其中20人以下的占91%以上，即日本模具业以中小企业为主，主要靠专业化分工，完成高质量的模具设计、加工。由于日本的专业化分工做得好，中小模具企业的整体制造水平较高，使日本模具在世界模具市场占据较高的份额。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">在日本，模具厂只加工大件主件，其余都分到下面小厂去加工，设计有专门的设计公司，缺块钢板，一个电话很快就加工好，送到指定位置。缺螺丝或者钉子，也是一个电话很快送到指定位置，分工体系、配套体系非常完善。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">但是由于中国、韩国模具的崛起，凭借价格优势对日本造成了很大冲击，在中低档技术含量的模具巿场上更已成为日本中小模具企业的主要竞争对手。也正因为此，日本模具企业不得不致力于高档模具的生产和技术升级，以避开价格竞争。即以小而精、小而专的技术积累作为竞争力的源泉，促使中小模具企业不断创新，营造可持续发展的环境。日本许多模具厂家都在积极扩大设备投资。在加工方面，大量采用无人看管的加工单元，或者通过计算机进行联机控制。模具的技术开发主要向高精度、高速度、长寿命、复杂、大型、一体化和高性能诸方面发展。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">据统计2014年 日本模具人均产值约120万人民币。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><strong><span style=\"color: rgb(0, 0, 0);\">德国模具行业</span></strong></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">德国是欧洲最早从事模具生产的国家之一，其模具制造技术、模具质量受到全球使用者的肯定，在全球享有盛名，是全球最重要的高端模具供应国之一。经过多年的实践探索，德国模具制造厂商形成了一个共识：即全行业必须协调一致，群策群力，技术创新，取长补短，共同进步，发挥好整体优势，才能取得行业的成功。此外，为适应当今新产品快速发展的需求，在德国不仅大公司建立了新的开发中心，而且许多中小企业也都这样做，主动为客户做研发工作。在研究方面德国始终十分活跃，成为其在国际市场上保持不败的重要基础。在激烈竞争中，德国模具行业多年保持住了在国际市场中的强势地位，出口率一直稳定在33%左右。依据德国机械工厂制造协会(VDMA)资料显示其模具厂商数约5000家左右，但该国模具产业结构仍以中小型企业为主：20人以下占80%，20-100人占19%，100人以上占1%。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">据统计 2014年德国模具人均产值约200万人民币。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><strong><span style=\"color: rgb(0, 0, 0);\">台湾地区模具行业</span></strong><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">台湾地区模具行业基本是中小企业，专业分工精细，生产协调工作紧密，客户相对稳定。每家企业只生产某一类模具，各家都有自己的拳头产品，有利于在技术上精益求精，使其在激烈的竞争中生存发展。模具厂所需的模具标准件都是外购的，有些零件加工也由其他协作厂合作生产。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">模具企业带件生产比较普遍，台湾模具业注重模具与产品一体化，模具与产品相辅相成，互相促进。有利于模具企业的发展。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">紧跟主产品需求开发模具，注重开拓海外市场。台湾模具工业发展较快。其中，紧跟主产品需求来开发、制造模具也是一个重要因素。近几年来，电子工业和汽车工业的迅速发展，带动了台湾模具的发展。目前台湾模具产值的76%源自电子产品和汽车。</span></p><p><br/></p><p><br/></p><p style=\"line-height: 1.75em;\"><strong><span style=\"color: rgb(0, 0, 0);\">中国模具行业</span></strong></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">我国的模具行业起步较晚，20世纪80年代中期以来，我国模具行业产生了很大变化，特别是近十几年，变化可以说是翻天覆地，现在已经成为了世界模具的生产大国。在大多数领域，中国模具已经占领了相当大的份额。但是在高端模具，仍然要从国外大量进口。从模具行业整体而言，我国模具的整体水平仍然是以中低档模具为主。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">从中国模具厂的发展历史来看，建国以后，我国并没有专业的模具厂，五、六十年代随着汽车厂的建立，逐步建立了附属于主机厂的工具厂，基本都是参照苏联模式建立的大而全的工具厂，随着汽车行业的发展，这些工具厂逐步转为模具厂。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">以北汽为例，六十年代叫北汽工具分厂，八十年代成立北京吉普，叫工具车间。主要生产量具、刃具、冲模、锻模、铸造型板芯盒，压铸模、注塑模、橡胶模及各类卡具，90年代末逐步转为冲压模具厂。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">90年代以来，民营的模具厂崛起，数控机床的大量引进，CAD、CAE、CAM的逐步实施,模具行业蓬勃发展，中国一跃成为模具制造大国，但这些工厂的生产方式大多还是大而全或小而全，制造的基本都是低端模具，中高端模具很少，大家基本都在低端市场恶性竞争。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">是什么阻碍我们做强、做专、做精呢？其中的最大障碍之一就是我们的大而全或小而全的生产方式，我们的模具生产没有专业化分工或者说专业化分工不充分。&nbsp;</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">目前我国模具制造厂点约30000家，其中国有企业约占5%，合资企业约占10%，民营企业约占85%，从业人员约100万人，年产值2000万元以上的企业约5000家。2015年模具总产值约1700亿元，企业自用模具产值约400亿元，加起来是2100亿，模具人均产值约21万元。根据中国模协统计的2014年82家重点企业资料显示，这些企业2014年模具总产值90亿元，共有员工26800名，人均产值约33.5万元。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">从模具人均产值比较，日本模具是120万元，美国模具是127万元，德国模具是200万元，也就是说模具人均产值美国、日本是我国的3-5倍，德国是我国的5-9倍。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">人均产值低的原因主要有两点，一是我们生产的绝大多数模具是低端模具，附加值低；二是我们的生产效率低。我们的设备不比他们差，为什么附加值低，效率低呢？一个很重要的原因就是我们不“专”。所谓熟能生巧，“专”能出技术。“专”能出精品，“专”能出效率。人家专业分工好，所以模具质量好效率高。我们是大而不强，广而不专，什么都干，什么都不精，这就造成了我们技术提升慢，质量提升慢，效率提升慢。所以模具生产专业化、集约化是模具企业提升技术、提升质量、提升效率，向大而强、专而精转变的必由之路。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">随着模具制造技术的不断提升，未来模具种类会越来越丰富。任何一个模具企业都不可能完全掌握这些技术，所以未来的模具制造行业必然是一个高度专业化的行业。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">由现在的大而全，小而全的的模具制造模式，逐步向大而强、专而精转变，形成以大带小、以点带面的专业化、集约化生产模式。即以一个模具中心，带动多个小模具厂和多个工序加工厂，形成大而强、小而专的生产局面，各个中心又有专业侧重，如侧围模具厂、门板模具厂、梁类模具厂等。市场细分的规则有很多，有些会按照不同成型材料来分；也有可能会按照模具类型来分；有些也会按照内板、外板甚至是车身的各总成来进行分类等等。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">这些现象说明中国模具行业已经出现了专业化生产、集约化生产的趋势，让我们推波助澜，推动这种趋势不断发展状大。一花独放不是春，万紫千红才是春，愿中国模具之园大花艳丽，小花芬芳，绿叶葱茏，一派生机，蓬勃竞放。中国模具的专业化生产之路是漫长的，只要我们坚持走下去，就会看到模具强国的曙光，这是我们几代模具人的梦想!</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">来源：模具达人</span></p><p><br/></p>','16','2','0','','1487294040','1487295185','1487295220','75');
