('106','拣豆网试运行期间不收取任何费用！','拣豆网试运行期间不收取任何费用！','/attachement/image/admin/2017/02/26/f/e/e/2/58b22c466eaea.jpg','<p><span style=\"color: rgb(0, 0, 0);\">拣豆网试运行期间不收取任何费用！试运行起止日期暂定为2017年2月15日至2017年6月15日。</span></p>','15','2','0','','1488071640','1490157591','1488075898','59');
INSERT INTO `dp_news` (`news_id`,`news_name`,`news_title`,`news_pic`,`news_content`,`news_column`,`news_department_audit`,`news_add_user`,`news_review_user`,`news_addtime`,`news_updatetime`,`news_reviewtime`,`news_eye`) VALUES
('107','为什么不能买便宜的模具？','为什么不能买便宜的模具？','/attachement/image/admin/2017/03/05/3/8/a/0/58bb6b066c9b4.jpg','<p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">近几年，随着各企业实力的状大和客户要求的提高，越来越多的注塑工厂、五金工厂、汽车制造厂在购买模具时都会在价格和质量之间会选择后者。但也有工厂为了贪图一时便宜，而选择便宜的模具，便宜的能买吗？下面我们就来讲讲：为什么不能买便宜的。</span></p><p><br/></p><p style=\"line-height: 1.75em; text-align: center;\"><span style=\"color: rgb(0, 0, 0);\"><strong>为什么不能买便宜的</strong></span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>一、买便宜的模具</strong></span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">只有在你杀完价的那一刻是开心的！用的时候很大的可能是没有一次是开心的。便宜的东西，它的总成本未必低，只是在其他方面把省掉的钱弥补回去罢了。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>二、买品质好的</strong></span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">给钱那一刻是心疼的！用的时候每天都是快乐的，感觉特别值得。用了好多年，模具都没有怎么维修过，就是有个小毛病，厂家的售后做的非常好。模具精度首先是顶呱呱，用到最后精度还很好、模具寿命真的一个能顶三个，甚至比一些厂家的三个还要强。。。。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>三、客户拼命压价、算成本</strong></span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">客户一直觉得我们收费贵，死命压价，跟我算成本，我就很想问他：“设计成本你算了吗？人工成本算了吗？营销成本算了吗？公司正常运营成本算了吗？管理成本算了吗？物流成本算了吗？仓储成本算了吗？……”最重要的我们模具厂每年的研发创新学习方面投入效益的20%，一般企业做不到吧，并且每年我们平均五成的利润用来添加新的设备。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>四、给你一堆钢铁，你能把它变成模具吗？</strong></span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">给你钢铁，你能自己去造模具吗？给你一根针，你能给自己针灸吗？给你一颗篮球，你能去打NBA吗？给你一堆材料，你能自己把它变成地板吗？</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>五、服务的前提是利润，创新的基础也是利润</strong></span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">服务的前提是利润，每个公司都要生存，利润可以适当减少却不能消失，你把保障生存的利润全都拿走了，模具的质量、售后的服务靠谁来保障。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>六、产品的质量在于您的选择</strong></span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">好贵，没错，因为好，所以贵！产品贵在品质，人贵在品味！产品的质量在于您的选择！世上没有花最少的钱却能买到最好产品的事情。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>七、完美追求、品质为先</strong></span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">有人问：“你的模具能不能便宜点”</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">我只能说：“我不能给您最低的价格，我只能给您最高的品质，我宁可为价格解释一阵子，也不愿为质量道歉一辈子”</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">来源：机械前沿（jixieqianyan）</span></p><p><br/></p>','16','2','1','','1488677400','','1488678123','35');
INSERT INTO `dp_news` (`news_id`,`news_name`,`news_title`,`news_pic`,`news_content`,`news_column`,`news_department_audit`,`news_add_user`,`news_review_user`,`news_addtime`,`news_updatetime`,`news_reviewtime`,`news_eye`) VALUES
('108','“不要提拔在车间走直线的人”：丰田的现地现物','“不要提拔在车间走直线的人”：丰田的现地现物','/attachement/image/admin/2017/03/06/f/4/d/1/58bcb73c98676.jpg','<p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">在丰田，“现地现物”在使用中常常被称为现场主义（Gemba Attitude），Gemba在日语中是“现场——事情真正发生的地方”的意思，它也是日本人日常生活中的常用词。广义上讲，它就是“事件发生的地方”；狭义上讲，Gemba就是指企业的“工作领域”或“工作位置”。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">对丰田来说，这几个字意义重大，因为这是丰田管理的最重要的原则之一，这个原则的含义是，解决问题的方法是要亲自看到实际情况，掌握一手信息。用丰田汽车公司的创始人丰田喜一郎的话来说，就是：</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>“绝不要相信一个不洗手就去吃饭的工程师。”</strong></span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">对现地现物最好的解释，是丰田的一个小故事，这个小故事的名字叫：“在车间走直道的家伙干不成事”，或者说，“绝不要提拔一个在车间走直道的人。”</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">这句话是大野耐一说的。当时，他在管理质量的时候，就亲自到车间去观察生产过程，并与第一线的工人建立起亲密的沟通关系。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">比如，当你在车间走过时，员工们碰到你的时候，会不会说，“请你过来一下？”过来干什么？讨论问题呀。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">如果你是个官僚，员工就会躲着你。所以，优秀的领导一定是那些现地现物的领导，走到哪里，都会有问题来找你，在车间中肯定走不成直道，这样的人才可靠。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">因此，现地现物在丰田，讲的是一种解决问题的方法。丰田要求所有的车间管理人员要做员工解决问题的伙伴，要让员工乐于找你一起讨论问题。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">做过丰田总裁的张富士夫也这样说过，他说：无论在哪一个层面，领导都应当做一个现场主义者。当他被派到美国负责肯塔基州乔治敦工厂时，他告诉身边的管理人员，了解工厂实行丰田生产方式时的状况的唯一方法，就是亲自到现场查看：他们是否遵循标准工作程序？是不是遵循平稳的流程和准时生产？零件是否在尚未需要之前就已经送到了？</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">所有这些问题，都不可能在办公室得到答案，都必须亲自观察材料送至生产线的流程，必须亲自查看联机操作员是否使用安灯请求支持，并在必要时暂停生产线，如此等等，都是“现地现物”所包含的应有含义。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">中国俗语说“百闻不如一见”，但丰田的哲学是 “百见不如一行”。在丰田公司，不论是在制造、产品发展、销售、配送或公关部门，当我们问到丰田模式和其他管理方法有何不同的时候，最常听到的一个词就是“现地现物”。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">除非你亲自实地查看，否则任何企业问题的任何部分，你都无法确实了解，丰田公司不容许任何“理所当然”的想法，也不容许只凭借他人提出的报告。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">这种逻辑，甚至在丰田的危机中体现得更明显，08年底的全球金融风暴之下，丰田公司宣布，由丰田家族的丰田章男上台成为CEO，丰田章男是丰田汽车创始人丰田喜一郎的孙子。这次换帅，对于丰田来说，并不完全是因为业绩下降，因为同比欧美的几大汽车公司，丰田的表现并不算差，丰田章男的上台对于丰田来说，有着直接的战略意义，那就是丰田的股东认为，丰田这一次亏损，并不完全是因为经济形势下滑，而是因为丰田这几年的发展，偏离了“丰田之道”。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">偏离什么丰田之道？丰田章男对此说的非常明确，他告诫丰田管理层：“在过去3年中，丰田雇用了4万名员工，他们对于公司文化知之甚少。这个问题不会突然间暴露，但它类似一种代谢紊乱式的疾病，当你发现时就已经太晚了。”</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">如何解决？丰田章男重申的就是丰田之道中的 “现地现物”、“客户第一”。他要求领导走出办公室，对存在的问题进行实地考察，并带领高管到销售现场，到生产现场，“寻找丰田浪费的证据，寻找为客户提供价值的阻碍点”，与经销商沟通，努力应对导致公司和一些美国经销商产生分歧的定价策略。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">丰田章男通过调查后警告管理层：经销商认为丰田汽车定价过于昂贵，而过去多少年来，丰田汽车一直以价格公道的形象闻名于世，而现在经销商与客户都在抱怨丰田自己在破坏这一形象。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">接下来，他把已离开丰田母公司数年的稻叶良睍、Masamoto Maekawa和Yasumori Ihara请入董事会，并新任命了5位董事会成员和18位新的管理人员。与此同时，大幅启动了对业务管理人员的调动，比如丰田中国本部部长、丰田本部中国室室长等都发生了改变。这些旧将的回归，合理的逻辑解释就是丰田章男希望通过这些熟知丰田文化的人，“现地现物”地把丰田文化带回来。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">来源：汽车工艺师</span></p>','16','2','1','','1488762600','','1488762789','43');
INSERT INTO `dp_news` (`news_id`,`news_name`,`news_title`,`news_pic`,`news_content`,`news_column`,`news_department_audit`,`news_add_user`,`news_review_user`,`news_addtime`,`news_updatetime`,`news_reviewtime`,`news_eye`) VALUES
('109','汽车覆盖件冲压模具的检测方法','汽车覆盖件冲压模具的检测方法','/attachement/image/admin/2017/03/07/d/7/5/1/58be094796209.jpg','<p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1.油石打磨</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">（1）首先，用干净的纱布将外覆盖件的表面擦干净；然后，打磨用油石（20×20×100mm或更大），有圆弧的地方和难以接触到的地方用相对较小的油石打磨（例如：8×100mm的半圆形油石）；</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">（2）油石粒度的选择取决于表面状况（如粗糙度、镀锌等），建议用细粒度的油石。油石打磨的方向基本上沿纵向进行，并且很好地贴合冲压件的表面，部分特殊的地方还可以补充横向的打磨。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2.触摸检验</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">用干净的纱布将外覆盖件的表面擦干净。检验员需戴上触摸手套沿着冲压件纵向紧贴冲压件表面触摸，这种检验方法取决于检验员的经验。必要时，可用油石打磨被探知的可疑区域并加以验证，但这种方法不失为一种行之有效的快速检验方法。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3.目视检验</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">目视检测主要用于发现冲压件的外观异常和宏观缺陷。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">4.涂油检验</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">用干净的纱布将外覆盖件的表面擦干净。再用干净的刷子沿着同一个方向均匀地涂油至冲压件的整个外表面。把涂完油的冲压件放在强光下检验，建议把冲压件竖在车身位置上。用此法可很容易地发现冲压件上的微小的麻点、瘪塘、波纹等。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">5.检具检测</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">将冲压件放入检具，依据检具说明书的操作要求，对冲压件进行检测。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">6.柔性纱网的打磨</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">用干净的纱布将外覆盖件的表面擦干净。用柔性砂网紧贴冲压件表面、沿纵向打磨至整个表面，任何麻点、压痕会很容易地被发现。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><br/></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">来源：网络</span></p>','16','2','1','','1488849060','','1488849465','30');
INSERT INTO `dp_news` (`news_id`,`news_name`,`news_title`,`news_pic`,`news_content`,`news_column`,`news_department_audit`,`news_add_user`,`news_review_user`,`news_addtime`,`news_updatetime`,`news_reviewtime`,`news_eye`) VALUES
('110','中国模具技术发展发展七大新趋势分析','中国模具技术发展发展七大新趋势分析','/attachement/image/admin/2017/03/08/8/f/8/4/58bf578e8fb79.jpg','<p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">近两年来，中国国内的模具技术得到了突飞猛进的进步，主要表现为：模具集成制造单元与技术的普及;商业互联网向模具及其产业链延伸;3D打印在模具制造中的广泛应用;模具的智能化;轻量化新材料与大型塑料模具的出现与优化;大型级进冲模技术的成熟;具标准件精细化等。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">(1)模具集成制造单元与技术的普及。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">模具除了具有自动送料、冲压成形、叠片计量、厚度分组、铁芯组合和产品输出、铰链装配连接等功能，又出现了复杂运动结构、模内加热、锻压、局部热(组织)控制、模内焊接、攻丝、局部注塑、模内切割、模内检测等工艺组合过程。特别值得一提的是本次展会上出现的塑料件的模内热切、硼钢板的模内热切以及电机笔形铁芯的变刃口冲裁等新技术开创了模具集成制造单元的新纪元。模具产品继续向大型、精密、高性能、集成化制造单元方向发展。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">(2)商业互联网向模具及其产业链延伸。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">目前，许多模具加工装备企业也纷纷对接互联网，积极打造“模具制造+互联网”模式，有力地推动了模具行业的转型与升级。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">(3)3D打印</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">在模具制造中的广泛应用。3D打印应用生产模具型腔是型腔模具发展的新动向。金属增材-减材组合制造技术是当今3D打印领域的一个重要方向，目前通过3D逐层增材成形，结合高速铣定层厚轮廓减材精整，实现复杂金属零件的高精度制造。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">(4)模具的智能化。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">目前，在塑料模具和压铸模具行业，已经出现了模具型腔的压力、温度、流量、冷却过程的智能控制的模具。另外，模具加工装备的智能化也正在迅速推进模具的智能化制造。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">(5)轻量化</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">新材料与大型塑料模具的出现与优化。随着汽车轻量化的发展，轻量化新材料层出不穷，国内模具企业已经开始应对这种变化，展开了轻量化新材料</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">汽车覆盖件模具与大型复合材料模具的开发。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">(6)大型级进冲模技术的成熟，高速高可靠性成为精密级进冲模的重要特征。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">目前，大型级进冲压件比比皆是，零件尺寸越来越大，形状越来越复杂，显示出大型级进冲模技术进入到成熟阶段。而高精度精密级进冲模对生产的稳定性、可靠性的要求越来越高，已经成为模具制造企业竞争的重要手段。显然，超大型成形件以及小型超精密零件的模具设计制造技术已经成为模具企业关注的热点。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">(7)模具标准件趋于精细化。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">近年来，随着模具种类和要求的提高，模具标准件已经成为模具企业参与国际竞争的重要条件，品种多、分类细是目前模具标准件的主要趋势。传统的标准件品种越来越多，质量要求越来越高。新的功能结构标准单元与具有更多制造柔性的标准件也越来越重要，成为新技术和创新提升竞争力的新方向。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">由上可见，当下中国模具技术已经发展到了另一个新阶段，但是要想得到更大的突破，还需要继续优化行进。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">来源：广东省模具工业协会</span></p>','16','2','1','','1488934680','','1488935080','27');
INSERT INTO `dp_news` (`news_id`,`news_name`,`news_title`,`news_pic`,`news_content`,`news_column`,`news_department_audit`,`news_add_user`,`news_review_user`,`news_addtime`,`news_updatetime`,`news_reviewtime`,`news_eye`) VALUES
('111','设计一个好的拉伸模具 必须牢记好这几点！','设计一个好的拉伸模具 必须牢记好这几点！','/attachement/image/admin/2017/03/09/d/8/f/c/58c0bc3d19f58.jpg','<p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">拉伸模在整个冲压模具行业所占的比重是非常大的，我们常见的杯子，马达上面的外壳，几乎大多数的产品上面都或多或少有一些需要拉伸的产品，而对于拉伸模的设计，也不是说按常规的算法可以计算的，这其中有太多的过程充满变数，特别是一些非旋转体的拉伸，让人望而却步。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">因为拉伸模在设计时要考虑的因素实在是太多，比如拉深系数，有没有到达材料的极限，弹簧力的决定，拉伸的方向，是向上拉伸还是向下拉伸，往往不能一次成型，还要经过多次试作，才能达到理想的结果，甚至有时会有模具报废的可能，因此，在实践中不断积累经验，对拉伸模的设计是有很大帮助的。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">另外，开料尺寸的大小，对整个模具的生产试作也起到了不可忽视的作用。所以大多数时候，当我们对一些不规则的拉深件进行设计时，往往会在模具设计阶段预留一个空步。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">一、拉伸材料</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">当客户对材料的要求不是很苛刻、反复试模达不到要求时，可以换一种拉伸性能好的材料再试，好的材料是成功的一半，对于拉伸，万万不可忽视。拉伸用冷轧薄钢板主要有08Al、08、08F、10、15、20号钢，其中用量最大的是08号钢，分为沸腾钢和镇静钢，沸腾钢价格低，表面质量好，但偏析较严重，有;应变时效倾向，不适用于对冲压性能要求高外观要求较严格的零件，镇静钢较好，性能均匀但价格较高，代表牌号为铝镇静钢08Al。国外钢材用过日本SPCC-SD深冲压钢，其拉伸性能优于08Al。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">二、模具表面的光洁度</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">进行深拉深时，凹模与压边圈的两面研磨不充分，特别是拉深不锈钢板与铝板时，更易产生拉深伤痕，严重时导致拉伸破裂。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">三、毛坯尺寸的确定</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">多则皱，少则裂是我们的原则，毛坯定位设计要正确，形状简单的旋转体拉伸件的毛坯直径在不变薄的拉伸中，材料厚度虽有变化，但基本与原始厚度十分接近，可以根据毛坯面积与拉伸件面积相等的原则计算出。但是，往往拉伸件形状和过程比较复杂，有时还要变薄拉伸，虽然现在有许多三维软件可进行展开料计算，但其精确度不能100%达到要求。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">解决办法：试料。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">一个产件要经过多道工序，头道工序一般是落料工序。首先要进行展开料计算，对毛坯的形状和大小有个大概认识，以便确定落料模的总体尺寸。在模具设计完成后不要加工落料模的凸凹模尺寸。先用线切割加工毛坯，经过后续拉伸工序的反复实验，最终确定了毛坯尺寸，然后再加工落料模的凸凹模。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">经验1</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">倒排工序，先试拉伸模，后加工毛坯的落料刃口尺寸，事倍功半。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">四、拉伸系数m</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">拉伸系数是拉伸工艺计算中的主要工艺参数之一，通常用它来决定拉伸的顺序和次数。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">影响拉伸系数m的因数很多，包括材料性能、材料的相对厚度、拉伸方式、拉伸次数、拉伸速度、凸凹模圆角半径、润滑等。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">有关拉伸系数m的计算和选用原则是各种冲压手册中介绍的重点，有推算、查表、计算等许多方法，祥之又祥，我也是按书选择，并无新鲜的东东，请看书。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">经验2</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">材料的相对厚度、拉伸方式、拉伸次数是不好在修模时调整的，一定要慎重。最好在选择拉伸系数m时找同事校一遍。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">五、加工油的选择</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">加工油的选择非常重要。区别润滑油是否合适的方法，是当将制品从模具内取出来时，如果制品温度高到不能用手触摸的程度，就必须重新考虑润滑油的选择和润滑方法,在凹模上涂润滑油，或在薄板上套薄膜袋。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">经验3</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">遇到拉伸拉裂时，在凹模上涂润滑油，工件靠凹模一面覆0.013–0.018mm的塑料薄膜。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">六、工件热处理</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">虽然不提倡，但还是要说的，在拉伸过程中，工件由于冷塑性变形，产生冷作硬化，使其塑性降低，变形抗力和硬度增大，再加上模具设计不合理，就需要进行中间退火，以软化金属，恢复塑性。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">注意：在一般工艺中中间退火不是必须的，毕竟要增加成本，要在增加工序和增加退火中进行选择，慎用!</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">退火一般采用低温退火，即再结晶退火。退火时要注意的事项有两点：脱炭和氧化。这里主要讲讲氧化。工件氧化后有氧化皮，害处有二：使工件有效厚度变薄，增加模具磨损。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">公司条件不具备时，一般采用普通退火，为减少氧化皮产生，退火时要尽可能将炉膛装满，我还用过土办法：</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、工件少时可与其他工件混装。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、将工件装在铁盒中焊封后再装炉。为消出氧化皮，退火后要根据情况进行酸洗处理。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">公司条件具备时，可采用氮炉退火，即光亮退火。不细看，几乎和没退火前颜色一样。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">经验4</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">对付冷作硬化强的金属或在试模中出现拉裂又无其它办法时，增加中间退火工序。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">七、补充几点</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、产品图上的尺寸应尽可能在一侧标注，让人明确是保证外部尺寸还是内腔尺寸，不能同时标注内外型尺寸。他人提供的图纸有此类问题应与其沟通，能统一则统一，不能统一时要知道该工件的与其它件的装配关系。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、对最后一道工序，工件尺寸在外，以凹模为主，间隙以减小凸模尺寸取得;工件尺寸在内，以凸模为主，间隙以增大凹模尺寸取得;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3、凸凹模圆角半径在设计时尽可能采用小的容许值，给后续修模带来方便。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">4、判断工件拉裂的原因时可参考：因材料质量差而产生的裂口多为锯齿状或不规则形状，因工艺、模具而产生的裂口一般比较整齐。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">5、多则皱，少则裂，按此原则调节材料的流动状况，方法有调整压边圈的压力、增加拉深筋、修整凸凹模圆角半径、工件上切工艺口等。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">6、为保证耐磨性和防止拉伸划痕，凸凹模和压边圈必须淬火，也可以镀硬铬,也可以采用表面TD处理.必要的时候可以用钨钢来作凸凹模。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">来源：模具联盟网&nbsp;</span></p>','16','2','1','','1489025820','','1489026837','44');
INSERT INTO `dp_news` (`news_id`,`news_name`,`news_title`,`news_pic`,`news_content`,`news_column`,`news_department_audit`,`news_add_user`,`news_review_user`,`news_addtime`,`news_updatetime`,`news_reviewtime`,`news_eye`) VALUES
('112','瑞典家用器具制造商伊莱克斯试点生产3D打印备件','瑞典家用器具制造商伊莱克斯试点生产3D打印备件','/attachement/image/admin/2017/03/10/8/b/6/e/58c2016f8e0d0.jpg','<p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">据3D打印联盟了解，瑞典家用器具制造商伊莱克斯与新加坡公司Spare Parts 3D达成一项新合作。二者将共同执行一个试点项目，在此过程中，Spare Parts 3将为伊莱克斯的已停产产品提供3D打印备件。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">谁会买一个不能被修复的产品呢?因此，制造商通常会在仓库里存放许多不起眼的小备件，甚至包括为自己最稀有和最古老的产品而准备的备件。可以想象的是，这样会产生大量费用。</span></p><center></center><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">幸运的是，在增材制造的帮助下，伊莱克斯摆脱了这一普遍命运。3D打印联盟了解到，Spare Parts 3D将为已停产的伊莱克斯产品提供数字化和3D打印服务。如果试点项目进行顺利，Electrolux可能会考虑将该模式应用到其在产产品上。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">伊莱克斯不再需要提前生产和储存所有零件以供未来使用。通过一个由我们构建的3D打印服务供应商网络，伊莱克斯可按需和在当地生产，随后零件会被直接寄给客户，Spare Parts 3D解释说，;这意味着伊莱克斯可兼得零库存和快速发货。</span></p><center></center><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">新试点项目被描述为对3D打印的一次技术和经济评估，将包括五个阶段：</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">　　</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、选择备件：Spare Parts 3D将选择一些适合3D打印的备件。所谓的适合，包括以下几个标准：已经停产、体积小、看起来成本比注塑低成型低。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、工业化：为不同的备件确定最佳的打印材料和最有效的生产参数。&nbsp;<br/></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3、数字化：为所选择的所有备件建立一份数字清单。&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">4、质量测试：Electrolux将对最终的3D打印件进行质量测试，以确定它们是否能正常工作。&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">5、盈利分析：双方将一起来比较和分析3D打印与传统的注塑成型的生产成本。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">来源：模具联盟网</span></p>','16','2','1','','1489109280','','1489109574','36');
