INSERT INTO `dp_rules` (`rules_id`,`rules_name`,`rules_title`,`rules_content`,`rules_ruletype_id`,`rules_add_user`,`rules_addtime`,`rules_updatetime`,`rules_reviewtime`,`rules_order`,`rules_show`,`rules_extarar`,`rules_isshow`) VALUES
('87','平台介绍','平台介绍','<p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">拣豆网是由上海简豆网络科技有限公司开发和运营的为汽车冲压模具设计类工作提供服务的平台，平台致力于网罗优秀的模具设计工程师，使中小模具企业享受到更优质的设计服务，也同时使大型的模具企业更有效合理的进行人才的培养和储备，提升汽车冲压模具设计制造的整体水平。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"color: rgb(0, 0, 0); font-size: 16px;\"><br/></span></p><p style=\"text-indent: 2em; line-height: 3em;\"><span style=\"color: rgb(0, 0, 0); font-size: 16px;\">拣豆网希望将复杂的工作简单化，简单的工作标准化，标准的工作流程化；通过合理的分工，使模具企业更专注于制造方案的规划，模具设计工程师更专注于设计，提升模具的整体质量，缩短制造周期。</span></p><p style=\"text-indent: 2em; line-height: 3em;\"><br/></p>','4','0','1482999660','1488073698','','1','1','','0');
INSERT INTO `dp_rules` (`rules_id`,`rules_name`,`rules_title`,`rules_content`,`rules_ruletype_id`,`rules_add_user`,`rules_addtime`,`rules_updatetime`,`rules_reviewtime`,`rules_order`,`rules_show`,`rules_extarar`,`rules_isshow`) VALUES
('88','服务协议','拣豆网服务协议','<p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">拣豆网（以下简称为“本网站”）依据《拣豆网服务协议》（以下简称为“本协议”）的规定提供服务，本协议具有合同效力，请您在注册时认真阅读本协议，我们仅接受完全同意本协议全部内容的用户注册为本网站用户（未成年人应在法定监护人陪同下审阅）。<br/></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">若您已经注册为本网站用户，即表示您已充分阅读、理解并完全同意自己与本网站订立本协议，且您自愿受本协议的条款约束。本网站有权随时变更本协议并在本网站上予以公告。经修订的条款一经本网站公布后，立即自动生效。如您不同意相关变更，必须停止使用本网站；一旦您继续使用本网站，则表示您已接受并自愿遵守经修订后的条款。本协议内容包括本协议正文及所有拣豆网发布的各类规则。所有规则为本协议不可分割的一部分，与本协议正文具有同等法律效力。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第一条 用户资格</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、只有符合下列条件之一的自然人或法人才能申请成为本网站用户，可以使用本网站的服务：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">A、年满十八岁，并具有民事权利能力和民事行为能力的自然人；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">B、无民事行为能力人或限制民事行为能力人应经过其监护人的同意；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">C、根据中国法律、法规、行政规章成立并合法存在的机关、企事业单位、社团组织和其他组织。无法人资格的单位或组织不当注册为本网站用户的，其与本网站之间的协议自始无效，本网站一经发现，有权立即终止对该用户的服务，并追究其使用本网站服务的一切法律责任。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、用户需要提供明确的联系地址和联系电话，并提供真实姓名或名称，以及所有本网站要求的相关证明文件。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、本网站用户须承诺遵守法律法规、社会主义制度、国家利益、公民合法权益、公共秩序、社会道德风尚和信息真实性。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第二条 用户的权利和义务</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、用户有权根据本协议及本网站发布的相关规则，利用本网站发布需求信息、查询用户信息、参与需求投标，在本网站社区及相关产品发布信息，参加本网站的有关活动及有权享受本网站提供的其他有关资讯及信息服务。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、用户须自行负责自己的用户账号和密码，且须对在用户账号密码下发生的所有活动（包括但不限于发布需求信息、网上点击同意各类协议、规则、参与需求投标等）承担责任。用户有权根据需要更改登录密码。因用户的过错导致的任何损失由用户自行承担，该过错包括但不限于：不按照交易提示操作，未及时进行交易操作，遗忘或泄漏密码，密码被他人破解，用户使用的计算机被他人侵入。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、用户应当向本网站提供真实准确的注册认证信息，包括但不限于真实姓名、身份证号、联系电话、地址、邮政编码及其他证明文件等。保证本网站可以通过上述联系方式与自己进行联系。同时，用户也应当在相关资料实际变更时及时更新有关资料。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">4、用户不得以虚假信息骗取账号名称注册，或其注册信息存在违法和不良信息。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">5、用户不得冒用、关联机构或社会名人注册账号名称。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">6、用户不得以任何形式擅自转让或授权他人使用自己在本网站的用户账号（实名认证通过后，不能进行变更）。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">7、用户有义务确保在本网站上发布的需求信息真实、准确，无误导性。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">8、用户在本网站上发布需求，不得违反国家法律、法规、行政规章的规定，不得侵犯他人知识产权或其他合法权益，不得违背社会公共利益或公共道德，不得违反本网站的相关规定。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">9、用户在本网站交易中应当遵守诚实信用原则，不得以干预或操纵发布需求等不正当竞争方式扰乱网上交易秩序，不得从事与网上交易无关的不当行为。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">10、用户不应采取不正当手段（包括但不限于虚假需求、互换好评等方式）提高自身或他人信用度，或采用不正当手段恶意评价其他用户，降低其他用户信用度。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">11、用户不得违反《银行卡业务管理办法》使用银行卡，或利用信用卡套取现金（以下简称套现）；用户不得盗刷他人银行卡；用户不得明知或应知他人可能盗刷银行卡而与对方进行交易。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">12、用户承诺自己在使用本网站实施的所有行为遵守法律、法规、行政规章和本网站的相关规定以及各种社会公共利益或公共道德。如有违反导致任何法律后果的发生，用户将以自己的名义独立承担相应的法律责任。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">13、用户在本网站网上交易过程中如与其他用户因交易产生纠纷，可以请求本网站从中予以协调处理。用户如发现其他用户有违法或违反本协议的行为，可以向本网站举报。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">14、除本网站另有规定外，用户应当自行承担因交易产生的相关费用，并依法纳税。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">15、未经本网站书面允许，用户不得将本网站的任何资料以及在交易平台上所展示的任何信息作商业性利用（包括但不限于以复制、修改、翻译等形式制作衍生作品、分发或公开展示）。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">16、用户同意接收来自本网站的信息，包括但不限于活动信息、交易信息、促销信息等，信息的形式不限于手机短信及电子邮件。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第三条 拣豆网的权利和义务</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、本网站有义务在现有的技术水平及专业水平基础上，努力核实用户提供的信息及相关证明文件，尽量避免因用户提供虚假信息或信息有误而对其他用户造成损失和影响，一旦发现用户提供虚假信息、或因信息有误而对其他用户造成损失和影响的，经本网站核实后，本网站将会对其永久性封号，并保留向其追索其行为对本网站造成的影响和损失的权利；该用户之行为对其他用户造成的损失和影响，由该用户自己承担相应责任，本网站有义务向受影响的其他用户提供本网站能提供的全部证据。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、本网站仅是一个为用户提供信息的交流平台，是一个雇主发布需求和工程师提供技术服务的自由的交易平台，本网站有义务在现有的技术能力基础上努力确保网站的正常运行，本网站不会对任何交易方进行监视或控制。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、本网站有义务对用户在使用本网站时所遇到的有关问题及建议及时给予反馈。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">4、本网站有权对用户提供的注册信息进行审查，对任何存在问题或可疑的注册信息，本网站有权拒绝用户注册，或者要求用户进行修正、解释或提供证明文件。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">5、用户因在本网站网上交易与其他用户产生纠纷的，用户将纠纷告知本网站，或本网站知悉纠纷情况的，经审核后，本网站有权通过电子邮件及电话联系向纠纷双方了解纠纷情况，并将所了解的情况通过电子邮件互相通知对方；用户通过司法机关依照法定程序要求本网站提供相关资料，本网站将积极配合并提供有关资料。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">6、因网上信息平台的特殊性，本网站不承担对所有用户的交易行为以及与交易有关的其他事项进行事先审查的义务，但如发生以下情形，本网站有权无需征得用户的同意限制用户的活动、向用户核实有关资料、发出警告通知、暂时中止、无限期中止及拒绝向该用户提供服务：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">A、用户以非自然人名义进行认证之后认证主体自行注销或者经有权机关吊销或撤销的；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">B、用户违反本协议或本网站其他相关规则；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">C、存在用户或其他第三方通知本网站，认为某个用户或具体交易事项存在违法或不当行为，并提供相关证据，而本网站无法联系到该用户核证或验证该用户向本网站提供的任何资料；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">D、存在用户或其他第三方通知本网站，认为某个用户或具体交易事项存在违法或不当行为，并提供相关证据。本网站以普通非专业人员的知识水平标准对相关内容进行判别，可以明显认为这些内容或行为可能对他方或本网站造成财务损失或承担法律责任。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">7、根据国家法律、法规、行政规章规定、本协议的内容和本网站所掌握的事实依据，可以认定该用户存在违法或违反本协议行为以及在本网站交易平台上的其他不当行为，本网站有权无需征得用户的同意在本网站交易平台及所在网站上以网络发布形式公布该用户的违法行为，并有权随时作出删除相关信息、终止提供服务等处理。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">8、本网站有权在不通知用户的前提下，删除或采取其他限制性措施处理下列信息：包括但不限于以规避费用为目的；以炒作信用为目的；存在欺诈等恶意或虚假内容；与网上交易无关或不是以交易为目的；存在恶意竞价或其他试图扰乱正常交易秩序因素；违反公共利益或可能严重损害本网站和其他用户合法利益。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第四条 服务的中断和终止</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、本网站可自行全权决定以任何理由(包括但不限于本网站认为用户已违反本协议及相关规则的字面意义和精神，或用户在超过180日内未登录本网站等)终止对用户的服务，并有权在两年内保存用户在本网站的全部资料（包括但不限于用户信息、产品信息、交易信息等）。同时本网站可自行全权决定，在发出通知或不发出通知的情况下，随时停止提供全部或部分服务。服务终止后，本网站没有义务为用户保留原账户中或与之相关的任何信息，或转发任何未曾阅读或发送的信息给用户或第三方。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、若用户申请终止本网站服务，需经本网站审核同意，方可解除与本网站的协议关系，但本网站仍保留下列权利：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">A、本网站有权在法律、法规、行政规章规定的时间内保留该用户的资料，包括但不限于以前的用户资料、交易记录等；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">B、若终止服务之前，该用户在本网站交易平台上存在违法行为或违反本协议的行为，本网站仍可行使本协议所规定的权利。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、用户存在下列情况，本网站可以终止向该用户提供服务：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">A、在用户违反本协议及相关规则规定时，本网站有权终止向该用户提供服务。本网站将在中断服务时通知用户。但该用户在被本网站终止提供服务后，再一次直接或间接或以他人名义注册为本网站用户的，本网站有权再次单方面终止为该用户提供服务；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">B、本网站发现用户注册资料中主要内容是虚假的，本网站有权随时终止为该用户提供服务；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">C、本协议终止或更新时，用户未确认新的协议的；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">D、其它本网站认为需终止服务的情况。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第五条 本网站的责任范围</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">当用户接受该协议时，用户应当明确了解并同意：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、本网站不能随时预见到任何技术上的问题或其他困难。该等困难可能会导致数据损失或其他服务中断。本网站是在现有技术基础上提供的服务。本网站不保证以下事项：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">A、本网站将符合所有用户的要求；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">B、本网站不受干扰、能够及时提供、安全可靠或免于出错；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">C、本服务使用权的取得结果是正确或可靠的。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、是否经由本网站下载或取得任何资料，由用户自行考虑、衡量并且自负风险，因下载任何资料而导致用户电脑系统的任何损坏或资料流失，用户应负完全责任。希望用户在使用本网站时，小心谨慎并运用常识。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、用户经由本网站取得的建议和资讯，无论其形式或表现，绝不构成本协议未明示规定的任何保证。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">4、基于以下原因而造成的利润、商誉、使用、资料损失或其它无形损失，本网站不承担任何直接、间接、附带、特别、衍生性或惩罚性赔偿（即使本网站已被告知前款赔偿的可能性）：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">A、本网站的使用或无法使用；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">B、用户的传输或资料遭到未获授权的存取或变更；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">C、本网站中任何第三方之声明或行为；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">D、本网站在服务交易中为用户提供交易机会，推荐交易方；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">E、本网站其它相关事宜。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第六条 知识产权</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、本网站及本网站所使用的任何相关软件、程序、内容，包括但不限于作品、图片、档案、资料、网站构架、网站版面的安排、网页设计、经由本网站或广告商向用户呈现的广告或资讯，均由本网站或其它权利人依法享有相应的知识产权，包括但不限于著作权、商标权、专利权或其它专属权利等，受到相关法律的保护。未经本网站或权利人明示授权，用户保证不修改、出租、出借、出售、散布本网站及本网站所使用的上述任何资料和资源，或根据上述资料和资源制作成任何种类产品。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、本网站授予用户不可转移及非专属的使用权，使用户可以通过单机计算机使用本网站的目标代码（以下简称“软件”），但用户不得且不得允许任何第三方复制、修改、创作衍生作品、进行还原工程、反向组译，或以其它方式破译或试图破译源代码，或出售、转让“软件”或对“软件”进行再授权，或以其它方式移转“软件”之任何权利。用户同意不以任何方式修改“软件”，或使用修改后的“软件”。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、用户不得经由非本网站所提供的界面使用本网站。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第七条 隐私权</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、信息使用</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">A、本网站不会向任何人出售或出借用户的个人或法人信息，除非事先得到用户得许可；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">B、本网站亦不允许任何第三方以任何手段收集、编辑、出售或者无偿传播用户的个人或法人信息。任何用户如从事上述活动，一经发现，本网站有权立即终止与该用户的服务协议，查封其账号。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、信息披露</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">A、经用户同意，向第三方披露；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">B、用户在使用本网站过程中涉及到知识产权类纠纷，有他方主张权利的，本网站在审核主张方提交的资料后认为披露用户信息有助于纠纷解决的；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">C、根据法律的有关规定，或者行政、司法机关的要求，向第三方或者行政、司法机关披露；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">D、若用户出现违反中国有关法律或者网站规定的情况，需要向第三方披露；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">E、为提供你所要求的产品和服务，而必须和第三方分享用户的个人或法人信息；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">F、其它本网站根据法律或者网站规定认为合适的披露。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">用户或者第三方申请本网站披露其他用户信息的，本网站有权视实际情况要求申请人出具申请书，申请书内容应包含申请披露的信息范围、用途及使用承诺等内容。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、信息安全</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">A、在使用本网站服务进行网上交易时，请用户妥善保护自己的个人或法人信息，仅在必要的情形下向他人提供；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">B、如果用户发现自己的个人或法人信息泄密，尤其是用户账户或“支付账户管理”账户及密码发生泄露，请用户立即联络本网站客服，以便我们采取相应措施。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第八条 不可抗力</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">因不可抗力或者其他意外事件，使得本协议的履行不可能、不必要或者无意义的，双方均不承担责任。本合同所称之不可抗力意指不能预见、不能避免并不能克服的客观情况，包括但不限于战争、台风、水灾、火灾、雷击或地震、罢工、暴动、法定疾病、黑客攻击、网络病毒、电信部门技术管制、政府行为或任何其它自然或人为造成的灾难等客观情况。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第九条 保密</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">用户保证在使用本网站过程中所获悉的属于拣豆网及他方的且无法自公开渠道获得的文件及资料（包括但不限于商业秘密、公司计划、运营活动、财务信息、技术信息、经营信息及其他商业秘密）予以保密。未经该资料和文件的原提供方同意，用户不得向第三方泄露该商业秘密的全部或者部分内容，否则，自行承担所引起的后果及法律责任。但法律、法规、行政规章另有规定或者双方另有约定的除外。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第十条 交易纠纷解决办法</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、本协议及其规则的有效性、履行和与本协议及其规则效力有关的所有事宜，将受中华人民共和国法律管辖，任何争议仅适用中华人民共和国法律。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、本网站有权受理并调处您与其他用户因交易服务产生的纠纷，同时有权单方面独立判断其他用户对您的举报及索偿是否成立。本网站没有使用自用资金进行偿付的义务，但若进行了该等支付，您应及时赔偿本网站的全部损失，如仍无法弥补损失，则本网站保留继续追偿的权利。因本网站非司法机关，您完全理解并承认，本网站对证据的鉴别能力及对纠纷的处理能力有限，受理交易纠纷完全是基于您之委托，不保证处理结果符合您的期望。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、凡因履行本协议及其规则发生的纠纷以及在本网站上交易产生的所有纠纷，各方可协商解决，若协商不成的，各方一致同意提交上海仲裁委员会按其仲裁规则进行仲裁。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第十一条 完整协议</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">本协议由本协议条款与</span><a href=\"http://jeendon.com/rules-center/rules-detail.html?rules_id=89\" target=\"_blank\" textvalue=\"《拣豆网服务规则总则》\"><span style=\"color: rgb(84, 141, 212);\">《拣豆网服务规则总则》</span></a><span style=\"color: rgb(0, 0, 0);\">、</span><a href=\"http://jeendon.com/rules-center/rules-detail.html?rules_id=91\" target=\"_blank\" textvalue=\"《需求发布及处理规则》\"><span style=\"color: rgb(84, 141, 212);\">《需求发布及处理规则》</span></a><span style=\"color: rgb(0, 0, 0);\">、</span><a href=\"http://jeendon.com/rules-center/rules-detail.html?rules_id=92\" target=\"_blank\" textvalue=\"《工程师竞标规范》\"><span style=\"color: rgb(84, 141, 212);\">《工程师竞标规范》</span></a><span style=\"color: rgb(0, 0, 0);\">等本网站公示的各项规则组成，相关名词可互相引用参照，如有不同理解，以本协议条款为准。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">您对本协议理解和认同，您即对本协议所有组成部分的内容理解并认同，一旦您使用本服务，你和本公司即受本协议所有组成部分的约束。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第十二条 拣豆网对本服务协议包括基于本服务协议制定的各项规则拥有最终解释权。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第十三条 附则</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">在本协议中所使用的下列词语，除非另有定义，应具有以下含义：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">“本网站”在无特别说明情况下，均指“拣豆网”（</span><a href=\"http://www.jeendon.com/\" style=\"text-decoration: underline; color: rgb(84, 141, 212);\"><span style=\"color: rgb(84, 141, 212);\">www.jeendon.com</span></a><span style=\"color: rgb(0, 0, 0);\">）。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">“用户”：是指具有完全民事行为能力的拣豆网各项服务的使用者；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">“雇主”：是指在本网站上进行需求发布或购买增值服务等“买”操作的用户。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">“工程师”：是指在本网站上参加竞标、出售技能或服务等“卖”操作的用户。</span></p>','5','0','1483001460','1488073642','','1','1','','0');
INSERT INTO `dp_rules` (`rules_id`,`rules_name`,`rules_title`,`rules_content`,`rules_ruletype_id`,`rules_add_user`,`rules_addtime`,`rules_updatetime`,`rules_reviewtime`,`rules_order`,`rules_show`,`rules_extarar`,`rules_isshow`) VALUES
('89','服务规则','拣豆网服务规则总则','<p style=\"text-align: center; line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>第一章 概述</strong><br/></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第一条 为推动传统工作方式的转变和汽车冲压模具技术服务类非实物交易的繁荣，保障拣豆网用户的合法权益，维护拣豆网的正常经营秩序，根据国家相关法律法规及</span><a href=\"http://jeendon.com/rules-center/rules-detail.html?rules_id=88\" target=\"_self\" style=\"color: rgb(84, 141, 212); text-decoration: underline;\"><span style=\"color: rgb(84, 141, 212);\">《拣豆网服务协议》</span></a><span style=\"color: rgb(0, 0, 0);\">，制定本规则。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第二条 用户在拣豆网上交易，应当遵循平等、自愿、诚实守信原则。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第三条 违规行为的认定与处理，应基于拣豆网认定的事实并严格依规执行。拣豆网用户在适用本规则上一律平等。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第四条 用户应当遵守国家法律、法规、行政规章的规定。对任何涉嫌违法法律、法规、行政规章的行为，本规则已有规定的，适用本规则；本规则尚无规定的，拣豆网有权酌情处理；但拣豆网对用户的处理不免除其应当承担的法律责任。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>用户在拣豆网上的全部行为仅代表其个人或法人，不代表拣豆网，基于该行为的全部责任应当由用户自行承担。</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>&nbsp;</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>在拣豆网上完成的交易，除法律规定不能转让或用户另有约定外，交易中涉及的相关任务成果的所有权（包括知识产权）全部归雇主所有。</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>&nbsp;</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>用户在拣豆网注册为用户时起，即表示全部接受并同意本规则，否则不能使用拣豆网交易平台的各项服务。拣豆网有权随时修改本规则并在网站上予以公告。在公告之日起，若用户不同意相关修改条款的，应当立即停止使用拣豆网的相关服务或产品；若用户继续使用，则视为接受并同意修改后的规则。</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">拣豆网有权对用户行为及适用的规则进行单方认定，并据此处理。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"text-align: center; line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>第二章 定义</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第一条 名词解释</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、“本网站”在无特别说明情况下，均指“拣豆网”（</span><a href=\"http://www.jeendon.com/\" style=\"text-decoration: underline; color: rgb(84, 141, 212);\"><span style=\"color: rgb(84, 141, 212);\">www.jeendon.com</span></a><span style=\"color: rgb(0, 0, 0);\">）。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、“用户”：是指具有完全民事行为能力的拣豆网各项服务的使用者；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、“雇主”：是指在本网站上进行需求发布或购买增值服务等“买”操作的用户。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">4、“工程师”：是指在本网站上参加竞标、出售技能或服务等“卖”操作的用户。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">5、“发布需求”：是指雇主通过拣豆网进行需求发布的行为。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">6、“竞标报价”：是指工程师在拣豆网上参与雇主发布的需求任务的竞价的行为。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">7、“雇主选标”：是指雇主根据工程师的报价以及工程师背景选定工程师为其提供服务的行为；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">8、“费用托管”：是指雇主在拣豆网上发布需求，完成工程师选择时，先支付到拣豆网作为交易担保资金的行为。</span></p><p style=\"line-height: 2em;\"><span style=\"line-height: 2em; color: rgb(0, 0, 0);\">9、“弃标”：是指工程师在雇主完成定标后，工程师主动放弃订单的行为；</span><br/></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">10、“BOM表”：是指在模具图纸绘制完成后，将图纸中的物料按照一定的标号规则制定的素材表，一般也称之为五金素材表；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"text-align: center; line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>第三章 注册认证须知</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第一条 用户可以通过手机进行注册登录本网站，但是未经认证的用户不能进行需求发布、竞标报价等活动，也不享有本网站已经认证会员所享有的权利及服务。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第二条 用户在本网站注册为会员时，首先应明确告知本网站是哪类用户（雇主或者工程师），以便本网站给您提供及时及更有效的服务。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第三条 如果用户需要进行需求发布、竞标报价等活动，需要首先完成认证方可进行，不同的用户身份需要提供相应的认证资料。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第四条 用户在认证时，应保证所填写的信息真实，并理解和同意拣豆网将会采用相应的方法对用户所提供的信息进行核实，如发现所提供的信息与实际不符，拣豆网将不会通过用户的认证申请；对任何存在问题或可疑的认证信息，拣豆网有权要求用户进行修正、解释或提供证明文件。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"text-align: center; line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>第四章 服务流程及管理细则</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第一条 需求发布</span></p><p style=\"line-height: 2em;\"><span style=\"text-decoration: none; color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"text-decoration: none; color: rgb(0, 0, 0);\">具体规则详见</span><a href=\"http://jeendon.com/rules-center/rules-detail.html?rules_id=91\" target=\"_self\" style=\"text-decoration: underline; color: rgb(84, 141, 212);\"><span style=\"color: rgb(84, 141, 212);\">《需求发布与处理规则》</span></a><span style=\"text-decoration: none; color: rgb(0, 0, 0);\">；</span></p><p style=\"line-height: 2em;\"><span style=\"text-decoration: none; color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"text-decoration: none; color: rgb(0, 0, 0);\">第二条 工程师竞标报价</span></p><p style=\"line-height: 2em;\"><span style=\"text-decoration: none; color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"text-decoration: none; color: rgb(0, 0, 0);\">具体规范详见</span><a href=\"http://jeendon.com/rules-center/rules-detail.html?rules_id=92\" target=\"_self\" style=\"text-decoration: underline; color: rgb(84, 141, 212);\"><span style=\"color: rgb(84, 141, 212);\">《工程师竞标规范》</span></a><span style=\"text-decoration: none; color: rgb(0, 0, 0);\">；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第三条 雇主选标</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、雇主在定标时，应秉承公平、平等的原则对待每一位参与竞标的工程师；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、雇主根据工程师的报价及工程师的评价信息，为需求任务选定工程师为其提供服务，选定工程师时，需将相应费用到拣豆网进行托管；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、只有雇主托管费用后，雇主与工程师的买卖关系才视为确立，工程师开始工作；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">4、雇主可以向某个或者某些已经参与报价的工程师发出议价要求，一旦雇主向工程师发送议价要求，则该工程师有1次且仅有1次重新报价的机会。</span></p><p style=\"line-height: 2em;\"><br/></p><p style=\"line-height: 2em;\"><span style=\"line-height: 2em; color: rgb(0, 0, 0);\">第四条 费用支付</span><br/></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">具体规则详见</span><a href=\"http://jeendon.com/rules-center/rules-detail.html?rules_id=91\" target=\"_self\" style=\"text-decoration: underline; color: rgb(84, 141, 212);\"><span style=\"color: rgb(84, 141, 212);\">《需求发布与处理规则》</span></a><span style=\"text-decoration: none; color: rgb(0, 0, 0);\">；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第五条 开立发票</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、工程师有责任和义务配合雇主开立满足要求的规范发票。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、本平台上的所有工程师报价均为不含税价格，如雇主需要发票请在选择工程师前与其明确开立发票需要补齐的税费事宜。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、若双方就发票事宜达成一致，工程师不得拒开发票、开立假发票、延迟开票、不配合开票、发票不清晰等违规行为。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">4、工程师需自行邮寄发票，并承担邮寄运费。</span></p><p style=\"line-height: 2em;\"><span style=\"line-height: 2em; color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第六条 评价</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">雇主可以对已完成的工程师提供的服务进行评价。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">好评率的计算规则：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">好评率=所有收到好评个数/所有收到评价总数</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"text-align: center; line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>第五章 通用违规处罚</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第一节 违规处理措施</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第一条 为保障雇主、工程师或拣豆网的正当权益，在用户违规处理期间，拣豆网将按照本规则规定的情形对用户采取以下违规处理：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、屏蔽信息：指对需求、评论等信息进行屏蔽和删除；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、限制评论：指禁止发表评论；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、取消中标：指取消中标工程师的中标资格；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">4、限制竞标：指禁止工程师参与需求竞标动作；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">5、限制发布需求：指限制雇主发布需求；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">6、查封账号：指限制违规用户的活动，或者永久封停。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第二节 违规行为及处罚</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第一条 若用户发布的信息被认定为以下行为的，本网站将屏蔽该信息：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、发布垃圾广告：指用户发布与需求要求无关、对需求完成没有帮助或者与本网站所涉及的专业不同的广告信息的行为；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、信息含联系方式：指用户发布的信息里含有联系方式（包含但不限于QQ、微信号、电话、网址、二维码、条形码、邮箱等）；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、发布敏感信息：指用户发布法律、法规、行政规章禁止发布的信息或者其他违背社会公序良俗等方面的信息；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">4、发布淫秽色情信息：指用户发布淫秽色情、低俗等信息；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">发布的信息包括但不限于以下情形：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、发布需求</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、需求竞标</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、交易评价</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">4、用户信息</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第二条 工程师在履行服务时存在以下行为，本网站视此工程师主动弃标：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、拒不修改图纸审图问题的：工程师拒绝雇主提出的需求范围内的合理的修改要求；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、无理要求追加费用的：工程师中标后，无理由要求雇主增加费用的行为；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、无能力完成工作：工程师中标后，没有能力完成雇主的需求任务；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">4、工程师失去联系或无法沟通：若出现以下情况将认定服务商失去联系或无法沟通：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; A、本网站在接到雇主反映联系不上工程师后，通过电话、短信、邮件、站内信等方式联系工程师，在48小时内仍无法和工程师取得联系的情况；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; B、雇主有证据能证明工程师在未进行事先告知的情况下，连续72小时都联系不上工程师的情况；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; C、更换联系方式未通知本网站或对方，以致在争议处理过程中无法联系；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; D、本网站三次联系（无论任何途径）均无法在纠纷上进行实质沟通；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; E、拒接电话、无人接听、在通话中因不属于本网站的原因中断等任何一种或各种情况累计达三次；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; F、恶意辱骂工作人员的导致无法沟通。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">雇主举报工程师在履行服务时存在以上行为，一旦成立，本网站视此工程师主动弃标，全部已托管款项退还雇主。</span></p><p style=\"line-height: 2em;\"><span style=\"line-height: 2em;\">&nbsp;</span><br/></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第四条 虚假交易：是指工程师通过虚构或隐瞒交易事实、利用或规避信用记录规则、干扰或妨害信用记录秩序等不正当方式获取虚假的销量、好评、等级积分等不当利益，破坏正常交易秩序的行为。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">虚假交易行为包括但不限于：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、通过大幅度修改服务价格，来提高销量的；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、工程师引导雇主定标，在全额支付后，对雇主进行汇款、转账而进行变相返现退款的行为；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">工程师进行虚假交易的，本网站将根据违规行为的情节进行纠正并处罚，包括但不限于删除虚假交易产生的销量、好评等，情节严重的，将予以封号处理。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第五条 如用户被认定存在以下行为，本网站将对此用户进行永久封号处理；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、盗用他人账户：指盗用其他人的拣豆网账户，涉嫌侵犯他人财产权的行为；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、骗取他人财物：指用户通过本网站以非法获利为目的，非法获取他人财物，涉嫌侵犯他人财产权的行为。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">本总规则自发布之日起实施。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">本总规则最终解释权归拣豆网所有。</span></p><p><br/></p>','5','0','1483001460','1488765192','','2','1','','0');
INSERT INTO `dp_rules` (`rules_id`,`rules_name`,`rules_title`,`rules_content`,`rules_ruletype_id`,`rules_add_user`,`rules_addtime`,`rules_updatetime`,`rules_reviewtime`,`rules_order`,`rules_show`,`rules_extarar`,`rules_isshow`) VALUES
('90','图纸规范','图纸规范','<p>结构图纸</p>','5','0','1483001520','1485222780','','5','0','','0');
INSERT INTO `dp_rules` (`rules_id`,`rules_name`,`rules_title`,`rules_content`,`rules_ruletype_id`,`rules_add_user`,`rules_addtime`,`rules_updatetime`,`rules_reviewtime`,`rules_order`,`rules_show`,`rules_extarar`,`rules_isshow`) VALUES
('91','需求发布','需求发布与处理规则','<p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第一条 为维护拣豆网（以下简称为“本网站”）正常运营秩序，推动汽车冲压模具技术服务类非实物交易的繁荣，保障需求顺利进行，根据</span><a href=\"http://jeendon.com/rules-center/rules-detail.html?rules_id=88\" target=\"_blank\" textvalue=\"《拣豆网服务协议》\"><span style=\"color: rgb(84, 141, 212);\">《拣豆网服务协议》</span></a><span style=\"color: rgb(0, 0, 0);\">及</span><a href=\"http://jeendon.com/rules-center/rules-detail.html?rules_id=89\" target=\"_blank\" textvalue=\"《拣豆网服务规则总则》\"><span style=\"color: rgb(84, 141, 212);\">《拣豆网服务规则总则》</span></a><span style=\"color: rgb(0, 0, 0);\">，制定本规则。<br/></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第二条 雇主发布需求需要符合国家法律法规以及拣豆网关于需求的相关规定。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>雇主在发布需求时已经了解和同意，本网站仅是提供相关服务的平台，其以往交易的案例仅供参考。</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong>雇主已经了解并同意：在发布需求时，雇主上传到平台上的数据一经上传，本网站即认为所有的数据都是可以在平台上发布的，雇主已经得到了相关人或机构的许可，本网站没有义务对此项许可进行核实取证，如雇主未得到许可，所产生的后果由雇主自行承担。</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第三条 凡是违反宪法精神和中华人民共和国相关法律法规、带有民族歧视性、夸大宣传并带有欺骗性、有损于社会主义道德风尚或有其他不良影响的需求，本网站将拒绝提供服务。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第四条 本网站为专业的汽车冲压模具技术服务类交易平台，仅接受并发布汽车冲压模具技术服务类需求，其他非汽车冲压模具技术服务类需求暂时不提供服务。</span></p><ol class=\"custom_num list-paddingleft-1\"><li class=\"list-num-1-1 list-num-paddingleft-1\"><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、以下需求由于违法法律、法规和本网站相关规则而禁止发布：</span></p></li></ol><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; A、 侵犯第三方知识产权的需求；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; B、 侵犯第三方权利的需求；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; C、 含有联系方式的需求（联系方式包括但不限于电话、QQ、邮箱、网址等）；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; D、 其他违反法律、法规、行政规章等相关规定的需求。</span></p><ol class=\"custom_num list-paddingleft-1\"><li class=\"list-num-1-1 list-num-paddingleft-1\"><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、以下需求可能对交易参与方或第三方带来损害而禁止发布：</span></p></li></ol><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; A、需要手机验证注册的需求；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; B、需要银行账号验证或者付费才能参与的需求；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; C、以招兼职为名进行欺骗的需求；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; D、可能套取需求参与方身份证、邮箱、手机号、银行账号等个人或机构隐私信息的需求；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; E、刷信用、账号买卖等需求；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; F、雇主发布虚假信息的需求；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; G、需求描述通过链接等方式逃避本网站审核的需求；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; H、可能给他人或者其他机构带来损害的需求；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; I、其他违背社会伦理或社会主流价值观的需求；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; J、需要线下转账、使用资金的需求。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第五条 需求发布</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、本网站为专业的汽车冲压模具技术服务类需求交易平台，本网站为雇主定制了发布需求的标准参考模板，雇主仅需要根据自身的需求进行填写或选择即可自助完成需求发布。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">本网站为雇主准备的发布需求的标准模板仅为一般通用型模板，不表示本网站为雇主发布的需求的描述的完整性负责，如雇主认为该模板未能完全描述其需求，则需自行添加附件说明；若因雇主发布的需求描述不完整而造成的后果由雇主自行承担。雇主有权选择使用或不使用本网站提供的模板。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、雇主在发布需求时，可以根据自身的项目时间要求，进行选择需求发布的持续时长，需求发布的持续时长最长不超过7天，雇主在发布需求时已经了解和同意：本网站仅是为买卖双方提供信息的平台，本网站不做任何保证，雇主发布的需求可以在发布时限内寻找到合适的工程师，由于在时限内没有工程师接单而造成雇主的项目时间损失，本网站没有义务负任何责任。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、雇主在发布需求时，可以根据自身的项目时间要求，自主确定完成需求任务的期限。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">4、需求一经发布，所发布的信息内容将不可修改。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">5、需求发布后，如在雇主定义的发布持续时长内，没有100%完成该需求的定标工作，即在需求中仍有任务没有工程师报价的或者没有雇主满意的工程师时，雇主可以自主决定：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; A、执行已经被投标的任务，雇主选定工程师，支付相应费用到本网站托管，其余未被投标的任务重新发布；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; B、不执行已经被投标的任务，关闭该需求，雇主可自行决定是否重新发布整个订单需求；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">6、雇主在使用本网站时已经理解和同意：同一需求禁止同一时间重复发布，若雇主重复发布，本网站将关闭重复的需求，如雇主发布的重复的需求中均有工程师竞标，并雇主都有选定工程师，并且工程师提交了相应成果，则雇主需要支付所有需求中的相关费用，雇主需自行承担损失，若雇主拒绝执行付款，则本网站将强制执行。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">7、需求内容中不得含有任何联系方式。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第六条 制度保障</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">雇主违反该规则的，按照</span><a href=\"http://jeendon.com/rules-center/rules-detail.html?rules_id=89\" target=\"_blank\" textvalue=\"《拣豆网服务规则总则》\"><span style=\"color: rgb(84, 141, 212);\">《拣豆网服务规则总则》</span></a><span style=\"color: rgb(0, 0, 0);\">及其他相关细则的相关规则进行处理。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第七条 费用支付</span></p><ol class=\"custom_num list-paddingleft-1\"><li class=\"list-num-1-1 list-num-paddingleft-1\"><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、当符合下列条件时，拣豆网将根据约定将相应费用支付给工程师：</span></p></li></ol><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; A、工程师按照雇主的要求完成了所有工作内容，并到达约定的付款节点；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; B、雇主在任务完成前提前结束任务，雇主需按照比例支付工程师相应费用；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; C、当工程师提交了最终任务成果，在雇主完成下载后，该任务的状态即变更为雇主下载状态，相应款项的请款申请倒计时就开始计算：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; 1）如果在这之后的一段时间内（视任务类型不同而不同，具体参见第十条），雇主没有任何反对付款的意见，则视为雇主接受工程师提交的任务成果，并同意支付相应费用给工程师；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; 2）或者在此期间，雇主主动确认该任务的成果可以接受并同意付款，则3天后工程师就可以通过平台申请相应款项了；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; 3）1）、2）中的两个时间节点，平台将按照先到原则处理。</span></p><ol class=\"custom_num list-paddingleft-1\"><li class=\"list-num-1-1 list-num-paddingleft-1\"><p style=\"line-height: 2em;\"><span style=\"line-height: 2em; color: rgb(0, 0, 0);\">2、雇主在收到任务成果后，如果没有充足的证据证明任务成果不可用，雇主均需支付相应费用；如任务成果中有瑕疵，双方可协商扣款处理。</span><br/></p></li></ol><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第八条 需求退款/扣款</span></p><ol class=\"custom_num list-paddingleft-1\"><li class=\"list-num-1-1 list-num-paddingleft-1\"><p style=\"line-height: 2em;\"><span style=\"line-height: 2em; color: rgb(0, 0, 0);\">1、工程师中途停止提供服务，雇主托管的费用将全款退还雇主；</span><br/></p></li><li class=\"list-num-1-2 list-num-paddingleft-1\"><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、雇主有充足的证据证明工程师提供的任务成果不可用，雇主有权申请退款/扣款，也可以要求工程师修改。</span></p></li><li class=\"list-num-1-3 list-num-paddingleft-1\"><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、如果工程师拒绝执行雇主提出的合理的修改意见，雇主有权申请退款/扣款；</span></p></li><li class=\"list-num-1-4 list-num-paddingleft-1\"><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">4、如雇主恶意申请退款/扣款，或者对工程师提出刁难的问题，致使工程师无法继续提供服务的，经本网站核实后，将强制执行相应费用的支付。</span></p></li><li class=\"list-num-1-5 list-num-paddingleft-1\"><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">5、平台在收到雇主的退款/扣款申请后，将会在1个工作日内通知相应的工程师，工程师尽快处理雇主的诉求，在双方就退款/扣款事宜达成一致意见后，通知平台执行相应的操作。</span></p></li></ol><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第九条 需求的取消</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">在完成定标工作并已在本网站托管费用，任务即已开始，如果雇主提出取消任务的申请，平台将在1个工作日内通知工程师，工程师需与雇主联系确认取消任务的真实性，及应支付的报酬等事宜，双方就取消任务事宜协商完成后，通知平台进行相应的操作。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第十条 付款时间节点</span></p><ol class=\"custom_num list-paddingleft-1\"><li class=\"list-num-1-1 list-num-paddingleft-1\"><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、工艺图纸类</span></p></li></ol><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; A、工程师根据雇主的需求提供了所有工艺图纸文件，如工法图（排序图）、CAE模拟分析文件等，在雇主完成下载90天后，雇主没有做出任何反对付款的反馈，本网站将按照约定支付工程师该任务服务费用总额的80%；或者在雇主完成下载后，主动确认任务成果可以接受并同意付款。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; B、如果雇主在支付80%总费用后30天内没有任何的反馈意见或扣款意见，本网站将支付全部剩余的20%费用给工程师；</span></p><ol class=\"custom_num list-paddingleft-1\"><li class=\"list-num-1-1 list-num-paddingleft-1\"><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、结构图纸类</span></p></li></ol><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; A、工程师根据雇主的需求提供了所有结构图纸文件，如结构图、单件图、五金素材表等，在雇主完成下载45天后，雇主没有做出任何反对付款的反馈，本网站将按照约定支付工程师该任务服务费用总额的80%；或者在雇主完成下载后，主动确认任务成果可以接受并同意付款。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; B、如果雇主在支付80%总费用后45天内没有任何的反馈意见或扣款意见，本网站将支付全部剩余的20%费用给工程师；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第十一条 违约责任</span></p><ol class=\"custom_num list-paddingleft-1\"><li class=\"list-num-1-1 list-num-paddingleft-1\"><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、雇主责任：</span></p></li></ol><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">若由于雇主原因，造成交易无法完成的，工程师不承担任何责任。</span></p><ol class=\"custom_num list-paddingleft-1\"><li class=\"list-num-1-1 list-num-paddingleft-1\"><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、工程师责任：</span></p></li></ol><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">若工程师不能按照要求完成需求任务，本网站将按照拣豆网相应规则进行处罚。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第十二条 本规则自发布之日起施行。</span></p><p><br/></p>','5','0','1483001580','1488768432','','3','1','','0');
INSERT INTO `dp_rules` (`rules_id`,`rules_name`,`rules_title`,`rules_content`,`rules_ruletype_id`,`rules_add_user`,`rules_addtime`,`rules_updatetime`,`rules_reviewtime`,`rules_order`,`rules_show`,`rules_extarar`,`rules_isshow`) VALUES
('92','竞标报价','工程师竞标规范','<p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第一条 为维护拣豆网（以下简称为“本网站”）正常运营秩序，推动汽车冲压模具技术服务类非实物交易的繁荣，保障需求顺利进行，根据</span><a href=\"http://jeendon.com/rules-center/rules-detail.html?rules_id=88\" target=\"_blank\" textvalue=\"《拣豆网服务协议》\" style=\"text-decoration: underline; color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0);\">《拣豆网服务协议》</span></a><span style=\"color: rgb(0, 0, 0);\">及</span><a href=\"http://jeendon.com/rules-center/rules-detail.html?rules_id=89\" target=\"_blank\" textvalue=\"《拣豆网服务规则总则》\" style=\"text-decoration: underline; color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0);\">《拣豆网服务规则总则》</span></a><span style=\"color: rgb(0, 0, 0);\">，制定本规则。<br/></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第二条 若您已经进行竞标报价，即表示您已充分阅读、理解、并同意自己与本网站订立本协议，且您自愿接受本协议的条款约束。本网站有权随时变更本协议并在本网站上予以公告。经修订的条款一经在本网站公告后，立即自动生效。如您不同意相关变更，必须停止竞标行为。本协议内容包括协议正文及所有拣豆网已经发布的各类规则。所有规则为本协议不可分割的一部分，与本协议正文具有同等法律效力。一旦您继续进行竞标行为，则表示您已经接受并自愿遵守经修改后的条款。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第三条 工程师在本网站上参与竞标，应当遵守法律、法规、行政规章的规定和拣豆网服务协议相关规则，工程师禁止参与违规需求，否则一切不利后果由其本人承担。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第四条 工程师应当遵守国家法律、法规、行政规章的规定。对任何涉嫌违反法律、法规、行政规章的行为，本规则已有规定的，适用本规则；本规则尚无规定的，本网站有权酌情处理；但本网站对违规工程师的处理不免除其应当承担的法律责任。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第五条 工程师应当保证竞标中的所有信息真实、可靠。不得夸大或者伪造自身经历和技能水平，以影响需求方判断或骗取需求方信任。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第六条 工程师不得捏造、散布不实言论、诋毁、污蔑其他工程师，进行不正当竞争。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第七条 工程师的竞标不得含有任何联系方式（包括但不限于QQ、电话、邮箱等）。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"line-height: 2em; color: rgb(0, 0, 0);\">第八条 如果雇主向某个或某些已经参与其任务报价的工程师发起议价要求，则该工程师有一次且仅有一次重新报价的机会。<br/></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第九条 认证为个人的工程师在同一时间内不能通过拣豆网承接两项或两项以上的需求任务，同一时间是指：“在工程师被某任务的雇主选定，并且该雇主托管了费用，直到该需求任务状态变更为雇主下载状态”，不能参与下一项需求任务的报价。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第十条 工程师应当保证在本网站获得的任何数据（包括但不限于需求方提供的需求文件），如未经当事人许可，不得以任何方式转交给第三方或者给第三方查看，如果工程师有违反，所引起的后果自行承担。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第十一条 无效竞标的判定：</span></p><ol class=\"custom_num list-paddingleft-1\"><li class=\"list-num-1-1 list-num-paddingleft-1\"><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、恶意竞价，工程师以过高或过低的价格来扰乱市场，一经发现则视为该工程师的该项竞价无效，本网站将视情况停止为其继续提供服务；</span></p></li><li class=\"list-num-1-2 list-num-paddingleft-1\"><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、在竞标过程中，如发现参与竞标的工程师的信息存在虚假情况，则视为该工程师的该项竞价无效，并且本网站将停止为其继续提供服务；</span></p></li></ol><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第十二条 工程师提供的任务成果，在需求方通过平台完成第一次付款后，该任务成果的所有权将归需求方所有。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><br/></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第十三条 如雇主需要工程师配合签署纸质版合同，工程师需无条件予以配合，合同条款双方应本着友好合作的原则共同协商。</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">第十四条 本规则自发布之日起施行。</span></p>','5','0','1483001580','1491961572','','4','1','','0');
INSERT INTO `dp_rules` (`rules_id`,`rules_name`,`rules_title`,`rules_content`,`rules_ruletype_id`,`rules_add_user`,`rules_addtime`,`rules_updatetime`,`rules_reviewtime`,`rules_order`,`rules_show`,`rules_extarar`,`rules_isshow`) VALUES
