INSERT INTO `dp_rules` (`rules_id`,`rules_name`,`rules_title`,`rules_content`,`rules_ruletype_id`,`rules_add_user`,`rules_addtime`,`rules_updatetime`,`rules_reviewtime`,`rules_order`,`rules_show`,`rules_extarar`,`rules_isshow`) VALUES
('94','常见问题','常见问题','<p style=\"line-height: 2em;\"><a name=\"1\"></a><br/></p><p style=\"line-height: 2em;\"><a href=\"#拣豆网是做什么的？\" target=\"_self\" style=\"line-height: 2em; color: rgb(0, 0, 0); text-decoration: none;\"><strong><strong style=\"color: rgb(255, 0, 0);\">Q：</strong>拣豆网是做什么的？</strong></a><br/></p><p style=\"line-height: 2em;\"><a href=\"#如何注册，有哪些要求？\" target=\"_self\" style=\"color: rgb(0, 0, 0); text-decoration: none;\"><strong><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>如何注册，有哪些要求？<a name=\"2\"></a></span></strong></a></p><p style=\"line-height: 2em;\"><a href=\"#如何认证，有哪些要求？\" target=\"_self\" style=\"color: rgb(0, 0, 0); text-decoration: none;\"><strong><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>如何认证，有哪些要求？</span></strong></a></p><p style=\"line-height: 2em;\"><a href=\"#认证需要费用吗？\" target=\"_self\" style=\"color: rgb(0, 0, 0); text-decoration: none;\"><strong><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>认证需要费用吗？</span></strong></a></p><p style=\"line-height: 2em;\"><a href=\"#如何发布需求？\" target=\"_self\" style=\"color: rgb(0, 0, 0); text-decoration: none;\"><strong><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>如何发布需求？</span></strong></a></p><p style=\"line-height: 2em;\"><a href=\"#发布需求收费吗？\" target=\"_self\" style=\"color: rgb(0, 0, 0); text-decoration: none;\"><strong><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>发布需求收费吗？</span></strong></a></p><p style=\"line-height: 2em;\"><a href=\"#如何参与竞标报价？\" target=\"_self\" style=\"color: rgb(0, 0, 0); text-decoration: none;\"><strong><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>如何参与竞标报价？</span></strong></a></p><p style=\"line-height: 2em;\"><a href=\"#参与竞标报价收费吗？\" target=\"_self\" style=\"color: rgb(0, 0, 0); text-decoration: none;\"><strong><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>参与竞标报价收费吗？</span></strong></a></p><p style=\"line-height: 2em;\"><a href=\"#什么时候工程师开始工作？\" target=\"_self\" style=\"line-height: 2em; color: rgb(0, 0, 0); text-decoration: none;\"><strong><strong style=\"color: rgb(255, 0, 0);\">Q：</strong>什么时候工程师开始工作？</strong></a><br/></p><p style=\"line-height: 2em;\"><a href=\"#什么时候付款给工程师？\" target=\"_self\" style=\"color: rgb(0, 0, 0); text-decoration: none;\"><strong><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>什么时候付款给工程师？</span></strong></a></p><p style=\"line-height: 2em;\"><a href=\"#如果工程师中标后拒绝提供服务或者中途不干了，怎么办？\" target=\"_self\" style=\"color: rgb(0, 0, 0); text-decoration: none;\"><strong><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>如果工程师中标后拒绝提供服务或者中途不干了，怎么办？</span></strong></a></p><p style=\"line-height: 2em;\"><a href=\"#如果工程师拒绝按照审图意见修改图纸，怎么办？\" target=\"_self\" style=\"color: rgb(0, 0, 0); text-decoration: none;\"><strong><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>如果工程师拒绝按照审图意见修改图纸，怎么办？</span></strong></a></p><p style=\"line-height: 2em;\"><a href=\"#如果图纸出现质量或进度问题，如何解决？雇主可以扣款吗？\" target=\"_self\" style=\"color: rgb(0, 0, 0); text-decoration: none;\"><strong><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>如果图纸出现质量或进度问题，如何解决？雇主可以扣款吗？</span></strong></a></p><p style=\"line-height: 2em;\"><a href=\"#工作进行中的需求任务，如果雇主要取消任务，怎么办？\" target=\"_self\" style=\"line-height: 2em; color: rgb(0, 0, 0); text-decoration: none;\"><strong><strong style=\"color: rgb(255, 0, 0);\">Q：</strong>工作进行中的需求任务，如果雇主要取消任务，怎么办？</strong></a><br/></p><p style=\"line-height: 2em;\"><strong style=\"color: rgb(0, 0, 0); text-decoration: none;\"><span style=\"color: rgb(0, 0, 0);\"><a href=\"#需求任务的价格由谁来定？\" target=\"_self\" style=\"color: rgb(0, 0, 0); text-decoration: none;\"><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>需求任务的价格由谁来定？</a></span></strong></p><p><br clear=\"all\" style=\";page-break-before:always\"/></p><p style=\"line-height: 2em;\"><a name=\"拣豆网是做什么的？\"></a><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>拣豆网是做什么的？</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 176, 80);\"><strong>A：</strong></span><span style=\"color: rgb(0, 0, 0);\">拣豆网是由上海简豆网络科技有限公司开发和运营的为汽车冲压模具设计类工作提供服务的平台，平台致力于网罗优秀的模具设计工程师，使中小模具企业享受到更优质的设计服务，也同时使大型的模具企业更有效合理的进行人才的培养和储备，提升汽车冲压模具设计制造的整体水平。</span><span style=\"color: rgb(0, 176, 240);\"> &nbsp; &nbsp;&nbsp;</span><a href=\"#1\" target=\"_self\" style=\"color: rgb(0, 176, 240); font-size: 12px; text-decoration: none;\"><span style=\"color: rgb(0, 176, 240); font-size: 12px;\">返回</span></a></p><p style=\"line-height: 2em;\"><a name=\"如何注册，有哪些要求？\"></a><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>如何注册，有哪些要求？</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(0, 176, 80); line-height: 32px; white-space: normal;\">A：</strong>通过手机即可注册为拣豆网会员，在注册为会员时，您需要选择您注册的会员身份；会员身份分为雇主和工程师两种。如果您需要发布需求或者是参与竞标报价则需要先通过平台认证后才能继续。<span style=\"line-height: 32px; color: rgb(0, 176, 240);\">&nbsp;&nbsp; &nbsp;&nbsp;</span></span><a href=\"#1\" target=\"_self\" textvalue=\"返回\" style=\"font-size: 12px; color: rgb(0, 176, 240); text-decoration: none;\"><span style=\"font-size: 12px; color: rgb(0, 176, 240);\">返回</span></a></p><p style=\"line-height: 2em;\"><a name=\"如何认证，有哪些要求？\"></a><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>如何认证，有哪些要求？</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(0, 176, 80); line-height: 32px; white-space: normal;\">A：</strong>根据您注册为不同的会员身份，需要提供不同的认证资料用来证明您的身份合法、并且作为工程师有能力参与竞标报价工作。为了保证买卖双方的合法权益，平台可以根据现有的判断您提供资料的合法性，并最终决定是否您是否通过认证。<span style=\"line-height: 32px; color: rgb(0, 176, 240);\">&nbsp;&nbsp; &nbsp;&nbsp;</span></span><a href=\"#1\" target=\"_self\" style=\"font-size: 12px; color: rgb(0, 176, 240); text-decoration: none;\"><span style=\"font-size: 12px; color: rgb(0, 176, 240);\">返回</span></a></p><p style=\"line-height: 2em;\"><a name=\"认证需要费用吗？\"></a><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>认证需要费用吗？</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(0, 176, 80); line-height: 32px; white-space: normal;\">A：</strong>不需要。但是如因您虚报或捏造认证资料而给对方造成损失的，一切损失将由您个人承担，并且平台保留因您虚报或捏造认证资料给平台带来的损失的追索权利。<span style=\"line-height: 32px; color: rgb(0, 176, 240);\">&nbsp;&nbsp; &nbsp;&nbsp;</span></span><a href=\"#1\" target=\"_self\" textvalue=\"返回\" style=\"font-size: 12px; color: rgb(0, 176, 240); text-decoration: none;\"><span style=\"font-size: 12px; color: rgb(0, 176, 240);\">返回</span></a></p><p style=\"line-height: 2em;\"><a name=\"如何发布需求？\"></a><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>如何发布需求？</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(0, 176, 80); line-height: 32px; white-space: normal;\">A：</strong>注册成为雇主的会员在完成认证后，可以在首页或者是个人首页找到发布需求按钮，点击即可进入发布需求流程，拣豆网为雇主提供了相应的发布需求模板，以方便雇主给出完整的需求信息，同时方便工程师理解您的需求并给出合理的报价。<span style=\"line-height: 32px; color: rgb(0, 176, 240);\">&nbsp;&nbsp; &nbsp;&nbsp;</span></span><a href=\"#1\" target=\"_self\" style=\"font-size: 12px; color: rgb(0, 176, 240); text-decoration: none;\"><span style=\"font-size: 12px; color: rgb(0, 176, 240);\">返回</span></a></p><p style=\"line-height: 2em;\"><a name=\"发布需求收费吗？\"></a><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>发布需求收费吗？</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(0, 176, 80); line-height: 32px; white-space: normal;\">A：</strong>发布需求不收取任何费用。<span style=\"line-height: 32px; color: rgb(0, 176, 240);\">&nbsp; &nbsp; &nbsp;</span></span><a href=\"#1\" target=\"_self\" style=\"font-size: 12px; color: rgb(0, 176, 240); text-decoration: none;\"><span style=\"font-size: 12px; color: rgb(0, 176, 240);\">返回</span></a></p><p style=\"line-height: 2em;\"><a name=\"如何参与竞标报价？\"></a><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>如何参与竞标报价？</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(0, 176, 80); line-height: 32px; white-space: normal;\">A：</strong>注册为工程师的会员在完成认证后，可以通过项目大厅了解任务详情，并根据自己的实际情况给出报价和工期。<span style=\"line-height: 32px; color: rgb(0, 176, 240);\">&nbsp;&nbsp; &nbsp;&nbsp;</span></span><a href=\"#1\" target=\"_self\" textvalue=\"返回\" style=\"font-size: 12px; color: rgb(0, 176, 240); text-decoration: none;\"><span style=\"font-size: 12px; color: rgb(0, 176, 240);\">返回</span></a></p><p style=\"line-height: 2em;\"><a name=\"参与竞标报价收费吗？\"></a><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>参与竞标报价收费吗？</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(0, 176, 80); line-height: 32px; white-space: normal;\">A：</strong>工程师参与竞标报价不收取任何费用。<span style=\"line-height: 32px; color: rgb(0, 176, 240);\">&nbsp; &nbsp; &nbsp;</span></span><a href=\"#1\" target=\"_self\" textvalue=\"返回\" style=\"font-size: 12px; color: rgb(0, 176, 240); text-decoration: none;\"><span style=\"font-size: 12px; color: rgb(0, 176, 240);\">返回</span></a></p><p style=\"line-height: 2em;\"><a style=\"line-height: 2em;\" name=\"什么时候工程师开始工作？\"></a><span style=\"line-height: 2em;\">&nbsp;</span><br/></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>什么时候工程师开始工作？</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(0, 176, 80); line-height: 32px; white-space: normal;\">A：</strong>雇主在选定工程师后，将相应的费用托管到平台后，在平台收到相应款项后，工程师开始工作。<span style=\"line-height: 32px; color: rgb(0, 176, 240);\">&nbsp;&nbsp; &nbsp;&nbsp;</span></span><a href=\"#1\" target=\"_self\" textvalue=\"返回\" style=\"font-size: 12px; color: rgb(0, 176, 240); text-decoration: none;\"><span style=\"font-size: 12px; color: rgb(0, 176, 240);\">返回</span></a></p><p style=\"line-height: 2em;\"><a name=\"什么时候付款给工程师？\"></a><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>什么时候付款给工程师？</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(0, 176, 80); line-height: 32px; white-space: normal;\">A：</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">当符合下列条件时，拣豆网将根据雇主同意支付的指令，将相应费用支付给工程师：</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">1、工程师按照雇主的要求完成了所有工作内容，并到达约定的付款节点；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">2、雇主在任务完成前提前结束任务，雇主需按照比例支付工程师相应费用；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">3、到达付款节点，雇主没有主动给出付款指令，3天后本网站将按照约定将相应费用支付给工程师；</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\">4、工程师提交任务成果后，相应的时间内（不同的任务成果持续的时间不同），雇主没有给出否定的反馈，则视为雇主接受工程师提交的任务成果，并支付相应费用给工程师；<span style=\"line-height: 32px; color: rgb(0, 176, 240);\">&nbsp;&nbsp; &nbsp;&nbsp;</span></span><a href=\"#1\" target=\"_self\" textvalue=\"返回\" style=\"font-size: 12px; color: rgb(0, 176, 240); text-decoration: none;\"><span style=\"font-size: 12px; color: rgb(0, 176, 240);\">返回</span></a></p><p style=\"line-height: 2em;\"><a name=\"如果工程师中标后拒绝提供服务或者中途不干了，怎么办？\"></a><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>如果工程师中标后拒绝提供服务或者中途不干了，怎么办？</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(0, 176, 80); line-height: 32px; white-space: normal;\">A：</strong>如果工程师中标后拒绝提供服务或者中途不干了，将视为弃标，情节严重者，平台将对其永久性封号，并保留追索因此给平台造成的损失的权利。<span style=\"line-height: 32px; color: rgb(0, 176, 240);\">&nbsp; &nbsp; &nbsp;</span></span><a href=\"#1\" target=\"_self\" textvalue=\"返回\" style=\"font-size: 12px; color: rgb(0, 176, 240); text-decoration: none;\"><span style=\"font-size: 12px; color: rgb(0, 176, 240);\">返回</span></a></p><p style=\"line-height: 2em;\"><a name=\"如果工程师拒绝按照审图意见修改图纸，怎么办？\"></a><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>如果工程师拒绝按照审图意见修改图纸，怎么办？</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(0, 176, 80); line-height: 32px; white-space: normal;\">A：</strong>如果工程师拒绝按照合理的审图意见修改图纸，经过平台协调后无果的，将视为弃标，平台将对该工程师做出相应的处罚，情节严重者，平台将对其永久性封号。<span style=\"line-height: 32px; color: rgb(0, 176, 240);\">&nbsp;&nbsp; &nbsp;&nbsp;</span></span><a href=\"#1\" target=\"_self\" textvalue=\"返回\" style=\"font-size: 12px; color: rgb(0, 176, 240); text-decoration: none;\"><span style=\"font-size: 12px; color: rgb(0, 176, 240);\">返回</span></a></p><p style=\"line-height: 2em;\"><a name=\"如果图纸出现质量或进度问题，如何解决？雇主可以扣款吗？\"></a><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>如果图纸出现质量或进度问题，如何解决？雇主可以扣款吗？</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(0, 176, 80); line-height: 32px; white-space: normal;\">A：</strong>当图纸出现质量问题或进度延误情况，雇主有权要求工程师修改图纸或者追赶进度，在协商无果的情况下，雇主可以提出扣款要求，同时平台将会对该名工程师做出相应的处罚。<span style=\"line-height: 32px; color: rgb(0, 176, 240);\">&nbsp;&nbsp; &nbsp;&nbsp;</span></span><a href=\"#1\" target=\"_self\" textvalue=\"返回\" style=\"font-size: 12px; color: rgb(0, 176, 240); text-decoration: none;\"><span style=\"font-size: 12px; color: rgb(0, 176, 240);\">返回</span></a></p><p style=\"line-height: 2em;\"><a style=\"line-height: 2em;\" name=\"工作进行中的需求任务，如果雇主要取消任务，怎么办？\"></a><span style=\"line-height: 2em;\">&nbsp;</span><br/></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>工作进行中的需求任务，如果雇主要取消任务，怎么办？</strong> </span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(0, 176, 80); line-height: 32px; white-space: normal;\">A：</strong>如果雇主在任务开始后决定取消任务，需向平台提出申请，平台会通知工程师，由工程师与雇主确认取消任务的真实性，以及确定需要支付的报酬，双发协商完成后通知平台进行取消任务操作。<span style=\"line-height: 32px; color: rgb(0, 176, 240);\">&nbsp;&nbsp; &nbsp;&nbsp;</span></span><a href=\"#2\" target=\"_self\" textvalue=\"返回\" style=\"text-decoration: none;\"><span style=\"font-size: 12px; color: rgb(0, 176, 240);\">返回</span></a></p><p style=\"line-height: 2em;\"><a name=\"需求任务的价格由谁来定？\"></a><span style=\"color: rgb(0, 0, 0);\"><br/></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong><strong style=\"color: rgb(255, 0, 0); line-height: 32px; white-space: normal;\">Q：</strong>需求任务的价格由谁来定？</strong></span></p><p style=\"line-height: 2em;\"><span style=\"color: rgb(0, 0, 0);\"><strong style=\"color: rgb(0, 176, 80); line-height: 32px; white-space: normal;\">A：</strong>雇主将任务的需求说明通过拣豆网发布，工程师参加竞标报价，雇主最终将根据工程师的报价及工程师的信用评价等信息选定工程师；雇主在选定工程师前有一次提出议价要求的机会，而收到议价要求的工程师有且仅有1次重新报价的机会；平台不做任何保证工程师参与的竞标一定能够被雇主选中。<span style=\"line-height: 32px; color: rgb(0, 176, 240);\">&nbsp;&nbsp; &nbsp;&nbsp;</span></span><a href=\"#2\" target=\"_self\" textvalue=\"返回\" style=\"text-decoration: none;\"><span style=\"font-size: 12px; color: rgb(0, 176, 240);\">返回</span></a></p><p style=\"line-height: 2em;\"><br/></p>','6','0','1483001640','1488769756','','3','1','','0');
