('96','支付方式','支付方式','<p style=\"line-height: 3em;\"><span style=\"color: rgb(192, 0, 0);\"><strong>友情提示：</strong></span></p><p style=\"line-height: 3em; text-indent: 2em;\"><span style=\"color: rgb(0, 0, 0);\">请您在汇款后第一时间通过电话（4008018535）告知我们您的汇款银行、金额、时间及用户名信息，或者直接将汇款凭证发邮件（邮箱：service@jeendon.com）给我们，以便平台及时为您查账充值。</span></p><p style=\"line-height: 3em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 3em;\"><span style=\"color: rgb(0, 0, 0);\">银行账户：</span></p><p style=\"line-height: 3em;\"><span style=\"color: rgb(0, 0, 0);\">开 户 行：中国农业银行股份有限公司上海东开支行</span></p><p style=\"line-height: 3em;\"><span style=\"color: rgb(0, 0, 0);\">账 &nbsp; 号：03801320040057786</span></p><p style=\"line-height: 3em;\"><span style=\"color: rgb(0, 0, 0);\">户 &nbsp; 名：上海简豆网络科技有限公司</span></p><p style=\"line-height: 3em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;&nbsp;</span></p><p style=\"line-height: 3em;\"><span style=\"color: rgb(0, 0, 0);\">支付宝账户：</span></p><p style=\"line-height: 3em;\"><span style=\"color: rgb(0, 0, 0);\">账 户 名：</span><a href=\"mailto:pay@jeendon.com\" style=\"color: rgb(0, 0, 0); text-decoration: underline;\"><span style=\"color: rgb(0, 0, 0);\">pay@jeendon.com</span></a></p><p style=\"line-height: 3em;\"><span style=\"color: rgb(0, 0, 0);\">公司名称：上海简豆网络科技有限公司</span></p><p style=\"line-height: 3em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p>','4','0','1483508880','1485224216','','3','1','/attachement/doc/admin/2017/01/16/587c88c3e83d4.zip','0');
