INSERT INTO `dp_rules` (`rules_id`,`rules_name`,`rules_title`,`rules_content`,`rules_ruletype_id`,`rules_add_user`,`rules_addtime`,`rules_updatetime`,`rules_reviewtime`,`rules_order`,`rules_show`,`rules_extarar`,`rules_isshow`) VALUES
('103','注册认证','注册认证','<p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">为推动传统工作方式的转变和汽车冲压模具技术服务类非实物交易的繁荣，保障拣豆网用户的合法权益，维护拣豆网的正常经营秩序，您注册认证为本平台用户应满足并完全同意本平台的相关规则规定，以下是对相关规则规定中用户注册认证的解释说明：</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第一条 用户资格</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、只有符合下列条件之一的自然人或法人才能申请成为本网站用户，可以使用本网站的服务：</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">A、年满十八岁，并具有民事权利能力和民事行为能力的自然人；</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">B、无民事行为能力人或限制民事行为能力人应经过其监护人的同意；</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">C、根据中国法律、法规、行政规章成立并合法存在的机关、企事业单位、社团组织和其他组织。无法人资格的单位或组织不当注册为本网站用户的，其与本网站之间的协议自始无效，本网站一经发现，有权立即终止对该用户的服务，并追究其使用本网站服务的一切法律责任。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、用户需要提供明确的联系地址和联系电话，并提供真实姓名或名称，以及所有本网站要求的相关证明文件。</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">3、本网站用户须承诺遵守法律法规、社会主义制度、国家利益、公民合法权益、公共秩序、社会道德风尚和信息真实性。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第二条 雇主注册认证</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、雇主可以注册认证为公司或者个人两种身份；</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、雇主需要提供不同身份的证明文件；</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第三条 工程师注册认证</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、工程师可以注册认证为公司、工作组和个人三种身份；</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、工程师需要提供不同身份的证明文件；</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; A、注册认证为公司的工程师，需提供企业的营业执照等文件、申请人的授权委托书以及其他说明文件；</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; B、注册认证为工作组的工程师，需要提供申请人的个人身份证明文件并说明组员情况，为了有效的证实工作组的工作能力，申请人需提供组员的相关证明文件；</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">&nbsp; C、注册认证为个人的工程师，需要提供申请人的个人身份证明已经技术能力的证明文件；</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第四条 信息使用</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\"><br/></span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">1、本网站不会向任何人出售或出借用户的个人或法人信息，除非事先得到用户得许可；</span></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">2、本网站亦不允许任何第三方以任何手段收集、编辑、出售或者无偿传播用户的个人或法人信息。任何用户如从事上述活动，一经发现，本网站有权立即终止与该用户的服务协议，查封其账号。</span></p><p><br/></p><p style=\"line-height: 1.75em;\"><span style=\"color: rgb(0, 0, 0);\">第五条 其他说明参见平台相关规则规定。</span></p>','6','0','1488769800','1488770895','','2','0','','0');
