  `fin_examine_add_time` int(11) DEFAULT NULL COMMENT '审核的时间',
  `fin_engineer_id` int(11) NOT NULL COMMENT '上传工程师id',
  `fin_task_id` int(11) NOT NULL COMMENT '任务的id',
  `fin_size` int(11) NOT NULL COMMENT '上传文件的大小',
  `fin_suffix` varchar(32) NOT NULL COMMENT '上传文件的后缀',
  `fin_add_time` int(11) DEFAULT NULL COMMENT '上传时间',
  `fin_examine_status` tinyint(4) DEFAULT '102' COMMENT '100：通过 101：未通过 102 ：未审核',
  `fin_examine_opinion` varchar(255) DEFAULT NULL COMMENT '审核的意见',
  `fin_examine_opinion_upload` varchar(255) DEFAULT NULL COMMENT '审核的文件上传',
  `fin_upload_number_emp` int(11) DEFAULT '0' COMMENT '雇主下载次数',
  `fin_emp_confirm` tinyint(255) DEFAULT '102' COMMENT '雇主是否同意100：同意 101：不同意 102：未确认',
  `task_emp_confirm_add_time` tinyint(4) DEFAULT NULL,
  PRIMARY KEY (`fin_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_financial_flow`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_financial_flow`;
CREATE TABLE IF NOT EXISTS `dp_financial_flow` (
  `fin_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增长id',
  `fin_money` decimal(4,0) NOT NULL COMMENT '财务流水的金额',
  `fin_type` tinyint(4) DEFAULT NULL COMMENT '财务流水的方向进账或者出账 1：进账 2：出账',
  `fin_source` varchar(255) DEFAULT NULL COMMENT '财务流水的来源 雇主订单支付 雇主充值 雇主订单退款 工程师项目资金 平台费用收取  雇主发票扣款 等',
  `fin_out_id` int(11) DEFAULT NULL COMMENT '出账方 用户id',
  `fin_in_id` int(11) DEFAULT NULL COMMENT '进账方用户id',
  `fin_add_time` int(11) DEFAULT NULL COMMENT '操作时间',
  `fin_explain` varchar(255) DEFAULT NULL COMMENT '解释说明',
  `fin_pay_type` varchar(255) DEFAULT NULL COMMENT '支付的方式',
  PRIMARY KEY (`fin_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_financial_record`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_financial_record`;
CREATE TABLE IF NOT EXISTS `dp_financial_record` (
  `finance_id` int(11) NOT NULL AUTO_INCREMENT,
  `finance_pay_type` tinyint(4) NOT NULL COMMENT '支付类型',
  `finance_add_time` int(11) NOT NULL COMMENT '添加时间',
  `finance_in_out` tinyint(2) NOT NULL COMMENT '进出账 1：进账 2：出账',
  `finance_money` decimal(10,0) NOT NULL,
  `finance_operator_id` int(11) NOT NULL COMMENT '操作人id',
  `finance_explain` varchar(255) NOT NULL COMMENT '说明',
  `finance_influence_id` int(11) NOT NULL,
  `finance_balance_money` decimal(4,0) NOT NULL,
  PRIMARY KEY (`finance_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_gonggao`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_gonggao`;
CREATE TABLE IF NOT EXISTS `dp_gonggao` (
  `not_id` int(11) NOT NULL AUTO_INCREMENT,
  `not_name` varchar(128) DEFAULT NULL,
  `not_title` varchar(255) DEFAULT NULL,
  `not_content` text,
  `not_order` tinyint(4) DEFAULT NULL,
  `not_show` tinyint(4) DEFAULT NULL,
  `not_addtime` int(11) DEFAULT NULL,
  `not_updatetime` int(11) DEFAULT NULL,
  `not_adduser` varchar(128) DEFAULT NULL,
  `not_url` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`not_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COMMENT='首页公告';

-- -------------------------------------------
-- TABLE `dp_invoice_data`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_invoice_data`;
CREATE TABLE IF NOT EXISTS `dp_invoice_data` (
  `invoice_data_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '发票资料信息表自增长id',
  `invoice_data_rise` varchar(255) DEFAULT NULL COMMENT '发票抬头',
  `invoice_data_type` tinyint(4) DEFAULT NULL COMMENT '发票类型1：普通发票2：增值税发票',
  `invoice_data_phone` varchar(11) DEFAULT NULL COMMENT '联系方式手机号码',
  `invoice_data_zip_code` int(6) DEFAULT NULL,
  `invoice_data_address` varchar(255) DEFAULT NULL COMMENT '发票寄送地址',
  `invoice_data_emp_id` int(11) DEFAULT NULL COMMENT '雇主id',
  `invoice_data_add_time` int(11) DEFAULT NULL COMMENT '发票添加时间',
  `invoice_data_update_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`invoice_data_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_invoice_order`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_invoice_order`;
CREATE TABLE IF NOT EXISTS `dp_invoice_order` (
  `invoice_order_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '发票订单id',
  `invoice_order_number` varchar(32) DEFAULT NULL COMMENT '发票订单编号',
  `invoice_order_pay_type` tinyint(4) DEFAULT NULL COMMENT '订单支付类型 1：支付宝支付 2：后台支付 3：余额支付',
  `invoice_order_pay_time` int(11) DEFAULT NULL COMMENT '支付时间',
  `invoice_order_pay_total_money` decimal(4,0) DEFAULT NULL COMMENT '订单支付总金额',
  `invoice_order_trade_no` varchar(255) DEFAULT NULL COMMENT '支付宝支付订单号',
  `invoice_order_add_time` int(11) DEFAULT NULL,
  `invoice_order_order_id` int(11) DEFAULT NULL COMMENT '发票关联订单id',
  `invoice_order_invoice_data_id` int(11) DEFAULT NULL COMMENT '关联发票资料id',
  `invoice_order_status` tinyint(4) DEFAULT '100' COMMENT '订单状态100：未支付 101：已支付 102：审核中 103：发送中 104：已完成',
  `invoice_order_employer_id` int(11) DEFAULT NULL COMMENT '雇主id',
  `invoice_order_courier_number` varchar(64) DEFAULT NULL COMMENT '快递单号',
  PRIMARY KEY (`invoice_order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_menu`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_menu`;
CREATE TABLE IF NOT EXISTS `dp_menu` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(128) NOT NULL,
  `parent` int(11) DEFAULT NULL,
  `route` varchar(255) DEFAULT NULL,
  `order` int(11) DEFAULT '0',
  `data` text,
  `type` tinyint(4) DEFAULT '2',
  `shortroute` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`),
  KEY `parent` (`parent`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COMMENT='菜单';

-- -------------------------------------------
-- TABLE `dp_message`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_message`;
CREATE TABLE IF NOT EXISTS `dp_message` (
  `mes_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增长id',
  `mes_addtime` int(11) NOT NULL COMMENT '站内消息添加时间',
  `mes_title` varchar(255) NOT NULL COMMENT '消息的标题',
  `mes_release_user` int(11) DEFAULT NULL COMMENT '发布人',
  `mes_type` int(11) NOT NULL DEFAULT '2' COMMENT '消息类型 1：站内系统消息，2：站内管理员发布消息',
  `mes_status` tinyint(4) NOT NULL COMMENT '消息状态 1：未审核，2：审核，3：未浏览查看，4：已浏览查看',
  `mes_times` int(11) DEFAULT '0' COMMENT '浏览查看的次数',
  `mes_handle_userinfo` varchar(255) DEFAULT NULL COMMENT '浏览查看的用户信息',
  `mes_sourse_id` varchar(64) DEFAULT NULL COMMENT '站内消息源id',
  `mes_content` varchar(255) DEFAULT NULL COMMENT '站内消息内容',
  `mes_issuer` int(11) DEFAULT NULL COMMENT '签收人',
  `mes_class` tinyint(4) DEFAULT '1' COMMENT '消息类型 1：审核消息，2：查看浏览消息',
  `mes_module` varchar(32) DEFAULT NULL COMMENT '消息模块',
  PRIMARY KEY (`mes_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_navigation`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_navigation`;
CREATE TABLE IF NOT EXISTS `dp_navigation` (
  `nav_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键自增',
  `nav_title` varchar(255) DEFAULT NULL COMMENT '菜单名称',
  `nav_lv` smallint(6) DEFAULT NULL COMMENT '导航层级',
  `nav_order` int(11) DEFAULT NULL COMMENT '导航排序',
  `nav_href` varchar(255) DEFAULT NULL COMMENT '链接',
  `nav_hot` int(1) DEFAULT '0' COMMENT '热门',
  `nav_show` int(1) DEFAULT '1' COMMENT '是否在首页显示',
  `nav_name` varchar(255) DEFAULT NULL,
  `nav_parent` varchar(255) DEFAULT NULL,
  `nav_type` tinyint(4) DEFAULT NULL,
  PRIMARY KEY (`nav_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COMMENT='页面导航表';

-- -------------------------------------------
-- TABLE `dp_news`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_news`;
CREATE TABLE IF NOT EXISTS `dp_news` (
  `news_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `news_name` varchar(255) NOT NULL COMMENT '新闻名称',
  `news_title` varchar(255) NOT NULL COMMENT '新闻标题',
  `news_pic` varchar(255) DEFAULT NULL COMMENT '新闻图片路径',
  `news_content` longtext NOT NULL COMMENT '新闻内容',
  `news_column` int(11) NOT NULL COMMENT '所属栏目id',
  `news_department_audit` int(11) DEFAULT '1' COMMENT '部门审核 1 未审核 2 已审核 3 未通过',
  `news_add_user` int(11) NOT NULL COMMENT '上传的管理员id',
  `news_review_user` int(11) DEFAULT NULL COMMENT '审核员id',
  `news_addtime` int(11) NOT NULL COMMENT '添加时间',
  `news_updatetime` int(11) DEFAULT NULL COMMENT '修改时间',
  `news_reviewtime` int(255) DEFAULT NULL COMMENT '审核时间',
  `news_eye` int(11) DEFAULT '0' COMMENT '浏览数',
  PRIMARY KEY (`news_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_news_column`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_news_column`;
CREATE TABLE IF NOT EXISTS `dp_news_column` (
  `news_column_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `news_column_name` varchar(255) NOT NULL COMMENT '新闻栏目名称',
  `news_column_department` longtext NOT NULL COMMENT '可添加该栏目部门',
  `news_column_admin` varchar(255) NOT NULL COMMENT '添加管理员',
  `news_column_show` int(11) NOT NULL DEFAULT '1' COMMENT '新闻栏目是否在前台显示',
  `news_column_addtime` int(11) NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`news_column_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_notice`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_notice`;
CREATE TABLE IF NOT EXISTS `dp_notice` (
  `not_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '通知的自增长id',
  `not_content` text NOT NULL COMMENT '消息的内容',
  `not_type` varchar(32) NOT NULL DEFAULT '1' COMMENT '通知的类型',
  `not_add_time` int(11) DEFAULT NULL COMMENT '添加时间',
  `not_phone` varchar(11) DEFAULT NULL COMMENT '发送的手机号码',
  `not_email` varchar(50) DEFAULT NULL,
  `not_mode` tinyint(2) NOT NULL DEFAULT '1' COMMENT '消息的方式(1：短信2：邮箱)',
  `not_status` varchar(255) DEFAULT NULL,
  `sub_code` varchar(255) DEFAULT NULL,
  `sub_msg` varchar(255) DEFAULT NULL COMMENT '消息的作用',
  `not_effect` varchar(255) DEFAULT NULL COMMENT '通知的作用',
  PRIMARY KEY (`not_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COMMENT='首页公告';

-- -------------------------------------------
-- TABLE `dp_offer`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_offer`;
CREATE TABLE IF NOT EXISTS `dp_offer` (
  `offer_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增长id',
  `offer_money` decimal(11,0) NOT NULL COMMENT '报价金额',
  `offer_add_time` int(11) DEFAULT NULL COMMENT '报价时间',
  `offer_eng_id` int(11) DEFAULT NULL COMMENT '报价工程师id',
  `offer_whether_hide` tinyint(4) DEFAULT NULL COMMENT '报价仅采购商和设计师本人可见 100：隐藏 101 显示',
  `offer_task_id` int(11) DEFAULT NULL COMMENT '报价任务的id',
  `offer_cycle` int(11) DEFAULT NULL COMMENT '报价周期',
  `offer_explain` varchar(255) DEFAULT NULL COMMENT '报价说明',
  `offer_status` tinyint(4) DEFAULT '102' COMMENT '报价状态 100：中标 101：未中标 102：未选标',
  `offer_bargain` tinyint(4) DEFAULT '100' COMMENT '是否发起议价申请 101：发起 100未发起',
  `offer_bargain_add_time` int(11) DEFAULT NULL COMMENT '议价发起的时间',
  `offer_bargain_time` int(11) DEFAULT NULL COMMENT '工程师修改议价的时间',
  `offer_bargain_status` tinyint(4) DEFAULT '100' COMMENT '工程师是否参与议价100：未议价 101：已经议价',
  `offer_bargain_before_money` decimal(11,0) DEFAULT NULL COMMENT '议价前金额',
  `offer_money_eng` decimal(11,0) DEFAULT NULL COMMENT '工程师实际报价',
  `offer_money_before_eng` decimal(11,0) DEFAULT NULL COMMENT '议价前工程师报价',
  `offer_order_money_status` int(11) DEFAULT '100' COMMENT '保证金是否退还',
  `offer_order_money` decimal(10,0) DEFAULT NULL COMMENT '保证金退还金额',
  `offer_order_money_time` int(11) DEFAULT NULL COMMENT '退还保证金时间',
  `offer_order_pay_money` decimal(11,0) DEFAULT NULL COMMENT '保证金金额',
  `offer_order_money_admin` decimal(10,0) DEFAULT NULL,
  PRIMARY KEY (`offer_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_offer_order`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_offer_order`;
CREATE TABLE IF NOT EXISTS `dp_offer_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `offerorder_number` varchar(32) DEFAULT NULL COMMENT '报价订单编号',
  `offerorder_money` decimal(10,0) DEFAULT NULL COMMENT '报价订单的金额',
  `offerorder_eng_id` int(11) DEFAULT NULL COMMENT '报价工程师ID',
  `offerorder_task_id` int(11) DEFAULT NULL COMMENT '报价订单任务ID',
  `offerorder_status` int(11) DEFAULT NULL COMMENT '报价订单的支付状态',
  `offerorder_add_time` int(11) DEFAULT NULL,
  `offerorder_cycle` int(11) DEFAULT NULL,
  `offerorder_pay_time` int(11) DEFAULT NULL,
  `offer_money` int(11) DEFAULT NULL,
  `offerorder_trade_no` varchar(128) DEFAULT NULL,
  `offerorder_pay_type` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_order`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_order`;
CREATE TABLE IF NOT EXISTS `dp_order` (
  `order_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增长id',
  `order_number` varchar(32) DEFAULT NULL COMMENT '订单编号',
  `order_type` tinyint(2) DEFAULT NULL COMMENT '订单类型(1：工艺 2：结构）',
  `order_describe` varchar(255) DEFAULT NULL COMMENT '订单描述',
  `order_achievements` varchar(64) DEFAULT NULL COMMENT '需要提交的成果',
  `order_design_software_version` varchar(255) DEFAULT '' COMMENT '设计软件及版本',
  `order_whether_parameter` int(4) DEFAULT '1' COMMENT '是否参数化设计 1：是 2：否',
  `order_parking_system` varchar(32) DEFAULT NULL COMMENT '车场体系',
  `order_part_standard` varchar(32) DEFAULT NULL COMMENT '标准件标准',
  `order_part_number` tinyint(4) DEFAULT NULL COMMENT '零件数（一个订单包含的零件数）',
  `order_task_number` tinyint(2) DEFAULT NULL COMMENT '总任务数',
  `order_bidding_period` tinyint(4) DEFAULT NULL COMMENT '投标周期(2~7)',
  `order_supplementary_explanation` varchar(255) DEFAULT NULL COMMENT '补充说明（仅认证工程师可见）',
  `order_total_money` decimal(10,0) DEFAULT NULL COMMENT '订单总额',
  `order_turnover_money` decimal(10,0) DEFAULT NULL COMMENT '订单成交额',
  `order_add_time` int(11) DEFAULT NULL COMMENT '订单添加时间',
  `order_whether_upload` tinyint(2) DEFAULT NULL COMMENT '是否首次上传',
  `order_turnover_task` tinyint(2) DEFAULT NULL COMMENT '订单成交任务数',
  `order_pay_type` tinyint(2) DEFAULT NULL COMMENT '订单支付类型 1：支付宝支付 2：后台支付 3：余额支付',
  `order_pay_time` int(11) DEFAULT NULL COMMENT '支付时间',
  `order_employer_id` int(11) DEFAULT NULL COMMENT '雇主id',
  `order_multiple_production` tinyint(4) DEFAULT NULL COMMENT '多件生产 101：单件生产 102：双件生产 103：多件生产',
  `order_status` tinyint(4) DEFAULT '101' COMMENT '订单状态 100：发布中订单 101：发布完成:招标中  102：支付中 103：支付完成运行中  104：已完成 105：取消订单',
  `order_pay_total_money` decimal(10,0) DEFAULT NULL COMMENT '订单支付总金额',
  `trade_no` varchar(64) DEFAULT NULL COMMENT '支付宝支付订单号',
  `order_cancel_type` tinyint(4) DEFAULT NULL COMMENT '101：招标订单的取消 102：部分任务未支付订单的 103 ：进行中订单任务取消null : 招标过期的订单',
  `order_expiration_time` int(11) DEFAULT NULL COMMENT '订单过期时间',
  `order_item_code` varchar(128) DEFAULT NULL COMMENT '订单的项目项目的代号',
  `order_cancel_status` tinyint(4) DEFAULT NULL COMMENT '订单重发的状态100：未重新发布 101：重发成功 102：重发失败 ',
  `order_is_invoice` tinyint(4) DEFAULT '1' COMMENT '是否开发票1：未开 2：已开',
  `order_is_conducting` tinyint(255) DEFAULT '1',
  `order_whether_invoice` tinyint(4) DEFAULT NULL COMMENT '是否需要发票',
  `order_offer_email` int(11) DEFAULT '100',
  `order_offer_shortmessage` int(11) DEFAULT '100',
  PRIMARY KEY (`order_id`),
  UNIQUE KEY `index_order_number` (`order_number`) USING BTREE COMMENT '订单号索引'
) ENGINE=InnoDB  DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_planning_task`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_planning_task`;
CREATE TABLE IF NOT EXISTS `dp_planning_task` (
  `planning_task_id` int(11) NOT NULL AUTO_INCREMENT,
  `planning_task_title` varchar(255) DEFAULT NULL COMMENT '自护任务执行的标题',
  `planning_task_content` text COMMENT '计划任务执行的内容',
  `planning_task_status` tinyint(4) DEFAULT NULL COMMENT '计划任务执行的状态100：成功 101：失败',
  `planning_task_fail_causes` varchar(255) DEFAULT NULL COMMENT '执行错误的原因',
  `planning_task_add_time` int(11) DEFAULT NULL COMMENT '计划任务执行时间',
  `planning_task_new_run` tinyint(4) DEFAULT '101' COMMENT '是否后台重新执行100：是 101否',
  `planning_task_content_all` text COMMENT '发送失败的信息',
  `planning_task_type` tinyint(4) DEFAULT '1' COMMENT '计划任务的类型',
  PRIMARY KEY (`planning_task_id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_platform`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_platform`;
CREATE TABLE IF NOT EXISTS `dp_platform` (
  `platform_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '应用平台id',
  `platform_name` varchar(255) NOT NULL COMMENT '应用平台名称',
  `platform_href` varchar(255) NOT NULL COMMENT '平台连接',
  `platform_show` int(1) NOT NULL DEFAULT '1' COMMENT '是否显示 1 默认显示 0 不显示',
  `platform_admin_name` varchar(255) NOT NULL COMMENT '管理员名称',
  `platform_addtime` int(11) NOT NULL COMMENT '平台信息添加时间',
  PRIMARY KEY (`platform_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_procedure`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_procedure`;
CREATE TABLE IF NOT EXISTS `dp_procedure` (
  `procedure_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增长id',
  `task_number` varchar(64) DEFAULT NULL COMMENT '工序编号(订单号-零件号-00N)',
  `task_part_id` int(11) NOT NULL COMMENT '工序零件编号',
  `task_duration` varchar(255) DEFAULT NULL COMMENT '任务工期(2~30）',
  `task_process_id` varchar(64) DEFAULT NULL COMMENT '工序工序别',
  `task_process_name` varchar(128) DEFAULT NULL COMMENT '工序工序名',
  `task_source_pressure` varchar(32) DEFAULT NULL COMMENT '工序压力源',
  `task_budget` decimal(10,2) DEFAULT NULL COMMENT '工序预算',
  PRIMARY KEY (`procedure_id`),
  UNIQUE KEY `index_task_number` (`task_number`) USING HASH COMMENT '任务编号索引'
) ENGINE=InnoDB  DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_process_file_send`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_process_file_send`;
CREATE TABLE IF NOT EXISTS `dp_process_file_send` (
  `processfile_send_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '过程文件发送记录id',
  `processfile_send_type` tinyint(4) DEFAULT NULL COMMENT '过程文件发送类型 1：过程文件1 2：过程文件2 3：过程文件3',
  `processfile_send_task_id` int(11) DEFAULT NULL COMMENT '关联的任务的id',
  `processfile_send_time` int(11) DEFAULT NULL COMMENT '过程文件提醒发送的时间',
  `processfile_send_eng_id` int(11) DEFAULT NULL,
  `processfile_send_add_time` int(11) DEFAULT NULL COMMENT '记录添加的时间',
  `processfile_send_status` tinyint(4) DEFAULT NULL COMMENT '是否已经发送',
  PRIMARY KEY (`processfile_send_id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_process_file_upload`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_process_file_upload`;
CREATE TABLE IF NOT EXISTS `dp_process_file_upload` (
  `proce_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增长id',
  `proce_href` varchar(128) NOT NULL COMMENT '过程文件的连接',
  `proce_task_id` int(11) NOT NULL,
  `proce_add_time` int(11) NOT NULL COMMENT '添加的时间',
  `proce_employer_id` int(11) NOT NULL COMMENT '上传的雇主id',
  `proce_name` varchar(64) NOT NULL COMMENT '上传文件文件名',
  `proce_size` int(11) NOT NULL COMMENT '文件大小',
  `proce_suffix` varchar(32) NOT NULL,
  PRIMARY KEY (`proce_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_rule_type`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_rule_type`;
CREATE TABLE IF NOT EXISTS `dp_rule_type` (
  `ruletype_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '规则分类',
  `ruletype_name` varchar(128) CHARACTER SET utf8 DEFAULT NULL COMMENT '规则分类的名称',
  `ruletype_order` tinyint(255) DEFAULT NULL COMMENT '规则分类的排序',
  `ruletype_add_time` int(11) DEFAULT NULL COMMENT '规则分类的添加时间',
  `ruletype_admin_id` varchar(32) DEFAULT NULL COMMENT '规则分类的添加人',
  `ruletype_show` tinyint(4) DEFAULT NULL COMMENT '是否在前台显示',
  PRIMARY KEY (`ruletype_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8mb4;

-- -------------------------------------------
-- TABLE `dp_rules`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_rules`;
CREATE TABLE IF NOT EXISTS `dp_rules` (
  `rules_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `rules_name` varchar(255) NOT NULL COMMENT '规则名称',
  `rules_title` varchar(255) NOT NULL COMMENT '规则标题',
  `rules_content` longtext NOT NULL COMMENT '规则内容',
  `rules_ruletype_id` int(11) NOT NULL COMMENT '所属分类id',
  `rules_add_user` int(11) NOT NULL COMMENT '上传的管理员id',
  `rules_addtime` int(11) NOT NULL COMMENT '添加时间',
  `rules_updatetime` int(11) DEFAULT NULL COMMENT '修改时间',
  `rules_reviewtime` int(255) DEFAULT NULL COMMENT '审核时间',
  `rules_order` tinyint(4) DEFAULT NULL,
  `rules_show` tinyint(4) DEFAULT '1' COMMENT '审核是否通过',
  `rules_extarar` varchar(255) DEFAULT NULL COMMENT '附件上传',
  `rules_isshow` tinyint(1) DEFAULT '0' COMMENT '规则访问是否可见,0,不可见，1全可见，2 认证可见',
  PRIMARY KEY (`rules_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_single_page`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_single_page`;
CREATE TABLE IF NOT EXISTS `dp_single_page` (
  `single_page_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `single_page_name` varchar(255) NOT NULL COMMENT '单页名称',
  `single_page_href` varchar(255) NOT NULL COMMENT '链接',
  `single_page_content` longtext COMMENT '单页内容',
  `single_page_show` int(1) NOT NULL DEFAULT '1' COMMENT '是否在前台显示 1 显示 2 隐藏',
  `single_page_addtime` int(11) NOT NULL COMMENT '单页添加时间',
  PRIMARY KEY (`single_page_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_slide`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_slide`;
CREATE TABLE IF NOT EXISTS `dp_slide` (
  `sli_id` int(11) NOT NULL AUTO_INCREMENT,
  `sli_name` varchar(128) DEFAULT NULL,
  `sli_pic` varchar(255) DEFAULT NULL,
  `sli_des` text,
  `sli_title` varchar(255) DEFAULT NULL,
  `sli_url` varchar(255) DEFAULT NULL,
  `sli_order` tinyint(4) DEFAULT NULL,
  `sli_show` tinyint(4) DEFAULT NULL,
  PRIMARY KEY (`sli_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COMMENT='首页幻灯片';

-- -------------------------------------------
-- TABLE `dp_spare_parts`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_spare_parts`;
CREATE TABLE IF NOT EXISTS `dp_spare_parts` (
  `task_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增长id',
  `task_order_id` int(11) DEFAULT NULL COMMENT '订单的id(关联订单表)',
  `task_part_type` tinyint(4) DEFAULT NULL COMMENT '零件的类型',
  `task_part_material` varchar(64) DEFAULT NULL COMMENT '零件的材质',
  `task_part_thick` decimal(10,2) DEFAULT NULL COMMENT '零件的板厚',
  `task_mold_type` tinyint(4) DEFAULT NULL COMMENT '模具类型',
  `task_mode_production` varchar(255) DEFAULT NULL COMMENT 'varchar',
  `task_mold_pieces` tinyint(4) DEFAULT NULL,
  `task_parts_number_mold` varchar(128) DEFAULT NULL,
  `task_parts_id` varchar(32) DEFAULT NULL,
  `task_final_file_href` varchar(255) DEFAULT NULL,
  `task_final_file_add_time` int(11) DEFAULT NULL,
  `task_process_file1_href` varchar(255) DEFAULT NULL,
  `task_process_file1_add_time` int(11) DEFAULT NULL,
  `task_process_file2_href` varchar(255) DEFAULT NULL,
  `task_process_file2_add_time` int(11) DEFAULT NULL,
  `task_process_file3_href` varchar(255) DEFAULT NULL,
  `task_process_file3_add_time` int(11) DEFAULT NULL,
  `task_employer_id` int(11) DEFAULT NULL,
  `task_start_time` int(11) DEFAULT NULL,
  `task_totalnum` varchar(32) DEFAULT NULL COMMENT '总工序数',
  `task_part_mumber` varchar(32) DEFAULT NULL COMMENT '零件号',
  `task_status` tinyint(4) DEFAULT NULL COMMENT '发布未完成 101：发布完成等待招标   102：支付中 103：支付完成进行中 104:最终成功上传 105:雇主下载 106：雇主待确认 107已完成 108：流拍 109：招标中任务取消 110：进行中任务取消 111',
  `task_cancel_status` tinyint(4) DEFAULT NULL COMMENT 'tinyint',
  `task_emp_confirm_add_time` int(11) DEFAULT NULL COMMENT '雇主确认时间',
  `task_emp_download_time` int(11) DEFAULT NULL COMMENT '雇主第一次下载时间',
  `task_type` int(11) DEFAULT NULL,
  `task_part_duration` int(11) DEFAULT NULL COMMENT '零件的工期要求',
  `task_offer_id` int(11) DEFAULT NULL COMMENT '雇主最终选的的报价单',
  `task_is_affect_eng` tinyint(4) DEFAULT '1' COMMENT '任务是否影响工程师1：没影响2：影响 ',
  PRIMARY KEY (`task_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_sqlbackstore`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_sqlbackstore`;
CREATE TABLE IF NOT EXISTS `dp_sqlbackstore` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `sql_name` varchar(128) NOT NULL COMMENT '数据库备份的名称',
  `sql_content` varchar(256) NOT NULL COMMENT '数据库备份的表名称集合',
  `sql_addtime` int(11) NOT NULL COMMENT '数据库备份的时间',
  `sql_size` decimal(10,0) NOT NULL COMMENT '数据库备份的文件大小',
  `sql_des` longtext,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COMMENT='数据库备份表';

-- -------------------------------------------
-- TABLE `dp_successful_case`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_successful_case`;
CREATE TABLE IF NOT EXISTS `dp_successful_case` (
  `successful_case_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '成功案例自增长id',
  `successful_case_task_id` int(11) DEFAULT NULL COMMENT '成功案例关联任务编号',
  `suceessful_case_cover` varchar(255) DEFAULT NULL,
  `suceessful_case_title` varchar(255) DEFAULT NULL COMMENT '成功案例标题',
  `suceessful_case_emp_id` int(11) DEFAULT NULL COMMENT '成功案例雇主id',
  `suceessful_case_eng_id` int(11) DEFAULT NULL COMMENT '成功案例工程师id',
  `suceessful_case_order` int(11) DEFAULT NULL COMMENT '成功案例排序',
  `suceessful_case_add_time` int(11) DEFAULT NULL COMMENT '成功案例添加时间',
  `suceessful_case_show` tinyint(4) DEFAULT '1' COMMENT '成功案例是否显示1：显示 2：不显示',
  `successful_case_picture` text COMMENT '成功案例图片（json）数据源',
  PRIMARY KEY (`successful_case_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 COMMENT='成功案例';

-- -------------------------------------------
-- TABLE `dp_task`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_task`;
CREATE TABLE IF NOT EXISTS `dp_task` (
  `task_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增长id',
  `task_number` varchar(64) DEFAULT NULL COMMENT '任务编号(订单号-零件号-00N)',
  `task_order_id` int(11) DEFAULT NULL COMMENT '订单编号',
  `task_part_type` tinyint(4) DEFAULT NULL COMMENT '零件类型',
  `task_part_material` varchar(64) DEFAULT '' COMMENT '零件材料',
  `task_part_thick` decimal(10,2) DEFAULT NULL COMMENT '零件厚度',
  `task_mold_type` tinyint(4) DEFAULT NULL COMMENT '模具类型',
  `task_mode_production` varchar(255) DEFAULT '' COMMENT '生产方式',
  `task_mold_pieces` tinyint(4) DEFAULT NULL COMMENT '一模几件',
  `task_parts_number_mold` varchar(128) DEFAULT NULL COMMENT '零件数模(上传的路径)',
  `task_duration` varchar(255) DEFAULT NULL COMMENT '任务工期(2~30）',
  `task_type` tinyint(2) DEFAULT NULL COMMENT '任务的类型 1：工艺 2：结构',
  `task_final_file_href` varchar(128) DEFAULT NULL COMMENT '最终文件上传路径',
  `task_process_file1_href` varchar(128) DEFAULT NULL,
  `task_process_file2_href` varchar(128) DEFAULT NULL,
  `task_process_file3_href` varchar(128) DEFAULT NULL,
  `task_final_file_add_time` int(11) DEFAULT NULL,
  `task_process_file1_add_time` int(11) DEFAULT NULL,
  `task_process_file2_add_time` int(11) DEFAULT NULL,
  `task_process_file3_add_time` int(11) DEFAULT NULL,
  `task_employer_id` int(11) DEFAULT NULL,
  `task_start_time` int(11) DEFAULT NULL COMMENT '任务开始时间',
  `task_process_id` varchar(64) DEFAULT NULL COMMENT '工序别',
  `task_process_name` varchar(128) DEFAULT NULL COMMENT '工序名',
  `task_source_pressure` varchar(32) DEFAULT NULL COMMENT '压力源',
  `task_engineer_id` int(11) DEFAULT NULL,
  `task_part_mumber` varchar(32) DEFAULT NULL COMMENT '零件号(00N)',
  `task_totalnum` int(11) DEFAULT NULL COMMENT '总工序数',
  `task_parts_id` varchar(32) DEFAULT NULL COMMENT '零件序号唯一标识一个零件  一个唯一标识',
  `task_budget` decimal(10,0) DEFAULT '0' COMMENT '任务预算',
  `task_status` tinyint(4) DEFAULT '100' COMMENT '任务状态 100：发布未完成 101：发布完成等待招标   102：支付中 103：支付完成进行中 104:最终成功上传 105:平台审核 106:雇主下载 107：已完成 108：流拍 109：招标中任务取消 110：进行中任务取消 111：雇主待确认\n\n',
  `task_offer_id` int(11) DEFAULT NULL COMMENT '雇主最终选的的报价单',
  `task_cancel_status` tinyint(4) DEFAULT '0' COMMENT '任务是否重发过1：重新发过 0：未重新发过',
  `task_emp_confirm_add_time` int(11) DEFAULT NULL,
  `task_emp_download_time` int(11) DEFAULT NULL COMMENT '雇主第一次下载最终文件的时间',
  `task_is_affect_eng` tinyint(4) DEFAULT '1' COMMENT '任务是否影响工程师1：没影响2：影响 ',
  PRIMARY KEY (`task_id`),
  UNIQUE KEY `index_task_number` (`task_number`) USING HASH COMMENT '任务编号索引'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_task_cancellation_request`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_task_cancellation_request`;
CREATE TABLE IF NOT EXISTS `dp_task_cancellation_request` (
  `tcr_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增长主键',
  `tcr_task_id` int(11) DEFAULT NULL COMMENT '取消任务的id',
  `tcr_emp_id` int(11) DEFAULT NULL COMMENT '取消的任务雇主id',
  `tcr_add_time` int(11) DEFAULT NULL COMMENT '取消申请的提交时间',
  `tcr_status` tinyint(4) DEFAULT '100' COMMENT '申请的审核状态100：未审核 101：审核已通过 102：审核不通过',
  `tcr_examine_id` int(11) DEFAULT NULL COMMENT '审核人的id',
  `tcr_opinion` varchar(255) DEFAULT NULL COMMENT '审核的意见',
  `tcr_emp_money` decimal(4,0) DEFAULT NULL COMMENT '退还雇主的费用',
  `tcr_eng_money` decimal(4,0) DEFAULT NULL COMMENT '工程师得到的钱',
  `tcr_platform_money` decimal(4,0) DEFAULT NULL COMMENT '平台得到的钱',
  PRIMARY KEY (`tcr_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_upload`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_upload`;
CREATE TABLE IF NOT EXISTS `dp_upload` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `filename` varchar(255) DEFAULT NULL,
  `attachment` varchar(255) DEFAULT NULL,
  `type` int(11) DEFAULT NULL,
  `createtime` int(11) DEFAULT NULL,
  `uniacid` varchar(32) DEFAULT NULL,
  `name` varchar(64) CHARACTER SET utf8 DEFAULT NULL COMMENT '上传文件原名',
  `extension` varchar(64) CHARACTER SET utf8 DEFAULT NULL COMMENT '文件后缀',
  `order_id` int(11) DEFAULT NULL COMMENT '订单编号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB  DEFAULT CHARSET=gbk COMMENT='文件上传表';

-- -------------------------------------------
-- TABLE `dp_users`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_users`;
CREATE TABLE IF NOT EXISTS `dp_users` (
  `u_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户id',
  `u_name` varchar(50) NOT NULL COMMENT '用户名',
  `u_pass` varchar(255) NOT NULL COMMENT '用户密码',
  `u_points` int(50) DEFAULT '0' COMMENT '用户积分',
  `u_points_consumption` int(50) DEFAULT '0' COMMENT '已消费的积分',
  `u_points_all` int(50) DEFAULT '0' COMMENT '用户所有积分（已消费的和未消费的加起来）',
  `u_realname` varchar(50) DEFAULT NULL COMMENT '用户真实姓名',
  `u_phone` varchar(50) NOT NULL COMMENT '用户手机号',
  `u_phoneauthentication` tinyint(1) DEFAULT '1' COMMENT '手机号认证状态， 0 未认证 1已认证',
  `u_tel` varchar(50) DEFAULT NULL COMMENT '用户联系电话',
  `u_email` varchar(100) DEFAULT NULL COMMENT '用户邮箱',
  `u_address` varchar(255) DEFAULT NULL COMMENT '用户地址',
  `u_other` varchar(255) DEFAULT NULL COMMENT '用户其他信息',
  `u_flag` smallint(6) DEFAULT NULL COMMENT '用户标识',
  `u_regtime` varchar(50) DEFAULT NULL COMMENT '用户注册时间',
  `u_avatr` varchar(50) DEFAULT NULL COMMENT '用户头像',
  `u_sex` tinyint(1) DEFAULT NULL COMMENT '用户性别',
  `u_birthday` date DEFAULT NULL COMMENT '用户生日',
  `u_qq` varchar(100) DEFAULT NULL COMMENT '用户qq',
  `u_login_num` int(11) DEFAULT '0' COMMENT '登录次数',
  `u_login_time` varchar(50) DEFAULT NULL COMMENT '当前登录时间',
  `u_old_login_time` varchar(50) DEFAULT NULL COMMENT '上次登录时间',
  `u_login_ip` varchar(20) DEFAULT NULL COMMENT '当前登录ip',
  `u_old_login_ip` varchar(20) DEFAULT NULL COMMENT '上次登录ip',
  `is_buy` tinyint(1) DEFAULT '1' COMMENT '会员是否拥有购买权限 1 为开启 0 为关闭',
  `u_state` tinyint(1) DEFAULT '1' COMMENT '会员的开启状态 1 为开启 0 为关闭',
  PRIMARY KEY (`u_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='会员用户表';

-- -------------------------------------------
-- TABLE `dp_verification_code`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_verification_code`;
CREATE TABLE IF NOT EXISTS `dp_verification_code` (
  `code_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增长id',
  `code_add_time` int(11) NOT NULL COMMENT '验证码添加时间',
  `code_code_value` int(5) DEFAULT NULL,
  `code_status` tinyint(2) DEFAULT NULL COMMENT '添加状态',
  `code_send_time` int(11) DEFAULT NULL COMMENT '发送时间',
  `code_verification_time` int(11) DEFAULT NULL COMMENT '验证时间',
  `code_phone` varchar(255) DEFAULT NULL COMMENT '验证码发送的手机号码',
  PRIMARY KEY (`code_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_voucher_center`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_voucher_center`;
CREATE TABLE IF NOT EXISTS `dp_voucher_center` (
  `voucher_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '充值列表id',
  `voucher_money` decimal(11,0) DEFAULT NULL COMMENT '充值的金额',
  `voucher_order_id` varchar(255) DEFAULT NULL COMMENT '托管费用的订单(json数据源)',
  `voucher_invoice_id` varchar(255) DEFAULT NULL COMMENT '发票的id(json数据源)',
  `voucher_balance_money` decimal(11,0) DEFAULT NULL COMMENT '录入余额的金额',
  `voucher_order_money` decimal(11,0) DEFAULT NULL COMMENT '支付订单的金额',
  `voucher_invoice_money` decimal(11,0) DEFAULT NULL COMMENT '支付发票的金额',
  `voucher_add_time` int(11) DEFAULT NULL COMMENT '添加时间',
  `voucher_emp_id` int(11) DEFAULT NULL COMMENT '雇主id',
  `voucher_admin_id` int(11) DEFAULT NULL COMMENT '后台操作人id',
  `voucher_balance_front_money` decimal(11,0) DEFAULT NULL COMMENT '账户充值前的余额',
  `voucher_emp_info` text,
  `voucher_eng_id` int(11) DEFAULT NULL,
  `voucher_type` int(11) DEFAULT '1' COMMENT '充值的类型1：雇主    2：工程师',
  `voucher_eng_info` text,
  PRIMARY KEY (`voucher_id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_withdrawal`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_withdrawal`;
CREATE TABLE IF NOT EXISTS `dp_withdrawal` (
  `withdrawal_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '提现表增长id',
  `withdrawal_type` tinyint(4) DEFAULT NULL COMMENT '提现类型100：工程师提现 101：雇主提现',
  `withdrawal_money` decimal(10,4) DEFAULT NULL COMMENT '提现金额',
  `withdrawal_add_time` int(11) DEFAULT NULL COMMENT '提现时间',
  `withdrawal_bind_alipay_id` int(11) DEFAULT NULL COMMENT '提现支付宝账户',
  `withdrawal_bind_bank_card_id` int(11) DEFAULT NULL COMMENT '提现银行卡绑定id',
  `withdrawal_status` tinyint(4) DEFAULT NULL COMMENT '提现的状态 100：未审核 101：已审核未打款 102：已打款',
  `withdrawal_emp_id` int(11) DEFAULT NULL COMMENT '提现雇主',
  `withdrawal_eng_id` int(11) DEFAULT NULL COMMENT '提现工程师id',
  `withdrawal_examine_admin_id` int(11) DEFAULT NULL COMMENT '审核操作员id',
  `withdrawal_examine_add_time` int(11) DEFAULT NULL COMMENT '审核时间',
  `withdrawal_success_admin_id` int(11) DEFAULT NULL COMMENT '打款操作员id',
  `withdrawal_success_add_time` int(11) DEFAULT NULL COMMENT '打款操作时间',
  PRIMARY KEY (`withdrawal_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8;

-- -------------------------------------------
-- TABLE `dp_work`
-- -------------------------------------------
DROP TABLE IF EXISTS `dp_work`;
CREATE TABLE IF NOT EXISTS `dp_work` (
  `work_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '作品自增长id',
  `work_name` varchar(128) DEFAULT NULL COMMENT '作品名称',
  `work_part_type` tinyint(4) DEFAULT NULL COMMENT '作品零件类型',
  `work_material` varchar(64) DEFAULT NULL COMMENT '作品的材质',
  `work_mold_type` tinyint(4) DEFAULT NULL COMMENT '作品模具类型',
  `work_thick` float DEFAULT NULL COMMENT '作品板厚',
  `work_mode_production` tinyint(255) DEFAULT NULL COMMENT '作品生产方式',
  `work_pic_url` varchar(255) DEFAULT NULL COMMENT '作品图片',
  `work_enclosure` varchar(255) DEFAULT NULL COMMENT '作品附件',
  `work_add_time` int(11) DEFAULT NULL COMMENT '添加时间',
  `work_eng_id` int(11) DEFAULT NULL COMMENT '作品所属工程师id',
  `work_examine_status` tinyint(4) DEFAULT '102' COMMENT '作品审核的状态100：审核通过 101：审核未通过 102：未审核',
  `work_examine_id` int(11) DEFAULT NULL COMMENT '审核人id',
  `work_examine_opinion` varchar(255) DEFAULT NULL COMMENT '审核的意见',
  `work_examine_add_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`work_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8;

